w.oregonstateparks.org/park_20.php','','Meacham, OR 97859','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('230bc2fe-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Alice Keck Park Memorial Gardens','The El Mirasol Hotel formerly stood on this site. The land was donated to the city in 1975. The garden is planted with xeriscape plants for water efficiency. There is a sensory garden, koi pond and gazebo.','','','','','','','','','1500 Santa Barbara Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','93101','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('231e75f8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Balboa Park Garden','After a naming competition in 1910 \'Balboa Park\' was chosen because the park has a good view of the Pacific Ocean and Vasco Nú?ez de Balboa was the first European to see it. The 1915 Panama-California Exposition was held in the Park and a number of Spanish Colonial Revival buildings were put up, and a Japanese Friendship Garden. Another exhibition was in 1935 led to more buildings and some garden designs, including an Acalazar Garden inspired by the original in Seville. Marston House is a 1905 Arts and Crafts style house and garden. Other theme gardens include: Australian Garden, California Native Plant Garden, Casa del Rey Moro Garden (House of the Moorish King), Desert Garden, Old Cactus Garden, Inez Grant Parker Memorial Rose Garden, Trees for Health Garden and the Zoro Garden . ','','','','','','','','','1549 El Prado','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','92101','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2323a2f4-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Juneau Trail System','','','','','','','','http://dnr.alaska.gov/parks/aspbro/charts/sejuneau.htm','','400 Willoughby Ave, Juneau, AK, 99801','7f7a92b8-ea4c-11e0-8606-00306701b527','ec4dd047-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('232d7d85-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Berkeley Rose Garden','The Rose Garden is an amphitheatre set into a hill overlooking the Bay. It was made under the Works Project Administration. Rose societies and community members have donated plants and volunteer time. The terraced amphitheatre and redwood pergola were designed by landscape architect Vernon M. Dean and rose specialist C. V. Covell. ','','','','','','','','','Euclid Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94710','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('233cf3e7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Blake Garden','The garden began in the 1920s as the home of Mr and Mrs Anson Blake. The design was by Mable Symmes one of the first students at the Berkeley Department of Landscape Architecture. The garden is now run by the Department as an outdoor laboratory for plants and planting design and other studies in landscape architecture and environmental design. ','','','','','','','','','University of California Blake Garden, Department of Landscape Architecture and Environmental Planning, 70 Rincon Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94707','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2340d287-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Sprewell Bluff State Park','','','','','','7 am -Sunset ','','http://gastateparks.org/SprewellBluff','','740 Sprewell Bluff Road, Thomaston, GA 30286','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('234eb748-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','California Academy of Sciences','The new California Academy of of Sciences building opened on 17th September 2008. The sustainable design includes a 2.5 acre living roof and 60,000 photovoltaic cells. There is also a garden, aviary and four story living tropical rainforest enclosed in a glass dome.','','','','','','','','','55 Music Concourse Drive, Golden Gate Park','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94118','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23539973-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Chenango Valley State Park ','','','','','','Open year-round, from sunrise to sunset.','','http://nysparks.state.ny.us/parks/41/details.aspx','','153 State Park Road,Chenango Forks, NY 13746','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('235d9951-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','California Scenario','California Scenario was designed by sculptor Isamu Noguchi in 1980. Noguchi was a Japanese American sculptor and landscape architect, born in California. The design represents the landscape of California and uses many of Noguchi\'s sculptures. ','','','','','','','','','South Coast Plaza, 611 Anton Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','92626','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2367a72f-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Hope State Park','','','','','','','','http://www.dnr.state.oh.us/parks/parks/lakehope/tabid/754/Default.aspx','','27331 State Route 278, McArthur, OH 45651','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('236dcb63-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Casa del Herrero','A Spanish Revival house with set in an 11 acre estate designed by landscape architects Ralph Stevens and Lockwood de Forest and completed in 1933. Casa del Herrero means House of the Blacksmith. Ganna Walska Lotusland is close by - both properties require advance reservation and with planning could be visited on the same day.','','','','','','','','','1387 East Valley Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','93108','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('237952b4-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Leo Carrillo State Park','','','','','','Gate is locked from 10pm to 8am. No entry after 10pm.','','http://www.parks.ca.gov/default.asp?page_id=616','','35000 W. Pacific Coast Highway, Malibu,?CA?90265','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('237e4da7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cornerstone Festival of Gardens','A festival of experimental garden designs, comparable to Chaumont in France and the Westonbirt Festival of Gardens in England - but regarded more as an art gallery with exhibitions than a permanent installation. ','','','','','','','','','23570 Hwy 121','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','95476','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('238a3119-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Echo Lake State Park','','','','','','','','http://nhstateparks.com/echo.html','','Off of Route 302, Conway','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('238cee14-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Davis Arboretum Garden','The Arboretum specializes in plants adapted to a Mediterranean climate: hot dry summers and cool,wet winters. It is on the banks of the old north channel of Putah Creek. The Ruth Ridson Storer Garden has a collection of herbaceous perennials and small shrubs. The Carolee Shields White Flower garden is based on the idea of a Moon Garden, as found in India.','','','','','','','','','UC Davis Arboretum, University of California, One Shields Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','95616','2011-12-22 14:35:03','a1c3e20e-f181-11e0-8a53-00306701b527',1),('239acc3c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Caballo Lake State Park','','','','','','','','http://www.emnrd.state.nm.us/PRD/caballo.htm','','P.O. Box 32，Caballo, NM  87931','7f7a92b8-ea4c-11e0-8606-00306701b527','ed25625a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('239b90b9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Descanso Gardens','A South California garden with very large collections of camelias, roses and irises. There is also a Japanese garden and an area devoted to plants native to the area. ','','','','','','','','','1418 Descanso Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','91011','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23ab64d7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','El Novillero Garden','Also known as the Donnell Garden, in Sonoma, El Novillero is a marvellous example of the curvilinear abstract style and, in the words of the Oxford Companion to Gardens \'one of the most significant gardens of the twentieth century\'. It may well be the most photographed. The house and garden sit in the Sonoma Hills with a good prospect over California. The swimming pool is set in paving and decking, framed by Live Oaks. Though often described as \'free-form\', the swimming pool is V-shaped with radial curves (and is visible on the satellite image on the map below). The design recalls images from cubist and surrealist painting. It has a sublime calm. ','','','','','','','','','27235 Arnold Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','95476','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23bbf628-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Elizabeth Gamble Garden','The former home and garden of Elizabeth Gamble (daughter of the founder of Proctor and Gamble) was given to the city of Palo Alto and is run as a non-profit garden center. The house is in a colonial style and the garden retains an Arts and Crafts character. The original garden design was by Alan Reid. ','','','','','','','','','Elizabeth F Gamble Garden Center, 1431 Waverley Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94301','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23bd8441-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Sebastopol House State Historic Site','','','','','','Open: This is a day-use park open Friday - Sunday 9 a.m. to 4 p.m.; other days by appointment. Closed Thanksgiving, Christmas, Easter and New Year\'s Day.','','http://www.tpwd.state.tx.us/spdest/findadest/parks/sebastopol/','','P.O. Box 900, Seguin, TX 78156','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23cadb13-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ferrari-Carano Gardens','The garden was designed by Rhonda Carano in 1987. In the spring, there is a display of over 10,000 tulips and daffodils.','','','','','','','','','8761 Dry Creek Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','95448','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23cd1a4d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','High Falls State Park','','','','','','7 am- 10 pm','','http://www.gastateparks.org/HighFalls','','76 High Falls Park Dr, Jackson, GA 30233','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23db697f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Filoli Garden','Set in a wooded Californian valley, Filoli is an outstanding example of the Italian phase of the Arts and Crafts style. It was designed by Willis Polk in 1915. The name is taken from the owner\'s credo \'FIght for a just cause, LOve your fellow man, LIve a good life\'. The garden has a central axis and a series of compartments enclosed by hedges. The Walled Garden is subdivided into rooms. There is also a woodland garden. There is naturalistic planting, in the manner of Gertrude Jekyll, but using Mediterranean plants, and there annual bedding. Filoli has often been used as a movie set and was used in the opening shot of the TV series Dynasty. ','','','','','','','','','Canada Road, Woodside','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94062','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23dd764e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Elephant Butte Lake State Park','','','','','','','','http://www.emnrd.state.nm.us/PRD/elephant.htm','','P.O. Box 13 ，Elephant Butte,NM  87935','7f7a92b8-ea4c-11e0-8606-00306701b527','ed25625a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23ebfe34-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Forrest Deaner Native Plant Botanic Garden','Forrest E. Deaner inspired and helped organise a native plant botanic garden in California. It is near the town of historic Benicia and has views of the Carquinez Strait, the San Joaquin River and the Sacramento River. It has a Butterfly/Hummingbird Garden, a Riparian Garden, a Residential/Community Garden, a Native American Garden, a Wildflower Meadow and a collection of Oaks and other Native trees.','','','','','','','','','Benicia State Recreation Area','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94510','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23ef2e17-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Santee State Park','','','','','','M-Su 6am-10pm (year-round)','','http://www.southcarolinaparks.com/park-finder/state-park/535.aspx','','251 State Park RD, Santee, SC 29142','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23ff66e9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Fullerton Arboretum Garden','The Garden was designed to support educational programs. Its paths link the four major collections: Cultivated, Woodlands, Mediterranean and Desert Collections.','','','','','','','','','1900 Associated Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','92831','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('23fffb82-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Alexandria State Recreation Area','','','','','','','','http://outdoornebraska.ne.gov/parks/guides/parksearch/showpark.asp?Area_No=1','','75426 710th Rd, Faibury, NE 68352','7f7a92b8-ea4c-11e0-8606-00306701b527','ed0bdbcc-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('240e2558-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ganna Walska Lotusland Garden','Lotusland, in the foothills of Montecito, was created by Madame Ganna Walska, who owned the property from 1941 to 1984. She was a much-married Polish opera singer. She took advice from two local landscape architects: Lockwood de Forest and Ralph T Stevens but remained a strong personal influence on the gardens: they are romantic and flamboyant.  There is an engaging review of the garden on the Paris By Appointment Only blog.','','','','','','','','','Ganna Walska Lotusland','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','93108','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2410f429-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fort Revere','','','','','','Fort Revere Park is open daily, sunrise to sunset, year round.','','http://www.mass.gov/dcr/parks/metroboston/ftrevere.htm','','60 Farina Road, Hull, MA 02045','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('241bcef4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Getty Center Garden','A modern garden by Robert Irwin in a museum designed by Richard Meier. Irwin is an installation artist and was a member of California\'s \'light and space\' movement in the 1960\'s. He described his work for the Getty as \'a sculpture in the form of a garden aspiring to be art.\' The clinical abstraction of the building contrasts with the rich textures of the garden. The garden was designed by the artist Robert Irwin 1992-7. He worked with the architect of the Getty Centre, Richard Meier, and with the landscape architecture firm Spurlock Poirier. The design of the garden re-establishes the natural ravine between the Museum and the Research Institute. A tree-lined walkway crosses the stream passing through areas of exotic grasses and descends to a plaza with bougainvillea arbors. The stream flows through the plaza and cascades over a stone waterfall into a pool. There are special gardens round the pool with the plants and hard materials selected for their interplay of color, light, and reflections. The garden provides a campus setting for the immaculate white travertine buildings and there panoramic views of Los Angeles. \'In the studio you may reference nature but you also reference all art. The big shift for me is that my art practice is now not so much referenced art historically as it is conditionally. When I confront a space with its specific set of conditions, I try to take into account everything bearing on it. For example, a sense of scale is not only in and of itself but is equally conditioned by where you arrive from-the scale of the New York subway or the big sky country of Montana. I try to take all of this into account\' Jan Butterfield, Robert Irwin: The Art of Light and Space (New York: Abbeville Press, 1993), p. 63 ','','','','','','','','','1200 Getty Center Drive, Los Angeles','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','90049','2011-12-22 14:35:04','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2421d252-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Robinson State Park','','','','','','','','http://www.mass.gov/dcr/parks/central/robn.htm','','462 North St., Feeding Hills, MA 01030','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('242b1a9d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Getty Villa Malibu','The Peristyle Garden at the Getty Museum is based on an Italian villa garden buried by the erruption of Mount Vesuvius in 79AD. The garden, which is enclosed by a peristyle with a red tiled roof and frescoed walls, has a central pool and is planted with oleander, myrtle, roses, violets and other Mediterranean plants. It is based on the Villa dei Papiri at Herculaneum. Paul Getty commissioned the design, in 1974, and the architect  Norman Neuerburg based on a plan on the best archaeological information available: a plan by Karl Weber. The planting design, unfortunately, was not based on archaeological or even historical information. It was based on the theory that because Re-naissance translates as \'re-birth\', one can discover the character of Roman gardens by working backwards from Renaissance gardens.','','','','','','','','','17985 Pacific Coast Highway, Malibu','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','90265','2011-12-22 14:35:05','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24359b0d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Carolina Beach State Park','','','','','','November - February, 8 a.m. - 6 p.m. March, April, September, October 8 a.m. - 8 p.m. May - August, 8 a.m. - 10 p.m. Closed Christmas Day.','','http://www.ncparks.gov/Visit/parks/cabe/main.php','','1010 State Park Road, PO Box 475, Carolina Beach, NC 28428','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('243ae0e6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Golden Gate Park','Golden Gate Park was designed by William Hammond Hall. He become park commissioner in 1871 and was followed by John McLaren in 1887. McLaren had served apprenticeship to a landscape gardener in Scotland and spent 50 years working on Golden Gate Park. His office, McLaren Lodge, is a Moorish-Gothic style building. It is still the HQ of the Recreation and Parks Department and serves as a monument to McLaren\'s design philosophy: he favoured the Mixed Style. The Japanese Tea Garden began as the Japanese Village in the 1894 California Midwinter International Exposition, or World\'s Fair. McLaren was approached by Makoto Hagiwara, a Japanese landscape designer, who suggested making the feature permanent and adding a garden. It was maintained by his family from 1895 to 1942 (when they were moved to a concentration camp). Golden Gate Park also has a Dutch windmill, a conservatory, carpet bedding, an arboretum and a botanical garden. A fine example of a European mark transported to the west coast of the New World, the park attracts 75,000 visitors on an average weekend.','','','','','','','','','Fell Street, San Francisco','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94117','2011-12-22 14:35:05','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24490ec9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Green Gulch Garden','The garden of a Buddhist practice center in the Japanese Soto Zen tradition offering training in Zen meditation. It was started by Alan Chadwick in the 1970s. The garden is arranged more as a series of English garden rooms than as a Japanese garden. ','','','','','','','','','Green Gulch Farm Zen Center, Green Dragon Temple (Soryu-ji), 1601 Shoreline Highway, ','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94965','2011-12-22 14:35:05','a1c3e20e-f181-11e0-8a53-00306701b527',1),('244f0e7b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c682cbd1-203b-11e1-8a87-000c29a5c50c','Crater Lake National Park','','','','','','The park is always open, but some of the roads and facilities are closed during the winter. ','','http://www.nps.gov/crla/index.htm','','P.O. Box 7, Crater Lake, Oregon 97604','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2458794d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Greystone Mansion and Park','Oil magnate Edward Laurence Doheny acquired 12.58 acres of land for his son in 1926. The creation of the garden began in the same year to the design of Paul Thiene, a German landscape architect who had worked with Frederick Law Olmsted, Jr. Stone walkways and stairways wind through the garden. Greystone Mansion and Park is now owned by the City of Beverly Hills.','','','','','','','','','905 Loma Vista Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','90210','2011-12-22 14:35:05','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2462d51b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Cheboygan State Park','','','','','','','','http://www.michigandnr.com/parksandtrails/Details.aspx?id=441&type=SPRK','','4490 Beach Rd, Cheboygan, MI 49721','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('246a2272-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hakone Gardens','Oliver and Isabel Stine named her home after one of her favorite places in Japan, Fuji-Hakone National Park. She employed Tsunematsu Shintani (1877-1921) to design her \'Moon Viewing\' House and garden designer Naoharu Aihara (1870-1941), from a family of Imperial gardeners in Koyobashi, Tokyo, to design her garden. It has a master stone, a worshipping stone, a guest Isle, a stroll garden with lanterns. The garden was purchased by the City of Saratoga in 1966 and restored by Tanso Ishihara a Kyoto garden designer. Hakone Gardens therefore have a degree of authenticity not often enjoyed by Japanese gardens outside Japan. ','','','','','','','','','Hakone Gardens, 21000 Big Basin Way','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','95070','2011-12-22 14:35:05','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24768cba-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Ogallala State Recreation Area','','','','','','','','http://outdoornebraska.ne.gov/parks/guides/parksearch/showpark.asp?Area_No=100','','1450 Highway 61N, Ogallala, NE 69153','7f7a92b8-ea4c-11e0-8606-00306701b527','ed0bdbcc-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('247c2211-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hearst Castle Gardens','A luxurious palace garden, designed for William Randolph Hearst, on hill overloking the Pacific. Terraces, which adjoin the house and step down the hill, are adorned with glazed tiles, fountains and lush planting. The design was inspired by Spanish and Portuguese villas. The enormous Neptune Pool was completed in 1936 and is pinpointed by the location marker on the satellite image below.  It is surrounded by colonnades and there is a marble Neptune statue by Charles Cassou, commissioned by Hearst. ','','','','','','','','','Hearst San Simeon State Historical Monument, 750 Hearst Castle Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','93452','2011-12-22 14:35:05','a1c3e20