rden and many others.','','','','','','','','','1151 Oxford Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','91108','2011-12-22 14:35:05','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24aa64a7-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Pua\'a Ka\'a State Wayside Park','','','','','','Daily 6:00 a.m. to 6:00p.m.','','http://www.hawaiistateparks.org/hawaiistateparks/parks/maui/index.cfm?park_id=40','','On Hana Highway (Highway 360), Haiku, HI 96708','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24ade397-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kaiser Rooftop Garden','The Kaiser Center Roof Garden was one of the first roof gardens built in the United States. It was built in the 1960s in conjunction with a classic International Style Modernist building designed by Welton Beckett as Henry J.Kaiser\'s HQ and personal residence. The roof garden has views of  of the San Francisco Bay skyline, Lake Merritt and the Oakland hills.','','','','','','','','','300 Lakeside Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94612','2011-12-22 14:35:05','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24b9fede-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','North Toledo Bend State Park','','','','','','','','http://www.crt.state.la.us/parks/intoledo.aspx','','2907 North Toledo Park Road, Zwolle, LA 71486','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc9e8b5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24bec1da-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-