rth Baldwin Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','91007','2011-12-22 14:35:06','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24de5cfc-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Luther Burbank Home and Gardens','The white clapboard home and garden of nurseryman Luther Burbank, famous for his shasta daisies. ','','','','','','','','','PO Box 1678','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','95402','2011-12-22 14:35:06','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24e3467a-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','He‘eia State Park','','','','','','7:00 am to 6:45 pm','','http://www.hawaiistateparks.org/hawaiistateparks/parks/oahu/index.cfm?park_id=16','','46-465 Kamehameha Highway, Kaneohe, HI96744','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24edcc70-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Marin Art and Garden Center','The garden was started by one of the earliest settlers of Marin County and some of the trees on the grounds date from the 1870s. It remained in private hands until it was to be sold to developers in 1943. A group of women, members of The Marin Garden Club, managed to raise the funds needed to buy eleven acres of land to preserve it for the community and thus the Marin Art and Garden Center came into being. It is more than just a garden as it now encompasses an artists group, three theatrical groups, a children\'s playground, the Ross Historical Society, and several garden groups such as Master Gardeners, a Bonsai Society, a Rose Society etc., making it a very active community resource. Parts of the garden remain as quiet areas for the enjoyment of the flowers and trees; other parts are active teaching areas for those of all ages interested in horticulture, composting, water conservation, Indian basketry, native plants, medicinal herbs etc., which are always being added to and reworked. ','','','','','','','','','30 Sir Francis Drake Boulevard','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94957','2011-12-22 14:35:06','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24f2d00f-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Caledonia State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/caledonia.aspx','','101 Pine Grove Road, Fayetteville, PA 17222','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('24fdea6e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mendocino Coast Botanical Gardens','Mendocino Coast Botanical Gardens was founded by retired nurseryman Ernest Schoefer and his wife, Betty and in 1992 were passed to the Mendocino Coast Recreation and Park District which runs one of America\'s few coastal public gardens - with the benefit of dramatic coastal scenery and a mild maritime climate. ','','','','','','','','','18220 North Highway One','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','95437','2011-12-22 14:35:06','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2501ad9e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Locust Lake State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/locustlake.aspx','','687 Tuscarora Park Road, Barnesville, PA 18214','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('250e810a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mildred E Mathias Garden','The Botanical Garden was started in 1929 and is now named after Dr. Mildred Mathias who served as Director from 1956 to 1974. It has a good collection of tropical and subtropical plants.','','','','','','','','','Mildred E Mathias Botanical Garden, University of California at Los Angeles UCLA, 405 Hilgard Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','90095','2011-12-22 14:35:06','a1c3e20e-f181-11e0-8a53-00306701b527',1),('25122a9d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','New Discovery State Park','','','','','Memorial Day Weekend -Columbus Day weekend ','10:00 AM - 9:00 PM or Official Sunset','','http://www.vtstateparks.com/htm/newdiscovery.htm','','4239 VT RT 232, Marshfield, VT 05658','7f7a92b8-ea4c-11e0-8606-00306701b527','ed9984a2-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('25200fe5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Moorten Botanical Gardens','A botanical garden and cactarium established by Slim and Patricia Moorten in 1938. Now their son Clark is the curator of the garden. Desert plants are arranged according to geographical region. ','','','','','','','','','1701 South Palm Canyon Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','92264','2011-12-22 14:35:06','a1c3e20e-f181-11e0-8a53-00306701b527',1),('25205d7f-2691