sing four levels from the courtyard, they are interspersed with 17 terraces and sculpture beds. The rectilinear composition was determined by the architects; Kiley and Scott worked on the technical and aesthetic aspects of the planting design. Kiley used native and non-native evergreen plants. The structures, in exposed aggregate concrete without natural drainage, required a new technology in the 1960s and are richly planted so that, in Kiley\'s words, \'architecture and landscape are integral and inextricable\' [Dan Kiley in his own words, by Day Kiley and Jane Amidon, Thames and Hudson, London, 1998).','','','','','','','','','1000 Oak Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','94607','2011-12-22 14:35:06','a1c3e20e-f181-11e0-8a53-00306701b527',1),('254a1414-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Colt Creek State Park','','','','','','8:00 a.m. until sundown, 365 days a year','','http://www.floridastateparks.org/coltcreek/default.cfm','','16000 State Rd 471, Lakeland, Florida 33809','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('25570963-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Rancho Los Alamitos Garden','The site has been inhabited ssince 500 AD. It has six agricultural buildings (including a working blacksmith shop), 4 acres of gardens and an adobe ranch house (c.1800). The gardens were made in the 1920s by Florence Green Bixby with the help of several landscape architects. They make calm use of white adobe and terracotta.','','','','','','','','','Rancho Los Alamitos, 6400 Bixby Hill Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','90815','2011-12-22 14:35:06