vings Time) ','','http://www.southcarolinaparks.com/park-finder/state-park/1652.aspx','','46 Maintenance Shop RD, Calhoun Falls, SC 29618','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2699b26b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Wild Animal Park Gardens, San Diego','The Wild Animal Park opened in 1972 and is run by the Zoological Society of San Diego. There is a Nativescapes Garden, Xeriscape Garden, Australian Rain Forest, Conifer Forest and Bonsai Pavilion. ','','','','','','','','','15500 San Pasqual Valley Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','92027','2011-12-22 14:35:09','a1c3e20e-f181-11e0-8a53-00306701b527',1),('26a0382e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Jarrell Cove State Park','','','','','','Summer: 6:30 a.m. to 10 p.m. Winter: 8 a.m. to 5 p.m. The park is open year round for camping and day use.','','http://www.parks.wa.gov/parks/?selectedpark=Jarrell%20Cove','','391 E. Wingert Road, Shelton, WA 98584','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('26aaa0d8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Betty Ford Alpine Gardens','Advertised as the \'world\'s highest botanic garden\' (at 8,200 feet), this botanic garden was founded by a group of Vail and Denver horticulturists. It is also one of the world\'s smallest botanic gardens but has plans to expand. Since Alpine plants tend to be small and fascinating, a large space is not the first necessity. ','','','','','','','','','530 South Frontage Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec625433-f48c-11e0-b192-00306701b527','','81657','2011-12-22 14:35:09','a1c3e20e-f181-11e0-8a53-00306701b527',1),('26b4513c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fort George Island Cultural State Park','','','','','','8:00 a.m. until sundown, 365 days a year, the center is open daily from 9:00 a.m. to 5:00 p.m','','http://www.floridastateparks.org/fortgeorgeisland/default.cfm','','State Road A1A, South Jacksonville, Florida 32226','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('26b88b62-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Centennial Gardens','This intricate garden encompasses five acres made up of plants in a classic formal design with a Colorado twist. It offers a beautiful garden setting for visitors and is composed with drought tolerance in mind. The garden uses native plants as a replacement for the water-guzzling varieties more commonly found in formal gardens. The plants used are either both native and drought-tolerant, or are adaptable to drier conditions. ','','','','','','','','','1101 Little Raven Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ec625433-f48c-11e0-b192-00306701b527','','80202','2011-12-22 14:35:09','a1c3e20e-f181-11e0-8a53-00306701b527',1),('26c3ba33-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Pennyrile Forest State Resort Park','','','','','','','','http://parks.ky.gov/findparks/resortparks/pf/','','20781 Pennyrile Lodge Road, Dawson Spring, KY 42408','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc35954-f48c-11e0-b192-00306701b527','','','2011-12-22 1