 a fine garden. Mostly, horticulture has won over design. ','','','','','','','','','Colorado State University, Department Of Horticulture And Landscape Architecture, W. D. Holley Plant Environmental Research Center PERC, 111 Shepardson Building','7f7a92b8-ea4c-11e0-8606-00306701b527','ec625433-f48c-11e0-b192-00306701b527','','80532','2011-12-22 14:35:09','a1c3e20e-f181-11e0-8a53-00306701b527',1),('270a253e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Tahoe – Nevada State Park','','','','','','','','http://parks.nv.gov/lt.htm','','P.O. Box 6116, Incline Village, NV 89450','7f7a92b8-ea4c-11e0-8606-00306701b527','ed121df0-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('270a998e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Xeriscape Demonstration Garden in Colorado Springs','The Colorado Springs Utilities Xeriscape Garden is designed to demonstrate the seven principles of Xeriscape in a wide variety of designs. The garden incorporates many different gardens styles that are arranged by water requirement so visitors can get a good idea of what styles can be achieved and what plants will thrive with different amounts of water. The garden displays more than 500 varieties of trees, shrubs, grasses, perennials, biennials and annuals that grow well in the Colorado Springs area. ','','','','','','','','','Colorado Springs Utilities, 2855 Mesa Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec625433-f48c-11e0-b192-00306701b527','','80904','2011-12-22 14:35:09','a1c3e20e-f181-11e0-8a53-00306701b527',1),('271ab923-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Bartlett Arboretum Gardens','Bartlett Arboretum was founded by Dr Francis Bartlett. The 91 acres of gardens, hiking trails, walking tours include the Cottage, Secluded and Sundial gardens, Banana and Perennial Borders (individual garden maps available at the Visitor Center). Its 13 Champion trees are some of the largest native trees in the state - many of which were planted by Dr. Francis Bartlett. The home and grounds, purchased in 1913 by Dr. Francis A. Bartlett (founder of the F.A. Bartlett Tree Expert Company), was the site of new discoveries and innovations in tree care such as the hybridization of the first blight-free chestnut tree (still common today). The Bartlett family turned the property over to the State of Connecticut in 1965 to ensure its preservation. In 2001, title of the property passed to the City of Stamford and management for the property is overseen by the Bartlett Arboretum Association. ','','','','','','','','','Bartlett Arboretum & Gardens, 151 Brookdale Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06903','2011-12-22 14:35:09','a1c3e20e-f181-11e0-8a53-00306701b527',1),('271d2a4b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Father Hennepin State Park','','','','','','','','http://www.dnr.state.mn.us/state_parks/father_hennepin/index.html','','41294 Father Hennepin Park Road, Isle, MN 56342','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf0dc60-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('272be249-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Bellamy-Ferriday Garden','This property was the home of Bethlehem\'s first minister, the Reverend Joseph Bellamy. It became a summer house in 1912 and the garden was designed in 1915. The wife of the owner (Ferriday) designed the garden to resemble an Aubusson carpet. It is geometrical with box hedging and infill planting. ','','','','','','','','','The Bellamy-Ferriday House and Garden, 9 Main Street North, P O Box 181','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06751','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('272f00d0-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Grafton Lakes State Park ','','','','','','Open all year 8am-dusk ','','http://nysparks.state.ny.us/parks/53/details.aspx','','61 North Long Pond Road, Grafton, NY 12082','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('273de9b7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Butler McCook Garden','An eighteenth century house with a Victorian ornamental garden. ','','','','','','','','','396 Main Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06103','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2750d444-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Coe Memorial Park Gardens','Coe Memorial Park was given to the city by the Coe family in 1907. There is a Civil War Monument and Victorian Promenade.','','','','','','','','','South Main and Litchfield Streets','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06790','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2754e415-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Red Rock Canyon State Park','','','','','','Park open daily, 24 hours a day.','','http://www.travelok.com/listings/view.profile/id.6275','','Hwy 281 S, Hinton, OK 73047','7f7a92b8-ea4c-11e0-8606-00306701b527','ed4ca61c-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27605dee-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Elizabeth Park Rose Garden','The garden was owned by a wealthy industrialist, Charles H. Pond and given to the City of Hartford to be a horticultural park named after his wife. The City hired the the Olmsted firm to design the park and Theodore Wirth to design the garden. He planted roses \'to please the people\' and there now over 15,000 roses in the garden (seen at their best in June).','','','','','','','','','Friends of Elizabeth Park, 1555 Asylum Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06137','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('276ab223-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Cockaponset State Forest','','','','','','recreation areas open from sunrise to sunset, other forest area are open from one-half hour before sunrise to one-half hour after sunset','','http://www.ct.gov/dep/cwp/view.asp?a=2716&q=325056&depNav_GID=1650','','18 Ranger Road, Haddam, CT 06438','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('276f1428-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Gertrude Jekyll Garden at the Glebe House Museum','This is the only surviving garden in America designed (in 1926) by Gertrude Jekyll, although it was not installed until 1989-90. It is beside an 18th century house. ','','','','','','','','','49 Hollow Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06798','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('277d53ab-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Yatesville Lake State Park','','','','','','','','http://parks.ky.gov/findparks/recparks/yl/','','PO Box 767, Louisa, KY 41230','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc35954-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('277dd638-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Harkness Mansion and Garden','A large seaside mansion with a formal garden. Between 1918 to 1929, Beatrix Jones Farrand redesigned the west garden and created the East Garden, the Boxwood Parterre and the Alpine Rock Garden. ','','','','','','','','','Harkness Memorial State Park, 275 Great Neck Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06385','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('278ef1c4-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Joseph H. Stewart State Recreation Area','','','','','','','','http://www.reserveamerica.com/campgroundDetails.do?subTabIndex=0&contractCode=or&parkCode=stew','','35251 HWY 62 Trails, OR 97541','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('278ef291-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hill Stead Gardens','Hill-Stead Museum, set on 152 acres, was the retirement home of Cleveland iron industrialist Alfred Atmore Pope and his wife Ada Brooks. The Colonial Revival-style mansion, completed in 1901, was designed by pioneering female architect Theodate Pope (Alfred\'s and Ada\'s daugher) with the help of New York architectural firm McKim, Mead and White. Theodate also enlisted the help of landscape architect Warren Manning, a protege of Fredrick Law Olmsted, in designing the grounds. A centerpiece of Hill-Stead\'s property is the c. 1920, Beatrix Farrand-designed Sunken Garden. This \'subterranean\' garden boasts a summerhouse, yew hedge, brick walkways and 36-bed perennial garden with over 90 plant varieties. Little of Farrand\'s admiration for Gertrude Jekyll is apparent in the design. ','','','','','','','','','Hill-Stead Museum, 35 Mountain Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06032','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('279e47af-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Sundial Garden','The owners description of their property as \'a Persian-style knot garden, an 18th century style garden with geometric walkways, and a topiary garden with boxwood, roses and ivy garlands surrounding a fountain\' is fairly descriptive but ignores such historical facts as that the Persians are not know to have designed knot gardens. ','','','','','','','','','The Sundial Gardens, 59 Hidden Lake Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','06441','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('279fe803-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Refuge Cove State Recreation Site','','','','','','','','http://dnr.alaska.gov/parks/aspunits/southeast/refugecvsrs.htm','','Ketchikan, AK','7f7a92b8-ea4c-11e0-8606-00306701b527','ec4dd047-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27b009e7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Delaware Botanic Gardens','The garden is botanically interesting and aestheically rather dull. There is a Herbaceous Garden, Native Garden and Landscape Color Trial Garden.','','','','','','','','','College of Agriculture & Natural Resources, Townsend Hall, 531 South College Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec70a389-f48c-11e0-b192-00306701b527','','19717','2011-12-22 14:35:10','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27b7f89d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Versailles','','','','','','','','http://www.in.gov/dnr/parklake/2963.htm','','Box 205, U.S. 50, Versailles, IN 47042','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27bfc9f3-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','E I du Pont Garden','Hagley is the birthplace of the DuPont Company. EI du Pont came from France to America as a gardener and retained his interest in gardens after founding the chemical company which bears his name. The garden has been restored on its original site to the period of its cultivation by E. I. du Pont, 1803-1834. There are carefully laid out planting beds crisscrossed by gravel paths and bordered by fruit trees. A significant feature of the early garden was the border planting of dwarf fruit trees trained en quenouille, a style popular in France. Various garden structures installed by du Pont a pump (1811) and summerhouse (1817) have been reconstructed. It is a colourful garden with hyacinths, crocuses, jonquils and trumpet narcissus in spring and then zinnias, cardinal flowers and sunflowers followed by scarlet sage, chrysanthemums and dahlias in summer. The plan for the restored garden was drawn in 1972 by William H. Frederick, Landscape Architect. ','','','','','','','','','Hagley Museum and Library, PO Box 3630','7f7a92b8-ea4c-11e0-8606-00306701b527','ec70a389-f48c-11e0-b192-00306701b527','','19807','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27ccb9e3-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Nerstrand-Big Woods State Park','','','','','Spring: Saturday - Sunday, 9 a.m. - 4 p.m.; Monday - Friday, variable ','','','http://www.dnr.state.mn.us/state_parks/nerstrand_big_woods/index.html','','9700 170th Street East, Nerstrand, MN 55053','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf0dc60-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27d0a0d4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mt Cuba Center','A Colonial Revival manor house built by Mr and Mrs Lammot du Pont Copeland in 1935. The garden and terraces were originally designed by Thomas W Sears. In 1950s, the Copelands hired Marian C. Coffin to design the Round Garden. There is a swimming pool in the shape of a Maltese cross at the centre of the Round Garden. Seth Kelsey designed the woodland wildflower gardens in the 1960s. ','','','','','','','','','3120 Barley Mill Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec70a389-f48c-11e0-b192-00306701b527','','19707','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27deefb5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Nemours Mansion & Gardens','A twentieth century garden influenced by France but ill-suited to the \'mini-Versailles\' label which is sometimes used to describe the garden. There is a terrace north of the house from which steps descend to a reflecting pool. Across the water there is a parterre and a colonnade leading on to a sunken garden with rococo stairways to a sunken garden and a Temple of Love. The garden\'s atmosphere is closer to south Germany than north France - there is an echo of Linderhof.','','','','','','','','','Rockland Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec70a389-f48c-11e0-b192-00306701b527','','19803','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27ec9bef-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','West Branch State Park','','','','','','','','http://www.dnr.state.oh.us/parks/parks/westbrnch/tabid/795/Default.aspx','','5708 Esworthy Road, Ravenna, OH 44266','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('27f37a83-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Rockwood Mansion and Garden','Rockwood has an English style country estate in the Gothic Revival style. Joseph Shipley, a merchant banker, spent most of his life in Liverpool, England and Rockwood Mansion was inspired by Wyncote, his English house (designed by George Williams). The garden is thoroughly gardenesque. ','','','','','','','','','Rockwood Museum, 610 Shipley Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec70a389-f48c-11e0-b192-00306701b527','','19809','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2800b3db-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Otter Creek State Park','','','','','','Summer - 6:00 a.m. to 10:00 p.m. Winter - 8:00 a.m. to 5:00 p.m. ','','http://stateparks.utah.gov/parks/otter-creek','','PO Box 43, Antimony, UT 84712','7f7a92b8-ea4c-11e0-8606-00306701b527','ed934339-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28030e3c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Winterthur Garden','Winterthur is a 1,000-acre country estate with gardens, rolling hills, streams, meadows and forests. The Winterthur Garden was designed by Henry Francis du Pont (1880-1969) and landscape architect and lifelong friend Marian Coffin. Henry was careful to select plants that would enhance the natural setting and provide a succession of bloom and colour from late January through to November. The garden includes the eight-acre Azalea Woods (1917), the March Bank (1902), Magnolia Bend, the Pinetum (1918), Winterhazel Area (1923), Sundial Garden (1956), Peony Garden (1946), Reflecting Pool and Glade Garden (1929), Quarry Garden (1962), and Enchanted Woods (2001), a children’s garden. If you zoom in on the location map below, you will be able to see some of the garden features on the satellite image. The Sundial Garden is pinpointed by the red marker. ','','','','','','','','','Winterthur Museum Garden and Library, 5105 Kennett Pike','7f7a92b8-ea4c-11e0-8606-00306701b527','ec70a389-f48c-11e0-b192-00306701b527','','19735','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28137502-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Dumbarton Oaks','Begun in 1920, the garden was designed by Beatrix Farrand. She admired the Arts and Crafts style of Gertrude Jekyll, but there is a fresh spirit to Dumbarton Oaks. Farrand was a well-travelled and professional designer, open to a wider range of cultural influences than Jekyll. The ellipse is an exercise in geometry. The pebble garden is an original idea, based on a wheatsheaf mofit, made with pebbles from Mexico and covered with a film of water to display their vibrancy. The pool in front ot the logia was designed for swimming. Farrand was expert in the handling of steps, walks and planting. ','','','','','','','','','1703 32nd Street, NW','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20007','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28151f53-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Border Field State Park','','','','','','9:30am to 5:00pm ','','http://www.parks.ca.gov/?page_id=664','','1500 Monument Rd, San Diego,?CA?92154','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28239aef-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Federal Reserve Gardens','The Fed\'s gardens were damaged in the winter of 1977 and then redesigned by Wolfgang Oehme and James van Sweden. There is a spirited fountain and lush planting of native grasses. The combination gives the garden a fresh and upward character . The Fed website gives little information about the garden, but does tell you how to complain. ','','','','','','','','','Federal Reserve Board, 20th and C Streets, N.W','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20551','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28276550-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Sibley State Park','','','','','','','','http://www.dnr.state.mn.us/state_parks/sibley/index.html','','800 Sibley Park Rd, New London, MN 56273','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf0dc60-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2833f310-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Franciscan Monastery Gardens','Re-creations of shrines from the Holy Land in a garden setting. ','','','','','','','','','1400 Quincy Street NE','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20017','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('283e171a-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','The Cove Palisades State Park','','','','','','','','http://www.oregonstateparks.org/park_32.php','','7300 SW Jordan Rd, Culver, Oregon 97734','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28443069-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hillwood Museum & Gardens','Marjorie Merriweather Post (1887-1973) purchased Hillwood Estate in 1955.  At one time, she was the richest woman in America, having become the owner of Postum Cereal Company (Post Cereals) at age 27, when her father died.  She hired a number of prominent landscape architects to design the gardens - including Umberto Innocenti and Richard Webel. There is a parterre, Japanese-influenced pleasure garden, circular rose garden with a pergola and pet cemetery.  The estate was bequeathed to the public on her death.','','','','','','','','','4155 Linnean Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20008','2011-12-22 14:35:11','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28519c89-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Beachside State Recreation Site','','','','','','','','http://www.oregonstateparks.org/park_122.php','','Medford, OR 97501','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('285579cb-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kenilworth Aquatic Gardens','Civil War veteran Walter B. Shaw, orginally from Maine purchased land on the banks of the Anacostia River in the 1880s. Homesick for his home state, he brought and planted wild waterlilies native to Maine. In 1912, he opened W.B. Shaw Lily Ponds as a commercial attraction. The gardens are now run by the National Park Service and are on the National Register of Historic Places.','','','','','','','','','Anacostia Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20020','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28628c3c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','National Cathedral Gardens','The gardens were designed by Frederick Law Olmsted, Jr. and occupy two thirds of the Washington National Cathedral site. The site layout was started in 1907 but the cathedral was not completed until 1990. A number of gardens were made within the Olmsted landscape in the intervening years - including a herb garden with plants from Walafried Strabbo\'s famous medieval poem Hortulus. ','','','','','','','','','Washington National Cathedral, Massachusetts and Wisconsin Avenues, NW','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20016','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('287254d9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Old Stone House Garden','Georgetown was established in 1751 and the Old Stone House is believed to be the oldest surviving building on its original site in the Washington area. The grounds of the house were probably used for a kitchen garden and livestock and are now a pleasure garden, managed by the National Park Service, with fruit trees and flowers. ','','','','','','','','','Old Stone House, 3501 M St.','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20008','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2876d500-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Starvation Creek State Park','','','','','','','','http://www.oregonstateparks.org/park_170.php','','Cascade Locks, OR 97014','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2881ea9c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The White House Garden','President George Washington purchased the land for what is now the South Lawn of the White House. John Adams commissioned a garden and Thomas Jefferson had it redesigned, along the lines of his own estate at Monticello, as an English parkland with groves of trees and a flower garden. John Quincy Adams developed the flower garden and began the planting of ornamental trees. Edith Roosevelt commissioned a colonial garden, in 1902, and it was made into the present Rose Garden, in 1913, by Woodrow Wilson’s wife, Ellen. She also asked a landscape architect, Beatrix Farrand, to design the East Side of the White House garden. Franklin D. Roosevelt commissioned Olmsted Brothers ( Frederick Law Olmsted, Junior) in 1935, to redesign the gardens and his plan survives. John F. Kennedy had the Rose Garden redesigned for ceremonial use. No other head of state has an official residence with such an excellent representation of the country\'s leading landscape and garden designers.','','','','','','','','','South Coast Highway','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','92651','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28887abf-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Thompson\'s Mills State Heritage Site','','','','','','','','http://www.oregonstateparks.org/park_256.php','','32655 Boston Mill Drive, Shedd, OR 97377','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('289333cc-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Tudor Place Garden, Washington','Tudor Place in Georgetown Heights was built by Martha Washington\'s granddaughter (Martha Curtis Peter) and her husband.The house was designed by Dr. William Thornton. The garden, directed by Martha, has lawns, trees, shrubs, roses and a geometrical flower garden. The box edging came from George Washington\'s house at Mount Vernon. ','','','','','','','','','Tudor Place Foundation, Inc., 1644 31st Street NW','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20007','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('289c39c2-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Cutler Park','','','','','','Open year-round, dawn to dusk. ','','http://www.mass.gov/dcr/parks/metroboston/cutlerPark.htm','','Kendrick St, Needham, MA 02494','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28a447f7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','US Botanic Garden','The USBG is America\'s oldest Botanic Garden, though the plans of 1816 took a long time to develop and the present site of the conservatory was chosen only in 1933. It is now run in connection with the US National Garden on the Capitol Grounds which has the aim of being to gardening what the Smithsonian Museum is to art. It will comprise the First Ladies Water Garden, the Rose Garden and a Regional Garden ','','','','','','','','','245 First Street, S.W.','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20024','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28b3da66-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','US National Arboretum Garden, Washington','The USNA was established for scientific research and education, and to display plants which \'conserve and enhance the environment\'. The character is woodland and there a number of gardens with different designs. The oldest collection in the arboretum is on Azalea Hill. In the center of the arboretum is a composition of sandstone columns (from the old east portico of the Capitol) by Russell Page (a British garden designer and author of a popular book on The Education of a Gardener). There is also a garden of ferns and prarie plants by Wolfgang Oehme and James van Sweden (authors of a book on Gardening with Nature). The Dwarf Conifer Garden was the work of William Gotelli.','','','','','','','','','United States National Arboretum, 3501 New York Avenue, NE','7f7a92b8-ea4c-11e0-8606-00306701b527','ec77a560-f48c-11e0-b192-00306701b527','','20002','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28b42fbe-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lone Pine State Park','','','','','All Year','Winter: 8:00am - 6:00pm\r\nSummer 8:00am - 10:00pm ','','http://visitmt.com/categories/moreinfo.asp?IDRRecordID=3078&siteid=1','','300 Lone Pine Road, Kalispell, MT 59901','7f7a92b8-ea4c-11e0-8606-00306701b527','ed049c7e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28c7b34b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Alfred B Maclay State Gardens','A 1920s garden with pools and fountains, richly planted with camellias and rhododendrons. ','','','','','','','','','3540 Thomasville Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','32308','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28ca3b9a-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Stone Mountain State Park','','','','','','November - February, 8 a.m. - 6 p.m.  March, April, September, October, 8 a.m. - 8 p.m.  May - August, 8 a.m. - 9 p.m. Closed Christmas Day.','','http://www.ncparks.gov/Visit/parks/stmo/main.php','','3042 Frank Parkway, Roaring Gap, NC 28668','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28d760c2-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','American Orchid Society Botanical Garden','The American Orchid Society was established in 1921 and moved to its current location in Morikami Park in 2001. There is a Jungle Garden, Florida Native Garden, courtyard, lake and 4000 square foot display greenhouse with a waterfall.','','','','','','','','','16700 AOS Lane','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33446','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28e26d04-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Gifford Pinchot State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/giffordpinchot.aspx','','2200 Rosstown Rd., Lewisberry, PA 17339','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28e544cd-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Audubon Gardens','John James Audubon the famous ornithologist, is believed to have done many of his drawings of Florida birds in Audubon House garden. It was built in 1820 by Captain John Huling Geiger, a harbor pilot and master wrecker. The gardens have brick paths, orchids bromeliads, native plants and herbs. ','','','','','','','','','Audubon House & Tropical Gardens, 205 Whitehead Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33040','2011-12-22 14:35:12','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28f4e9b9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cypress Gardens (FL)','A cypress swamp garden made on the former Deal Hall Plantation. The garden specialises in azaleas, camellias and spring bulbs. The garden became Florida\'s first theme park, in 1936, and holds a number of garden events. There is an old Banyan Tree planted by Dick Pope Sr., the founder of the Cypress Gardens. ','','','','','','','','','6000 Cypress Gardens Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33884','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('28f66d0d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Spirit Mound Historic Prairie','','','','','','','','http://gfp.sd.gov/state-parks/directory/spirit-mound/','','31148 SD Hwy 19, Vermillion, SD 57069','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2903b55b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Deering Estate at Cutler','The Deering Estate overlooks Biscayne Bay. The estate was home to Charles Deering, son of the founder of the Deering Harvester Company and brother of James Deering who built Vizcaya. There are a number of ecologically important habitats within the 444 acres of the estate including coastal tropical hardward rockland hammocks, salt marshes, mangrove forests and pine rockland habitat.','','','','','','','','','16701 SW 72 Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33157','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('290fcbad-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Pescadero State Beach','','','','','','Day-use Area 8:00am to Sunset','','http://www.parks.ca.gov/default.asp?page_id=522','','Pescadero,?CA?94060','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29103596-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Edison and Ford Winter Estates Gardens','Thomas Alva Edison\'s winter home and garden are beside the Caloosahatchee River in Fort Myers. It is a vernacular house, known as \'Seminole lodge\' to the Edisons. Edison\'s friend Henry Ford purchased the neighboring property in 1915 - \'The Mangoes\'. Edison, one of the world\'s greatest inventors, treated the garden as a botanical laboratory and bred an extra-vigorous Golden Rod. His wife made water features in the garden. ','','','','','','','','','Edison & Ford Winter Estates, 2350 McGregor Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33901','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('291f8c80-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Fairchild Garden','David Fairchild (1869-1954) was a great plant collector who retired to Miami in 1935 and worked with Col. Robert H. Montgomery - who named the botanical garden after his friend.. The garden has extensive collections of rare tropical plants including palms, cycads, flowering trees and vines. ','','','','','','','','','Fairchild Tropical Botanic Garden, 10901 Old Cutler Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33156','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('292ef6fd-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Flamingo Gardens','Near the Everglades, the gardens have rich plantings of palms, bromeliads and ferns, a mangrove swamp, cypress forest and tropical hardwoods. The garden is managed to attract flamingos and other birds. ','','','','','','','','','3750 S. Flamingo Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33330','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29377a18-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Skidaway Island State Park','','','','','','7 am- 10 pm','','http://gastateparks.org/SkidawayIsland','','52 Diamond Cswy, Savannah, GA 31411','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('293f8901-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Forrester Garden','A densely planted tropical garden with the tenderest plants from the Marquesa Islands and similar places. Nancy Forrester worked with volunteer artists. The garden is both unexpected and exotic.','','','','','','','','','Nancy Forrester\'s Secret Garden, 1 Free School Lane','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33040','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('294f7420-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Four Arts Garden','A cultural complex with a variety of gardens, started in 1938. There is a Chinese Garden, a Jungle Garden, a British Colonial Garden, a Rose Garden and a Moonlight Garden. Native and tropical plants are used. The Chinese Garden is called \'The Garden of Happiness and Harmony\'. It is a place of contemplation with a moongate and authentic statuary. ','','','','','','','','',' Four Arts Plaza, Royal Palm Way','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33480','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2955d8a1-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Flaming Geyser State Park','','','','','','The park is open year round for day use only.  Summer: 8 a.m. to dusk.  Winter: 8 a.m. to dusk.','','http://www.parks.wa.gov/parks/?selectedpark=Flaming%20Geyser','','23700 Southeast Flaming Geyser Road, Auburn, WA 98092','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2965b9c0-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Goodwood Museum & Gardens','Hardy Croom moved to Goodwood, then a plantation, in the 1830s. He had a great interest in horticulture and during his travels collected many plants. Mrs Fanny Tiers purchased Goodwood in 1911. She used the property to entertain guests and consequently added new features for this purpose and renovated the garden in the Colonial Revival style.','','','','','','','','','1600 Miccosukee Rd','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','32308','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29675acb-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Southford Falls State Park ','','','','','','8 am to sunset','','http://www.ct.gov/dep/cwp/view.asp?a=2716&q=325266&depNav_GID=1650','','175 Quaker Farms Road, Southbury, CT 06488','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2978432b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Harry P Leu Gardens','The gardens claim to have one of America\'s largest Camellia collections and the largest formal rose garden in Florida. There is also a museum dating from the 1880s, a palm garden and a bamboo garden. ','','','','','','','','','1920 N. Forest Ave.','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','32803','2011-12-22 14:35:13','a1c3e20e-f181-11e0-8a53-00306701b527',1),('297d6674-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Sandisfield State Forest','','','','','','Sandisfield State Forest is open from sunrise to one half-hour after sunset, year-round. ','','http://www.mass.gov/dcr/parks/western/sand.htm','','York Lake Road, MA 01255','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('298a20b5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Heathcote Botanical Gardens','Heathcote Botanical Gardens was formerly a plant nursery. Heathcote Botanical Gardens a range of theme gardens including a Japanese Garden, Reflection Garden, Herb Garden, Rainforest Display, Native Plants Garden and a Palm & Cycad Walk. The gardens also have areas of flowering shrubs, bulbs, trees and herbaceous plants. Heathcote Gardens are in USDA PLANT HARDINESS zone 9b which is a biological transition zone between a warm-temperate zone to the north and a subtropical zone to the south. The plants are well labelled. The 1880’s Florida Homestead house and garden is an interesting feature.','','','','','','','','','210 Savannah Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','34982','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29900cf4-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','State Park at the Fair ','','','','','','Open during the New York State Fair third Thursday in August until Labor Day.','','http://nysparks.state.ny.us/parks/82/details.aspx','','6105 E. Seneca Turnpike, Jamesville, NY 13078','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('299a1da7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Historic Bok Sanctuary (formerly Bok Tower Gardens)','Edward W. Bok, editor of the Ladies\' Home Journal, Pulitzer Prize-winning author, humanitarian and philanthropist, spent winters on the Lake Wales Ridge, peninsular Florida\'s highest point at 298 feet above sea level. Liking the pines, the upland habitat, the dramatic sunsets and bird life, he decided to preserve the Iron Mountain hilltop and create a bird sanctuary. Mr. Bok called upon the finest artisans of the day to create the gardens and belltower. Frederick Law Olmsted, Jr. was commissioned to design a subtropical garden. Philadelphia architect Milton B. Medary designed the majestic marble and coquina 205-ft. tall Singing Tower that houses one of the world\'s finest carillons. Master metalworker Samuel Yellin and sculptor Lee Lawrie\'s works adorn the Tower. ','','','','','','','','','1151 Tower Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33853','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29aa791d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Bahia Honda State Park','','','','','','8:00 a.m. until sundown, 365 days a year','','http://www.floridastateparks.org/bahiahonda/default.cfm','','36850 Overseas Highway, Big Pine Key, Florida 33043','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29adf06c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Historic Spanish Point','The homestead of Mrs Bertha Palmer, who moved from Chicago to Sarasota in 1910. There is a Sunken Garden, Jungle Walk, wetland area and restored pergola that overlooks Little Sarasota Bay. The estate is owned and managed by the Gulf Coast Heritage Association.','','','','','','','','','337 North Tamiami Trail, (US 41)','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','34229','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29bebb69-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kanapaha Botanical Gardens','The gardens opened to the public in 1987. It is notable for having the largest bamboo collection in Florida and the largest herb garden in the southeast of the United States.  There is also a woodland garden, rose garden, butterfly garden, rock garden and vinery.','','','','','','','','','4700 S.W. 58th Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','32608','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29ca7780-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Swans Falls Campground','','','','','','River Access: May 1 to Oct. 31, Campground: May 26 to Oct. 9.','','http://www.maine.gov/cgi-bin/online/doc/parksearch/search_name.pl?state_park=88&historic_site=&public_reserved_land=&shared_use_trails=&option=search','','P.O.Box 378, Fryeburg, ME 04037','7f7a92b8-ea4c-11e0-8606-00306701b527','eccfb580-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29cd8fd7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Marie Selby Garden','William Marie Selby gave their Sarasota Bay home for public enjoyment. They were heirs to the Selby oil company (later Texaco) . The gardens are set among live oaks and have notable collection of orchids and palms, set off by the Spanish Moss which is a speciality of the garden managers. ','','','','','','','','','Marie Selby Botanical Gardens, 811 South Palm Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','34236','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29df1eb6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','McKee Botanical Garden','McKee Botanical Garden is a subtropical garden, originally founded in 1929 and laid out by William Lyman Phillips. In 1932, it opened to the public as McKee Jungle Gardens but was shut down in 1976. The Indian River Land Trust purchased the garden in 1995 and it was reopened in 2001. The garden is situated in a hammock along the Indian River.','','','','','','','','','350 US Highway 1','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','32962','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29e1b144-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Hamlin Beach State Park ','','','','','','Daily hours are from 6 a.m. to 11 p.m.','','http://nysparks.state.ny.us/parks/20/details.aspx','','1 Camp Road, Hamlin, NY 14464','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29efcf54-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Monastery of St Bernard de Clairvaux','The monastery was built in the twelfth century - in Sergovia, Spain! William Randolph Hearst bought it in 1925 and dismantled the buildings stone by stone, carefully packaged them with protective hay in numbered boxes and shipped them to the US. This co-incided with a severe outbreak of foot and mouth disease in Sergovia and the crates were quarantined on arrival. The crates were unpacked and the hay burnt to avoid possible contamination. Hearst suffered serious financial problems and the stones remained stored in a warehouse for 26 years until after his death. W. Edgemon and R. Moss purchased the stones in 1952 to rebuild the monastery as a tourist attraction. However, workman had failed to return the stones to their numbered boxes. It took 19 months to rebuild and some of stones have never been matched to their original position. The cloister has brick paths and statuary.','','','','','','','','','16711 West Dixie Highway','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33160','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('29f833f3-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','San Pedro Underwater Archaeological Preserve State Park','','','','','','8 a.m. until 6:00 p.m. 365 days a year','','http://www.floridastateparks.org/sanpedro/default.cfm','','U.S. 1 Mile Marker 85.5 Islamorada, Florida 33036','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a00b6a1-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mounts Botanical Garden','Palm Beach County\'s oldest and largest public garden has a collection of tropical fruit trees and other plants. ','','','','','','','','','531 North Military Trail','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33415','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a09e761-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Cedar Rock State Park','','','','','','','','http://www.iowadnr.gov/parks/state_park_list/cedar_rock.html','','2611 Quasqueton Diagonal Blvd. Buch Co Hwy W-35, Independence, IA 50644','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a0ec28b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Naples Botanical Garden','Harvey E. Kapnick gifted $5 million in 2000 which enabled the garden board to purchase the land. The garden closed from June 2008 to November 2009 for major development work. It showcases plants native to the tropics and subtropics from the 26th latitude north (the latitude of Naples) and the 26th latitude south. The Brazilian Garden was designed by Raymond Jungles and the focal point is an original ceramic mural by Roberto Burle Marx. There is also a Children\'s Garden, Caribbean Garden and a 90 acre nature reserve. The Florida Garden and Asian Garden are still in development.','','','','','','','','','4820 Bayshore Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','34112','2011-12-22 14:35:14','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a1bd2bd-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lewis and Clark State Recreation Area','','','','','','','','http://outdoornebraska.ne.gov/parks/guides/parksearch/showpark.asp?Area_No=101','','54731 897 Rd, Crofton, NE 68730','7f7a92b8-ea4c-11e0-8606-00306701b527','ed0bdbcc-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a1f5f1c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ravine Gardens State Park','This ravine on the St Johns River was transformed into a garden by the federal Works Progress Administration in 1933. There is an obelisk dedicated to Roosevelt, rock gardens and fieldstone terraces. The garden is at its best when the azaleas are flowering - late January to April. ','','','','','','','','','1600 Twigg Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','32177','2011-12-22 14:35:15','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a2c7b86-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Codorus State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/codorus.aspx','','2600 Smith Station Road, Hanover, PA 17331','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a2e45e2-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ringling Museum of Art Garden','Having made his money in the circus, John Ringling and his wife Mable purchased 20 acres of land on the waterfront in Sarasota in 1911.  They built a Venetian Gothic mansion, known as the Cà d’Zan (meaning \'House of John\') and a Museum of Art to house their private collection. The Mable Ringling Rose Garden was completed in 1913 - you can see its circular layout if you zoom in on the location map below. The estate is now run by Florida State University.','','','','','','','','','5401 Bay Shore Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','34243','2011-12-22 14:35:15','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a3c1abd-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Kampong','Horticulturalist and plant collector Dr David Fairchild bought the property in 1916 and named it \'The Kampong\' (Malay word for village or cluster of houses for an extended family). He used The Kampong as an introduction garden for specimens collected on his expeditions. The garden is notable for its flowering trees and tropical fruit cultivars. ','','','','','','','','','4013 Douglas Road, Coconut Grove','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33133','2011-12-22 14:35:15','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a4a9011-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Morikami Museum and Japanese Gardens','The Morikami is a Japanese arts and cultural centre. The garden was renovated and expanded in 2001. There are 6 gardens, each inspired by a different historical period and type of Japanese garden from the eighth to the twentieth century.','','','','','','','','','4000 Morikami Park Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33446','2011-12-22 14:35:15','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a4d61f2-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Table Rock State Park','','','','','','6 a.m. to 10 p.m., daily ','','http://mostateparks.com/park/table-rock-state-park','','5272 State Hwy. 165, Branson, MO 65616','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a5bda95-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Vizcaya Gardens','The garden was made during the First World War using many features, including steps, balustrades, fountians and finials, purchased in Italy or copied from Italian gardens. The design is based on a cross-axis and includes terraces, pools, fountains, sculpture, urns and knot gardens. Florida\'s climate favours the lush planting. The spirit of the garden is perhaps more mannerist than high renaissance. Approx 1,000 workers were employed on the construction of the house and garden - nearly 10% of Miami\'s population at the time! The garden designer was Diego Suarez, who trained in Florence, Italy.','','','','','','','','','Vizcaya Museum and Gardens, Biscayne Bay, 3251 S Miami Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','33131','2011-12-22 14:35:15','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a5fbff1-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Wharton Brook State Park ','','','','','','8 am to sunset','','http://www.ct.gov/dep/cwp/view.asp?A=2716&Q=325278','','Route 5, Wallingford Hamden, CT 06514','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a6b44fd-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Washington Oaks Gardens State Park','Washington Oaks Gardens State Park is located between the Atlantic Ocean and the Matanzas River on a site originally used as a hunting ground by the Native Americans. The gardens were established by Louise and Owen Young in the 1930s and gifted to the state in 1965. Washington Oaks is planted with a a combination of native and exotic species. There is also a Rose Garden. ','','','','','','','','','6400 North Oceanshore Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','32173','2011-12-22 14:35:15','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a7ab086-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Atlanta History Center','The Atlanta History Center was founded in 1926 and is now located on 33 acres in the heart of the Buckhead district. Along with museums, a library and two historic houses. The Swan House has an Italian garden designed by Philip Trammell Schutze. There is also a set of historic gardens: the Quarry Garden (pre-settlement native plants), the Tullie Farm Gardens (heritage vegetables in period gardens), Swan House Garden (gardening in a grand manner), the Cherry Sims Garden (Asian and Southeastern US plants) and the F.Smith Rhododendron Garden. ','','','','','','','','','Atlanta History Center, 130 West Paces Ferry Road, NW','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','30305','2011-12-22 14:35:15','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a7c0fa1-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Indian Springs State Park','','','','','','7 am- 10 pm','','http://www.gastateparks.org/IndianSprings','','678 Lake Clark Road, Flovilla, GA 30216','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2a8ad94f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Barrington Hall Garden','The hall was built in 1842 