olonial revival style. Flagstone walks, formal parterres, and a sunken garden are complimented by seasonal plantings. ','','','','','','','','','Oak Hill and the Martha Berry Museum, 24 Veterans Memorial Hwy NE','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','30161','2011-12-22 14:35:16','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ad87e37-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The State Botanical Garden of Georgia','A university botanic garden with an informal layout and themed areas including an International Garden, an Endangered Species Garden and a Perennial Garden. There is also a tropical conservatory. ','','','','','','','','','2450 South Milledge Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','30605','2011-12-22 14:35:16','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ae65a20-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Jackson Mounds Archaeological State Park','','','','','','8:00 a.m. until sundown, 365 days a year, the center is open daily from 9:00 a.m. to 5:00 p.m','','http://www.floridastateparks.org/lakejackson/default.cfm','','3600 Indian Mounds Road, Tallahassee, Florida 32303','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ae77674-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Allerton Garden','Allerton is fascinating for being both a botanical garden and having notable garden design features. In Hawaiian the name is Lawai-kai. The garden was begun by Hawaii\'s Queen Emma and then developed by Alexander McBryde at the turn of the 20th century. Robert and John Gregg Allerton (Robert\'s adopted son) bought the property in 1938 and were responsible for the garden design. They had toured Europe together and Robert had studied art in Paris. John Greg Allerton trained as architect. ','','','','','','','','','Lawa\'i Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96756','2011-12-22 14:35:16','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2af71252-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Foster Botanical Garden','The Foster Garden was started by a German botanist, William Hillebrand, developed by Thomas and Mary Foster, given to the City and County of Honolulu and opened to the public in 1931. It now features: the Lyon Orchid Garden, Terraces, a Prehistoric Glen and a Hybrid Orchids section.','','','','','','','','','Foster Botanical Garden, Department of Parks and Recreation, 50 N. Vineyard Blvd.','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96817','2011-12-22 14:35:16','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2afc250a-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Carr Creek State Park','','','','','','','','http://parks.ky.gov/findparks/recparks/cc/','','Highway 15, Sassafras, KY 41759','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc35954-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b05f41e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hawaii Tropical Botanical Garden','In a 40 acre sheltered valley protected from buffeting tradewinds with rich volcanic soil, this garden specializes in rain forest plants. The collection of tropical plants is international in scope and there are over 2,000 species, representing more than 125 families and 750 genera. Some of the Garden\'s enormous mango and coconut palm trees are over 100 years old. The Garden was created by an energetic former trucker, Dan J. Lutkenhouse, who discovered Onomea Valley (meaning \'the best place\') in 1977 while vacationing with his wife. Mr. Lutkenhouse purchased the 17-acre parcel for its seclusion and beauty, without knowing exactly what to do with it. Quickly abandoning ideas for a commercial venture which would destroy the natural environment, he decided instead to establish a botanical garden to preserve the valley and its beauty forever.','','','','','','','','','27-717 Old Mamalahoa Highway, PO Box 80','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96781','2011-12-22 14:35:16','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b16d72e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Mine Kill State Park','','','','','','The park is open year round. Memorial Day-Labor Day: 7:30am-dusk. Winter Hours: 7:30am-4:30pm','','http://nysparks.state.ny.us/parks/165/details.aspx','','161 Mine Kill State Park, North Blenheim, NY 12131','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b16e017-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hoomaluhia Botanical Garden','Hoomaluhia Botanical Garden is within a volcanic crater. It is a wild place with many wild plants. The garden was designed and built by the U.S. Army Corps of Engineers, to provide flood protection for Kaneohe, and is now managed by by the County of Honolulu. ','','','','','','','','','45-680 Luluku Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96744','