b-11e1-8a87-000c29a5c50c','Patterson State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/patterson.aspx','','Coudersport, PA 16915','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b48c6d6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Koko Crater Botanical Garden','Koko Crater Botanical Garden is, as the name suggests, inside a hot dry volcanic crater. A 2-mile footpath goes past four geographical collections and a number of thematic plant collections: Geographical Collections: The Americas Hawaii Madagascar Africa Botanical Collections: Cacti Alluaudias Sansevierias Baobabs Dryland Palms Aloes Euphorbias Adeniums ','','','','','','','','','Kokonani Street, Koko Head','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96744','2011-12-22 14:35:16','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b57e6c5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kula Garden','Kula garden was made by a landscape architect (Warren McCord) at an elevation of 1000 metres and good views of West Maui Mountains and Kahului Bay. The rich soil is well suited to orchids and ferns. The garden has unusual rocks, waterfalls and ponds. ','','','','','','','','','Kula Botanical Garden, Box 288, Kula','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96790','2011-12-22 14:35:17','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b59b542-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Big Cypress Tree State Park (Natural Area)','','','','','','8:00 a.m. until sundown during the summer. 8:00 a.m. until 4:30 p.m. during the winter months ','','http://tn.gov/environment/parks/BigCypress/index.shtml','','295 Big Cypress Road, Greenfield, TN 38230','7f7a92b8-ea4c-11e0-8606-00306701b527','ed86a3e9-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b691af5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Liliuokalani Garden','Lili\'uokalani is beside the Foster Botanical Garden but has a different aim: Lili\'uokalani shows the navive landscape of Hawaii before the Europeans arrived. Appropriately, its name comes from Hawaii\'s last monarch: Queen Lili\'uokalani. ','','','','','','','','','Lili\'uokalani Botanical Garden, North Kuakini Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96817','2011-12-22 14:35:17','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b71442a-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Cumberland Bay State Park ','','','','','','Open from early May until early Columbus Day.','','http://nysparks.state.ny.us/parks/34/details.aspx','','152 Cumberland Head Road, Plattsburg, NY 12901','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b77bbf4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Limahuli Garden','Mrs Juliet Rice Wichman established Limahuli Garden in 1967 to preserve and protect the natural and cultural resources of the valley. She gifted Limahuli Garden to the National Tropical Botanical Garden in 1976. The botanic garden sits in a lush valley surrounded by jagged mountains. The Limahuli Valley is a sacred site and its name means \'turning hands\'. The Limahuli stream falls over a 1000 foot waterfall before passing through the valley to the ocean. This provides a range of habitats Hawaii\'s indigenous species with fresh and marine environments. ','','','','','','','','','National Tropical Botanical Garden, 3530 Papalina Road, Kalaheo','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96714,96754','2011-12-22 14:35:17','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b8127de-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Portage Cove State Recreation Site','','','','','','','','http://dnr.alaska.gov/parks/aspunits/southeast/portcovesrs.htm','','1 Beach Rd, Haines, AK 99827','7f7a92b8-ea4c-11e0-8606-00306701b527','ec4dd047-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b9cbfa4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lyon Arboretum Garden','Lyon Arboretum by the Hawaiian Sugar Planters Association to show the value of watershed restoration and test plants of economic value. It became part or the University of Hawai\'i in 1953 and the emphasis changed to horticulture. The land was once grazed bare by cattle. Today it is well vegetated and has the character of a botanical garden. ','','','','','','','','','Harold L. Lyon Arboretum, University of Hawai at Manoa, 3860 Manoa Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96822','2011-12-22 14:35:17','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2b9ea5b8-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Wyola State Park','','','','','','Summer operating hours are 9am-7:30pm, seven days a week running from Memorial Day through Labor Day.  After Labor Day hours are as posted.','','http://www.mass.gov/dcr/parks/central/lwsp.htm','','94 Lakeview Road, Shutesbury, MA 01072','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2baea4ba-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','McBryde Garden','The McBryde Garden was originally known as Lawa\'i Garden but was renamed after the family who originally owned the valley. It was the first site obtained by the nonprofit National Tropical Botanical Garden and has a very large collection of tropical plants. McBryde Garden is also the NTBG\'s headquarters. The garden includes a Canoe Garden featuring plants brought by the original Polynesian settlers, and Bamboo Bridge. Lawa`i Stream runs through the garden. ','','','','','','','','','National Tropical Botanical Garden, P. O. Box 340, Lawai','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96765','2011-12-22 14:35:17','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2bb919a3-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','El Capitán State Beach','','','','','','8:00 AM to sunset','','http://parks.ca.gov/?page_id=601','','Goleta,?CA?93117','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2bc13f99-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Queen Emma Summer Palace Garden','Queen Emma Na\'ea, born in 1836, was the wife of King Kamehameha IV, the daughter of Hawaiian chieftains and the Englishman, John Young, who became an advisor to King Kamehameha I. Queen Emma\'s summer palace is part Victorian and part Hawaiian. The garden was designed by a Danish garden designer, H Augustus Holstein, but like the palace is part-English and part-Hawaiian.','','','','','','','','','Queen Emma Summer Palace, 2913 Pali Highway','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','96817','2011-12-22 14:35:17','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2bc98679-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Charles River Reservation','','','','','','','','http://www.mass.gov/dcr/parks/charlesRiver/','','Cambridge, MA 02141','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2bdbb9bf-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Buccaneer State Park','','','','','','','','http://home.mdwfp.com/Parks/ParksInfo.aspx?id=509&lc=633','','1150 South Beach Boulevard, Waveland, MS 39576','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf6a75d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2bdbcfa8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Idaho Botanical Garden','The botanical garden was made on the former farm and nursery of Idaho State Penitentiary. It has 13 theme gardens: Herb, Alpine, Rose, Contemporary English, Outlaw Field, Butterfly & Hummingbird, Iris, Meditation, Water, Cactus, Peony, Children, and Idaho Native Plants and the Don Dick Outdoor Classroom. ','','','','','','','','','2355 N. Penitentiary Rd','7f7a92b8-ea4c-11e0-8606-00306701b527','eca177fb-f48c-11e0-b192-00306701b527','','83712','2011-12-22 14:35:17','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2bf050e9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Hurd State Park','','','','','','8 am to sunset','','http://www.ct.gov/dep/cwp/view.asp?a=2716&q=325224&depNav_GID=1650','','Route 151, Easten Hampton, CT 06424','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c054505-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Alfred Caldwell Lily Pool in Lincoln Park ','The Alfred Caldwell Lily Pool (also known as Lincoln Park Lily Pool and formerly as formerly The Rookery). It was designed by Alfred Caldwell and is a fine example of Prairie School landscape architecture, influenced by Frank Lloyd Wright and Jens Jensen (Caldwell’s teacher). The design was inspired by the natural landscape  of the Midwest, with prairies, rock outcrops and native plants. It is a wonderfully wild, intimate place right in the middle of the city.','','','','','','','','','Fullerton Parkway','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','60689','2011-12-22 14:35:18','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c115807-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Myakka River State Park','','','','','','8:00 a.m. until sundown, 365 days a year, the center is open daily from 9:00 a.m. to 5:00 p.m','','http://www.floridastateparks.org/myakkariver/default.cfm','','13208 State Road 72, Sarasota, Florida 34241','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c157bad-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Anderson Gardens','John Anderson, inspired by the Japanese Garden in Washington Park, decided to make a comparable garden in Rockford and asked its former director, Hoichi Kurisu, to undertake the design. It is in the style of the Kamakura period (see note on the timeline of Japanese garden design - periods in Japanese art).','','','','','','','','','Anderson Japanese Gardens, 318 Spring Creek Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','61107','2011-12-22 14:35:18','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c26434f-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Ellisville Harbor State Park','','','','','','','','http://www.mass.gov/dcr/parks/southeast/ells.htm','','Rte 3A, Plymouth, MA 02360','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c282687-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Art Institute Gardens, Chicago','The Chicago Art Institute has two modern gardens.The Institute itself, built in conjunction with the World\'s Columbian Exposition of 1893, is Beaux Arts. The South Garden, built in 1962 was designed by the master landscape architect Dan Kiley and is perhaps his most important public project. It has a pattern of silver granite planters, with hawthorns, in orange gravel. The North Garden was designed, as a sculpture court, by the landscape architect Laurie Olin. ','','','','','','','','','111 South Michigan Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','60603','2011-12-22 14:35:18','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c3d13d9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Middlesex Fells Reservation','','','','','','Open year-round, dawn to dusk. ','','http://www.mass.gov/dcr/parks/metroboston/fells.htm','','Medford, MA 02155','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c41e9b6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Bahai Temple Garden','The Temple was built between 1920 and 1953. Like the gardens, it was designed to symbolise the oneness of God, the oneness of mankind and the oneness of religion. It is a nine-sided structure with nine gardens and pools. Hedges demarcate the gardens and they are profusely planted with colorful flowers. ','','','','','','','','','Baha\'i House of Worship, 100 Linden Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','60091','2011-12-22 14:35:18','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c5045b4-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Beaver Dam State Park','','','','','','','','http://parks.nv.gov/bd.htm','','Post Office Box 985，Caliente, NV 89008','7f7a92b8-ea4c-11e0-8606-00306701b527','ed121df0-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c6669c5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cantigny Garden','Colonel Robert McCormick (died 1955) instructed in his will that the 500 acre estate at Cantigny be used in a manner that would be \'for the recreation, instruction and welfare of the people of the State of Illinois.\' In 1967, the board of trustees overseeing the Cantigny Estate, hired one of the country\'s foremost landscape architects, Franz Lipp, and charged him with the task of building an important American garden. Situated within Cantigny Park, Cantigny Formal Garden consits of a series of 20 garden compartments. There is a Fountain Garden, a Green Garden, a Rose Garden, a Dryland Garden, a Bur Oak Garden and many others. Showcased in the Garden is a very extensive use of herbaceous plants including annual and perennial flowers, ground covers and flowering bulbs and a wide variety of trees and shrubs displayed not only in complement to the floral areas, but in an arboretum setting as well. ','','','','','','','','','1 South, 151 Winfield Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','60187','2011-12-22 14:35:18','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c681bc7-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Coeur d\'Alene\'s Old Mission State Park','','','','','','9 am to 5 pm daily','','http://parksandrecreation.idaho.gov/parks/oldmission.aspx','','31732 S Mission Road, Catalda, ID 83810','7f7a92b8-ea4c-11e0-8606-00306701b527','eca177fb-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c76eb60-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Chicago Botanic Garden','The City Fathers of Chicago wisely adopted the motto \'City in a Garden\' in 1837. The Chicago Botanic Garden was opened to the public in 1972. The master plan was by landscape architect John O. Simonds (author of A Manual of Site Planning and Garden Cities 21). He followed the principle of responding to the Genius of the Place by working with the wetlands to make a series of interlinked lagoons, rather in the Serpentine Style. Within this framework there are over 25 themed gardens, including an English Walled Garden, a Midwestern Prairie, a Sensory Garden, a Waterfall Garden and a Japanese Garden. ','','','','','','','','','1000 Lake Cook Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','60022','2011-12-22 14:35:18','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c8659d7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Deere-Wiman and Butterworth Center Gardens','Two historic Deere family homes situated in the Overlook neighbourhood of Moline. The Deere-Wiman House was built in 1872 by Charles Deere, son of John Deere of plough and tractor fame. It was originally named \'Overlook\' due to its hilltop position overlooking the city (hence the name of the neightbourhood). The original “Swiss Villa” style building was updated following an 1899 fire. The original terraces and lawn survive with later Mixed Style gardens. The Butterworth Center was built in 1892 as a home for William and Katherine Butterworth, daughter of Charles Deere. The grounds feature a 1910 garden complete with pergola, fountain and lawn bowling field.','','','','','','','','','Butterworth Center and Deere-Wiman House, 1105 8th Street','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','61265','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c889ebe-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Chestnut Hill Reservation','','','','','','','','http://www.mass.gov/dcr/parks/metroboston/chestnutHill.htm','','Beacon Street, Boston, MA 02315','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2c95f314-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Klehm Arboretum and Botanic Garden','William Lincoln Taylor established the Rockford Nursery on this site in 1910 and began planting. It was bought by the Klehm family and given to the Winnebago County Forest Preserve District in 1986. In addition to the historic plant collection it has a Fountain Garden, a Butterfly Garden, a Gourd Garden and a Everlasting Flowers Garden. ','','','','','','','','','Klehm Arboretum and Botanic Garden, 2715 South Main Street','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','61102','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ca243bb-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Midway Park (Midway State Park) ','','','','','','','','http://nysparks.state.ny.us/parks/167/details.aspx','','4859 Route 430, Bemus Point, NY 14712','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ca5085e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lincoln Memorial Garden','The estate was planned, in 1936, by the landscape architect Jens Jensen. He used native plants in a naturalistic style, to re-create the character of Illinois as Abraham Lincoln knew it in his youth. There are nature trails, wildflowers and meadows ','','','','','','','','','Lincoln Memorial Garden, 2301 E Lake Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','62707','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2cb3f982-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lurie Garden, Milennium Park','The design of the garden is based on the landscape of Chicago - the city\'s motto is \'Urbs in Horto\' (City in a Garden). The planting was designed by Piet Oudolf. The garden is planted entirely with perennials. The Shoulder Hedge is a protective screen of Fagus (beech) and Carpinus (hornbeam) and Thuja (arborvitae). ','','','','','','','','','201 E. Randolph Street','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','60601','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2cb5e192-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Verona Beach State Park ','','','','','','Open year-round.','','http://nysparks.state.ny.us/parks/102/details.aspx','','Box 245, Verona Beach, NY 13162','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2cc6956d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Morton Arboretum','The Morton Arboretum was founded by Joy Morton (1855-1934),the owner of a salt company. Charles Sprague Sargent of the Arnold Arboretum recommended landscape architect O.C. Simonds for the design. Clarence Godshalk, also a landscape architect, became director in 1939 and followed the naturalistic style established of Simonds. Within this framework are theme gardens, including the Fragrance Garden, Ground Cover Garden, and Joy Path. ','','','','','','','','','4100 Illinois Route 53','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','60532','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2cce1fa5-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Bald Eagle State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/baldeagle.aspx','','149 Main Park Road, Howard, PA 16841','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2cd86e1b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Quad City Garden','The botanic garden was opened at the end of the twentieth century. It has an innovative conservatory, like an empty office block, with a garden designed by Thomas Graceffa called the Sun Garden. Outside there is a botanical collection, the Scott County Regional Authority Conifer Garden, a Physically Challenged Garden and a Scrambled Alphabet Garden. ','','','','','','','','','Quad City Botanical Center, 2525 4th Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','61201','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ce68c84-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Wadsworth Falls State Park ','','','','','','sunrise to sunset.','','http://www.ct.gov/dep/cwp/view.asp?a=2716&q=325274&depNav_GID=1650','','721 Wadsworth St, Middletown, CT 06457','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ce6fdf6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Shakespeare Garden','Chicago Landscape Architect Jens Jensen, already interested in the relationship between theatre and nature, designed the Shakespeare Garden in response to the Drama League of America\'s request for activities to commemorate the 300th anniversary of Shakespeare\'s death (1616). The garden is separated from the street by 6-ft hedges and planted with the flowers, herbs, and trees mentioned in Shakespeare\'s plays. The garden is approximately 70 feet wide and 120 feet long. ','','','','','','','','','Northwestern University, Sheridan and Garrett Roads','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','60201','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2cf98047-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Washington Park Botanical Garden','The park was designed in a prarie style by O C Simonds. Robert Lawson was landscape architect for the Rose Garden. The park has 9,000 square feet of greenhouse area. There is also an iris garden, a perennial border, a glass dome conservatory, the Betty Mood Smith Rockery, a Roman Cultural Garden and an outdoor cactus garden.','','','','','','','','','Springfield Park District, 1740 West Fayette Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','62704','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2cfdcd0f-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c682cbd1-203b-11e1-8a87-000c29a5c50c','Shenandoah National Park','','','','','','Shenandoah National Park is always open. ','','http://www.nps.gov/shen/index.htm','','Park Superintendent, 3655 US Highway 211 East, Luray, VA 22835','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d0f6a9a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Foellinger-Freimann Botanical Conservatory','The Foellinger-Freimann Botanical Conservatory is in the heart of downtown Fort Wayne, Indiana. There is the Showcase Garden with lush seasonal displays, the Tropical Garden with orchids and palms growing around a cascading waterfall and the Desert Garden.','','','','','','','','','1100 South Calhoun St','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','46802','2011-12-22 14:35:19','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d189a86-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Hammonasset Beach State Park','','','','','','8:00 am to sunset','','http://www.ct.gov/dep/cwp/view.asp?A=2716&Q=325210','','1288 Boston Post Road P.O. Box 271, Madison, CT 06443','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d1f49de-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Foster Park Floral Area','Foster Park boasts a beautiful floral display each season. In 1912 Sam and David N. Foster and their families donated Foster Park to Fort Wayne.','','','','','','','','','Foster Park, 3900 Old Mill Rd','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','46807','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d2d4ffb-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Garfield Park Sunken Garden','The oldest park in Indianapolis was started in 1873 and named in honor of President James A Garfield. George Edward Kessler, appointed as landscape architect in 1908 and produced a formal design for the Sunken Gardens. The Conservatory overlook the gardens as though it were a princely mansion. ','','','','','','','','','Garfield Park Conservatory, 2505 Conservatory Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','46203','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d3b514b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Headwaters Park','The park was designed to mitigate flooding and provide a recreational facility for Fort Wayne. In addition to hosting many summer activities, Headwaters Park now operates an outdoor ice skating rink, under the Linclon Financial Pavilion from the end of November through the end of February each season. ','','','','','','','','','333 S. Clinton Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','46802','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d4ab6fc-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Irwin Home and Gardens','An Italian style garden with statuary and fountains, made in 1864 and re-designed in 1910 with the addition of a Pompeiian garden. ','','','','','','','','','608 Fifth Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','47201','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d5b7991-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lakeside Rose Gardens','The Lakeside Sunken Gardens is a historic park in Fort Wayne. Originally, roses were considered ill-suited to the climate in this area because of the harsh winters. However, it was discovered that the clay of Indiana was ideal fo roses. The completed rose garden, elevated above a sunken garden with reflecting ponds, was finished in the early 1920s and has brought many thousands of visitors to Lakeside Park. There is ice skating in the winter. ','','','','','','','','','1401 Lake Avenue & Vermont','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','46805','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d6c0a82-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lilly House Garden - Indianapolis Museum of Art','The garden was started by Hugh McKennan Landon, in 1908, and developed by Mr and Mrs Lilly (of Eli Lilly) after 1932. The original garden was designed by Percival Gallagher of Olmsted Brothers. There is a formal garden and a ravine garden (restored and re-opened as the Rapp Family Ravine Garden in 1999). ','','','','','','','','','4000 Michigan Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','46208','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d7b25b4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Oakhurst Gardens','The cultural center was founded by the Ball family (as was Ball State University). Oakhurst was the Ball family home on the White River. The gardens were developed by Elizabeth Ball in the 1930s and restored when taken over by the Minnetrista Cultural Center (from Sioux, mna, or mini, means water, and from English, a tryst is a meeting place, so Minnetrista is \'a meeting place by water\'). Oakhurst Gardens have an Arts and Crafts style Courtyard Garden and Italian Garden, and a calmly beautiful woodland garden (which Elizabeth saw as the domain of fairies). ','','','','','','','','','Minnetrista Cultural Center, 600 W Minnestrista Boulevard','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','47303','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d7bfaf6-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Whitesbog Village','','','','','','','','http://www.whitesbog.org/','','Browns Mills, NJ 08015','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d8c2627-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Bickelhaupt Arboretum','Bickelhaupt Arboretum is an educational arboretum that describes itself as an \'outdoor museum\'. It was established by Bob and Frances Bickelhaupt and given to the public in 1970.','','','','','','','','','340 South 14th St.','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','52732','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2d9d5db0-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Brucemore Garden','George Douglas, one of the founders of Quaker Oats, hired OC Simmonds, the landscape architect, to re-design the garden. He added added a pond, formal gardens, vegetable and cutting gardens. The character is broadly English but the house and the garden look slightly larger than they would be in England.','','','','','','','','','2160 Linden Drive SE','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','52403','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2dab8f2d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cedar Valley Arboretum & Botanic Gardens','Cedar Valley Arboretum was started in the 1990s by members of the community to create a green space in the area. There is a rose garden, herb garden, hosta garden, prairie and labyrinth.','','','','','','','','','1927 East Orange Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','50701','2011-12-22 14:35:20','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2dba758a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Des Moines Botanical Center','A modern botanical garden on the east bank of the Des Moines River, with a geodesic dome conservatory (visible on the satellite image on the map below). The Botanical Center was completed in 1979.','','','','','','','','','909 Robert D. Ray Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','50316','2011-12-22 14:35:21','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2dc7b877-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Dubuque Arboretum and Botanical Garden','Established in 1980, Dubuque Arboretum is run entirely by volunteers. There is a large hosta garden and a Japanese garden designed by Hoichi Kurisu.','','','','','','','','','3800 Arboretum Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','52001','2011-12-22 14:35:21','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2dd6bfa5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Eagle Point Park in Iowa','The idea for Eagle Point Park came, in 1908, from Judge Oliver Perry Shiras, Frank J. Piekenbrock and Herbert Adams. Charles Robinson was appointed as the landscape architect. Eagle Point Park was opened in 1909 and in 1933 the Neuman Log Cabin, believed to be the oldest building in Iowa, was moved  to the park. Eagle Point Park is a large city park, located high on a bluff overlooking the Mississippi River valley.  Alfred Caldwell designed the buildings.','','','','','','','','','West on Shiras Avenue, off Rhomberg Ave.','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','52001','2011-12-22 14:35:21','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2de420ed-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Reiman Gardens','Reiman Gardens is owned by Iowa State University. The garden dates back to 1914 and is currently in its third location. There is a herb garden, rose garden, arboretum and wetland garden. A conservatory complex opened in 2002, including a 2,500 square foot butterfly house.','','','','','','','','','1407 University Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','50011','2011-12-22 14:35:21','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2df7c1ad-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Percha Dam State Park','','','','','','24 hours','','http://www.emnrd.state.nm.us/PRD/Percha.htm','','P.O. Box 32,Caballo, NM  87931','7f7a92b8-ea4c-11e0-8606-00306701b527','ed25625a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2dfb2d56-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Wichita Gardens','Wichita Gardens are maintained by local well-wishers and display the visual results of their horticultural energy (and often their names): Murdock Street Entrance Garden, Beverly R. Blue Teaching Garden, Linda Stewart Evaluation Garden, Wildflower Meadow, Hannah Jabara Entry Garden, Xeriscape Demonstration Garden, Shakespearean Garden, The Centennial Pavilions, Butterfly Garden, Schnitzler Juniper Garden, John Firsching Pinetum, Garden on the Rocks, Jessie Wooldridge Brosius Rose Garden, Jayne Milburn Aquatic Collection, Margie Button Fountain Garden, Three-Season Perennial Border, Peony Collection, Martha Parriott Terrace Garden, Woodland Walk, Frank Smith Woodland Glade, Butterfly House/Pansy House, Wildflower Woodland, Sally Stone Sensory Garden. There are over 3600 species of plant, both native and exotics particularly well suited to south-central Kansas. Seasonal exhibits include Kansas\' largest tulip display in April, the Chrysanthemum Display from October to December and Illuminations, when the gardens are decorated with thousands of lights for the holiday season. It is a great way of managing a public community garden: by the people, for the people, with the people. ','','','','','','','','','Botanica, The Wichita Gardens, 701 N. Amidon','7f7a92b8-ea4c-11e0-8606-00306701b527','ecbd0598-f48c-11e0-b192-00306701b527','','67203','2011-12-22 14:35:21','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2e03b2cb-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Cayuga Lake State Park ','','','','','','','','http://nysparks.state.ny.us/parks/123/details.aspx','','2678 Lower Lake Road,Seneca Falls, NY 13148','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2e0c5661-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ashland, The Henry Clay Estate Garden','Henry Clay, a patriot and politician, lived at Ashland from 1809 to 1852 and ran a large estate. His son James rebuilt the house and remodelled the garden after 1852. His work fell into decay and a re-created garden was made in 1951, more in the style of the 1930s than the nineteenth century. ','','','','','','','','','120 Sycamore Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc35954-f48c-11e0-b192-00306701b527','','40502','2011-12-22 14:35:21','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2e11b08d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50