.travelok.com/listings/view.profile/id.110','','Hwy 50 & Hwy 50-A, Freedom, OK 73842','7f7a92b8-ea4c-11e0-8606-00306701b527','ed4ca61c-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2edcacdf-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Rosedown Plantation State Historic Site','Rosedown is an antebellum plantation built by Daniel and Martha Turnbull, believed to be named after a play they saw together on their honeymoon. Martha designed the garden and was influenced by the gardens she had visited in France and Italy. The garden has been restored using the comprehensive garden diaries she kept. A majestic oak allee leads to the house.','','','','','','','','','12501 Highway 10','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc9e8b5-f48c-11e0-b192-00306701b527','','70775','2011-12-22 14:35:22','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ee21963-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Hart State Park','','','','','','7 am- 10 pm','','http://www.gastateparks.org/Hart','','330 Hart Park Road, Hartwell, GA30643','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2eea3efe-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Shadows on the Teche','The Shadows on the Teche was built in the 1830s by wealth sugarcane growers, David and Mary Weeks. The Bayou Teche is a twisting waterway (\'teche\' means snake in the Chitimacha language) that was the main course of the Mississippi River before it changed course around 2000 BC. The property is now owned by the National Trust for Historic Preservation. Boxwood hedges separate the garden into rooms: a square garden, round garden and naturalistic garden','','','','','','','','','317 East Main Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc9e8b5-f48c-11e0-b192-00306701b527','','70560','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2eeacde9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Kona Coast (Kekaha Kai) State Park','','','','','','Open daily 9 a.m. –7 p.m.','','http://www.hawaiistateparks.org/hawaiistateparks/parks/hawaii/index.cfm?park_id=47','','19 East Kawili Street, Hilo, HI 96720','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ef1f1c8-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Argyle Lake State Park','','','','','','','','http://dnr.state.il.us/lands/Landmgt/PARKS/R1/ARGYLE.HTM','','640 Argyle Park Road, Colchester, IL 62326','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2ef7fd4b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Asticou Gardens','A Japanese-style garden made using some of the plants from Beatrix Farrand\'s Reef Point Garden on Mount Desert Island. There are stepping stones and Japanese lanterns. The garden is near Acadia National Park. ','','','','','','','','','The Asticou Inn, P.O. Box 337','7f7a92b8-ea4c-11e0-8606-00306701b527','eccfb580-f48c-11e0-b192-00306701b527','','04662','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f03a9e8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Coastal Maine Botanical Gardens','The Coastal Maine Botanical Gardens are unusual for having saltwater frontage. It opened in 2007 and is the largest botanic garden in New England. The rose garden was inspired by paintings of Maine landscapes. The Lerner Garden of the Five Senses opened in June 2009 and, as the name suggests, has features to stimulate each sense. Other areas include a rhododendron garden, woodland garden, kitchen garden and native fern trail.','','','','','','','','','Barters Island Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eccfb580-f48c-11e0-b192-00306701b527','','04537','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f0d1fde-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Allagash Wilderness Waterway State Park','','','','','','','','http://www.maine.gov/cgi-bin/online/doc/parksearch/search_name.pl?state_park=2&historic_site=&public_reserved_land=&shared_use_trails=&option=search','','106 Hogan Road, Banger, ME 04401','7f7a92b8-ea4c-11e0-8606-00306701b527','eccfb580-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f104330-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hamilton House and Garden','An English-style Georgian country house with an early-twentieth century garden made by the Tyson family. The garden is broadly in the Arts and Crafts style with appropriate planting (eg hedges, roses, phlox, lilies and hollyhocks). ','','','','','','','','','40 Vaughan\'s Lane','7f7a92b8-ea4c-11e0-8606-00306701b527','eccfb580-f48c-11e0-b192-00306701b527','','03908','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f1e0356-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','McLaughlin Foundation Garden','The garden was made by Bernard McLaughlin, a bank teller and grocery store clerk with a love of plants and no formal horticultural training. The garden has been maintained since his death in 1995 by the McLaughlin Foundation. It is a classic twentieth century plant-lover\'s garden - with an abundance of flowers, a pleasant house and no strong sense of design. A critic might say that the style is Arts and Crafts but without a strong sense of \'art\' or of \'craft\'. The McLaughlin Garden features daylilies, astilbes, iris, phlox and hostas. ','','','','','','','','','McLaughlin Foundation, Garden and Horticultural Center, 97 Main St.','7f7a92b8-ea4c-11e0-8606-00306701b527','eccfb580-f48c-11e0-b192-00306701b527','','04281','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f22f754-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Falcon State Park','','','','','','Open 7 days a week year-round.','','http://www.tpwd.state.tx.us/spdest/findadest/parks/falcon/','','P O Box 2, Falcon, TX 78545','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f29b73b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Thuya Garden','The lodge was built in 1912 by Joseph Henry Curtis, a landscape architect from Boston.  On his death, Charles K. Savage was appointed trustee and designed the garden in the style of Gertrude Jekyll.','','','','','','','','','Thuya Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','eccfb580-f48c-11e0-b192-00306701b527','','04662','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f333a80-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Illinois Beach State Park','','','','','','','','http://www.dnr.state.il.us/lands/Landmgt/PARKS/R2/ILBEACH.HTM','','Lake Front / Park Office Zion, IL 60099','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f3585cb-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Brighton Dam Azalea Garden','The azalea garden is situated on the banks of the Patuxent River, by Brighton Dam (built in 1942).  The 5 acre garden has over 20,000 azaleas and is provided by the Washington Suburban Sanitary Commission.','','','','','','','','','Brighton Dam Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','20833','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f417005-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Brookside Gardens','Brookside Gardens in Montgomery County was designed in 1969 to provide for public education in horticulture and garden design. It has an azalea garden, a rose garden, a children\'s garden, a formal garden,a fragrance garden and a Japanese garden. ','','','','','','','','',' Brookside Gardens, 1800 Glenallan Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','20902','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f42b812-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Oconee State Park','','','','','','Su-Th 7am-7pm; Fri-Sa 7am-9pm (extended to 7am-9pm daily during Daylight Savings Time)','','http://www.southcarolinaparks.com/park-finder/state-park/750.aspx','','624 State Park RD, Mountain Rest, SC 29664','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f4d8e81-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ladew Topiary Gardens','Harvey S. Ladew (1887-1976) was born to wealth and became a traveler, an artist, a foxhunter and creator of a topiary garden. He spent much time foxhunting in England and decided to make a garden with an oval swimming pool, cross axes, garden rooms with colour themes - and a famous collection of garden topiary. Among the English gardens which might have inspired him are Levens Hall, Hidcote and Compton Wynyates. ','','','','','','','','','3535 Jarrettsville Pike','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','21111','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f4dd66d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Audra','','','','','','','','http://www.audrastatepark.com/','','Rt. 4 Box 564, Buckhannon, WV 26201','7f7a92b8-ea4c-11e0-8606-00306701b527','edb324d8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f56b725-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Mauna Kea State Recreation Area','','','','','','Daily During Daylight Hours','','http://www.hawaiistateparks.org/hawaiistateparks/parks/hawaii/index.cfm?park_id=54','','on Saddle Road (Highway 200), Hawaii Belt Rd Volcano, HI 96778','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f5979b6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lilypons Water Gardens','Situated along the Monocacy River, Lilypons is an aquatic farm of around 300 acres with some 500 examples of ponds and pools designed to inspire the home garden designer. Ponds are filled with waterlilies, lotus and koi carp which visitors can feed from a floating dock. In addition, there is a showroom with a wide range of pond products. ','','','','','','','','','6800 Lily Pons Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','21710','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f601348-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Mississippi River State Fish and Wildlife Area','','','','','','','','http://www.dnr.state.il.us/lands/Landmgt/PARKS/R4/MISS.HTM','','17836 State Highway 100 N., Grafton, IL 62037','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f65c1ae-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','London Town Gardens, Annapolis','London Town and Gardens are on the South River in Edgewater. The seventeenth and eighteenth century town of London is being excavated by archaeologists and the William Brown House is here. London Town also has a woodland garden and the Richard Hill Garden of medicinal plants. It seems destined to become the Williamsburg of Maryland. ','','','','','','','','','Historic London Town & Gardens, The London Town Foundation, 839 Londontown Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','21037','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f687696-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Montauk Point State Park ','','','','','','Park is open year round, sunrise to sunset.','','http://nysparks.state.ny.us/parks/61/details.aspx','','2000 Montauk Highway, Montauk, NY 11954','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f704fac-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','North Point Recreation Area','','','','','','','','http://gfp.sd.gov/state-parks/directory/north-point/','','38180 297th Street, Lake Andes, SD 57356','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f71d4ae-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','McCrillis Gardens','William McCrillis made the garden and gave it to the Maryland-National Capital Park and Planning Commission in 1978. It is best known for its collection of azaleas - and best visited when they are in flower (March to June). The garden also has ornamental trees, bulbs, groundcovers and shade-loving perennials.','','','','','','','','','6910 Greentree Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','20817','2011-12-22 14:35:23','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f7bbb9f-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Baranof Castle Hill State Historic Site','','','','','','','','http://dnr.alaska.gov/parks/aspunits/southeast/baranofcastle.htm','','Natl Forest Develop Road 7430 Rd, Angoon, AK 99820','7f7a92b8-ea4c-11e0-8606-00306701b527','ec4dd047-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f7fb855-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Salisbury University Arboretum','The arboretum is integrated into the university campus. The plant collection was begun in 1985 and it was declared a national arboretum in 1988. There is also a scupture collection, with a focus on Beaux Arts works.','','','','','','','','','1101 Camden Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','21801','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f8b36e8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Sherwood Gardens','A 6 acre tulip garden, developed in the 1920s by John W. Sherwood. The tulips are at their best in late April.','','','','','','','','','4100 Greenway','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','21218','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f985a3f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','William Paca Garden','William Paca was a signatory to the Declaration of Independence and his garden dates from that time. No documentary records of the original layout survived but, after archaeological and documentary research, a re-created garden was made in the 1970s. The architectural features of the old garden were re-made from illustrations in paintings. They include a summerhouse and a Chinese Chippendale Bridge. ','','','','','','','','','Historic Annapolis Foundation, 186 Prince George Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','21401','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2f9d5c1d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Kinkaid Lake State Fish and Wildlife Area','','','','','','','','http://dnr.state.il.us/lands/Landmgt/PARKS/R5/Kinkaid.htm','','52 Cinder Hill Drive, Murphysboro, IL 62966','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2fa24e5d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Adams National Historic Garden','An eighteenth century house (1731) with a nineteenth century garden. The house and garden were occupied by five generations of the Adams family, including two American presidents - President John Adams (2nd President) and his son President John Quincy Adams (6th President). Abigail Adams, the second first lady, drew upon her European travels for the design of the garden. It was then modified by later generations of the Adams family. The garden has box hedging, flower beds and an orchard.','','','','','','','','','135 Adams Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02269','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2faffa2a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Arnold Arboretum Garden','The oldest public arboretum in America was started in 1872 and planned by Frederick Law Olmsted as part of his world-famous \'Emerald Necklace\'. The Necklace is a linked chain of public parks, running from Boston Common to Franklin Park. The layout of the Arnold Arboretum is ingeniously fitted to the topography, creating a picturesque composition of woods, meadows, hills and valleys. The botanical collection was started by Charles Sargent, as founding director, and Ernest \'Chinese\' Wilson, as the Arboretum\'s most famous plant collector. There is a Chinese Path that is planted with Wilson\'s introductions and special collections of rhododendrons, conifers, viburnum. The design principle was to use exotic species in naturalistic groupings. We can see this as an example of the Principle of Recognition, on which J C Loudon based his Gardenesque Style. The Arboretum is managed by the Trustees of Harvard University. ','','','','','','','','','125 Arborway, Jamaica Plain','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02130','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2fb02538-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Ouabache','','','','','','','','http://www.in.gov/dnr/parklake/2975.htm','','4930 E. St. Rd. 201, Bluffton, IN 46714','7f7a92b8-ea4c-11e0-8606-00306701b527','ecaedf40-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2fbace9d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Hiddenwood Recreation Area','','','','','','','','http://gfp.sd.gov/state-parks/directory/lake-hiddenwood/','','Java, SD 57452','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2fbb1532-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Berkshire Botanical Garden (BBG)','A botanical collection, laid out as a series of garden rooms in a woodland setting. There is a herb garden, shade garden, rock garden, pond garden and vegetable garden.','','','','','','','','','5 West Stockbridge Rd','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01262','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2fdf8fba-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Brookline, Frederick Law Olmsted Office Garden','This is where the profession of landscape architecture was founded. Frederick Olmsted\'s office has a museum and an archive of his work. The office garden is an excellent example of Olmsted\'s style of residential garden design. It has a central lawn and several smaller spaces ','','','','','','','','','Olmsted Museum, 99 Warren Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02445','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2fe50600-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Swan Creek Recreation Area','','','','','','','','http://gfp.sd.gov/state-parks/directory/swan-creek/','','Selby, SD 57472','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('2feffd85-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Castle Hill Garden','The plumbing magnate (founder of Crane Company) established a summer estate here in 1924. An Italianate villa was replaced with with an English style mansion house. He employed the Olmsted firm to design the landscape (and an Italian Garden) and Arthur Shurcliff to design a rose garden and an undulating formal avenue to the sea. The avenue and the Olmsted landscape survive in good condition. ','','','','','','','','','Castle Hill, 290 Argilla Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01938','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3001fdd7-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Moran State Park','','','','','','The park is open year round for camping and day use.  Summer: 6:30 a.m. to 10 p.m. Winter: 8 a.m. to dusk. Some campsites are closed in winter.','','http://www.parks.wa.gov/parks/?selectedpark=Moran','','3572 Olga Road, Olga, WA 98279','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('300d3f9d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Chesterwood','The Chesterwood garden was built in the 1920s as a studio and garden for the sculptor Daniel Chester French (1850-1931). The estate had been purchased by the French family in 1898 and was laid out in the Beaux Arts style of the Country Place Era. The plan is geometrical with a cross axis running from the studio. Columns and a wrought iron arch terminate the axes. A lilac hedge runs along the eastern edge of the garden and hemlock marks the west and south edges. Daniel Chester French is famous for the sculpture in Lincoln for the Memorial in Washington D.C. and the Minute Man. French designed the the garden himself with both geometrical and informal elements. The style is Arts and Crafts and it makes an interesting comparison with other artist\'s gardens (eg the Museo de Sorolla in Madrid and G F Watts garden in England). ','','','','','','','','','4 Williamsville Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01262','2011-12-22 14:35:24','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3013e4a9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Kepler-Bradley Lakes State Recreation Area','','','','','','','','http://dnr.alaska.gov/parks/aspunits/matsu/keplerbradlksra.htm','','2431 E Kepler Dr, Palmer, AK 99645','7f7a92b8-ea4c-11e0-8606-00306701b527','ec4dd047-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('301e938c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Yuma Quartermaster Depot State Historic Park','','','','','','9 am to 5 pm','','http://azstateparks.com/Parks/YUQU/index.html','','201 N. 4th Avenue, Yuma, AZ 85364','7f7a92b8-ea4c-11e0-8606-00306701b527','ec55e77f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('303259c2-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Village Creek State Park','','','','','','','','http://www.arkansasstateparks.com/villagecreek/','','201 County Road 754, Wynne, AR  72396','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5990db-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('303aae2c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Harriman State Park','','','','','','','','http://parksandrecreation.idaho.gov/parks/harriman.aspx','','3489 Green Canyon Road ,Island Park, ID 83429','7f7a92b8-ea4c-11e0-8606-00306701b527','eca177fb-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('303b3e7b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Codman House and Gardens','In the 1790s, John Codman carried out extensive improvements to the original Georgian house and surrounding grounds. John Codman wished to create an English landscape park (c 1798). Five generations of the Codman family lived here. The gardens have a hidden Italian garden (c. 1900), perennial beds, and a lily pool and an English cottage garden, (c1930). The Italian garden was designed with the help of Edith Wharton. As in her own garden, she knew what she ought to do but lacked sufficient design talent for the job.','','','','','','','','','Codman Estate, The Grange, 34 Codman Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01773','2011-12-22 14:35:25','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30437cec-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Falls Lake State Recreation Area','','','','','','November - February, 8 a.m. - 6 p.m. March - April and September - October, 8 a.m. - 8 p.m. May - August, 8 a.m. - 9 p.m. Closed Christmas Day.','','http://www.ncparks.gov/Visit/parks/fala/main.php','','13304 Creedmoor Rd., Wake Forest, NC 27587','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('304c7d28-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Frenchtown Pond State Park','','','','','5/1 - 9/30','9:00am - 9:00pm ','','http://www.visitmt.com/categories/moreinfo.asp?SiteID=1&IDRRecordID=3076','','3201 Spurgin Road，Missoula, MT 59804\r\n\r\n','7f7a92b8-ea4c-11e0-8606-00306701b527','ed049c7e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3050b857-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Garden in the Woods','A New England wildflower garden with more than 1600 varieties. There are notable displays of Trout Lilies, Virginia Bluebells, Bloodroot, Oconee Bells, Wood Phlox, Yellow Lady-slippers, Shooting Stars, Great Trilliums, Calopogon orchids and Blue gentians. The garden was established by the landscape architect Will Curtis and is now managed by the New England Wildflower Society and they have plants for sale. ','','','','','','','','','180 Hemenway Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01701','2011-12-22 14:35:25','a1c3e20e-f181-11e0-8a53-00306701b527',1),('305460e6-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','William B. Umstead State Park','','','','','','The gate at the Crabtree Creek entrance will open at 7 a.m. daily as part of a pilot program to allow early access to the trails system.  November - February, 8 a.m. - 6 p.m.  March, April, September, October, 8 a.m. - 8 p.m.  May - August, 8 a.m. - 9 p.m','','http://www.ncparks.gov/Visit/parks/wium/main.php','','8801 Glenwood Avenue, Raleigh, NC 27617','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('305cc10c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','San Angelo State Park','','','','','','Open: 7 days a week year-round.','','http://www.tpwd.state.tx.us/spdest/findadest/parks/san_angelo/','','3900 - 2 Mercedes, San Angelo, TX 76901','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30642460-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Anderson Marsh State Historic Park','','','','','','Sunrise to Sunset.','','http://www.parks.ca.gov/default.asp?page_id=483','','Lower Lake,?CA?95457','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('306ca312-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Suwannee River State Park','','','','','','8 a.m. until 6:00 p.m. 365 days a year','','http://www.floridastateparks.org/suwanneeriver/default.cfm','','3631 201st Path, Live Oak, Florida 32060','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('306d7771-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Glen Magna Farms and Garden','Joseph Peabody a rich Salem shipping merchant purchased the Danvers estate in 1812. The first section of the estate is known as the Old Fashioned Garden. The gazebo or Little Summer House was designed by Joseph Peabody\'s fourth son. Another descendent of Peadbody asked the Boston firm of Little, Browne and Moore extend the house in 1893. She also enlarged the garden. There is an Italian Garden designed by Joseph Chamberlain, father of Neville Chamberlain (Prime Minister of Great Britain before the Second World War). The style, related to the Arts and Crafts movement, was popular in England at the time. ','','','','','','','','','Glen Magna Farms Function Office, Ingersoll Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01923','2011-12-22 14:35:25','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3073cd7e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Travelers Rest Historic Site','','','','','','1st and 3rd Saturday each month / 9:00 am - 5:00 pm, 3rd Friday each month / 9:00 am - 5:00 pm. ','','http://gastateparks.org/TravelersRest','','4339 Riverdale Road, Tocca, GA 30577','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('307a54fe-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Gropius House and Garden','The Bauhaus pioneer Walter Gropius designed this house for his family when he took a job at the Harvard Graduate School of Design. It had a profound impact on American architecture but the garden design is curiously Arts and Crafts in style, indicating that Gropius had no understanding of how Bauhaus principles might affect garden design. ','','','','','','','','','68 Baker Bridge Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01773','2011-12-22 14:35:25','a1c3e20e-f181-11e0-8a53-00306701b527',1),('307b0890-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Dunn State Park','','','','','','','','http://www.mass.gov/dcr/parks/central/dunn.htm','','289 Pearl St., Gardner, MA 01440','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3082a650-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Burke Lake Recreation Area','','','','','','','','http://gfp.sd.gov/state-parks/directory/burke-lake/','','29145 Burke Lake Road, Burke, SD 57523','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30898ef3-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Heritage Museums & Gardens','Charles O Dexter established the garden. He was a famous rhododendron collector and hybridizer and worked with Charles Sprague Sargent on the Arnold Arboretum collection. The estate was then bought by Josiah Lilly and used to established a collection of Americana - cultural artefacts. Lilly also restored and extended the garden, creating a collection of day lilies. In Autumn 2006, fifty thousand daffodils and tulips were planted. ','','','','','','','','','Heritage Plantation of Sandwich, 67 Grove Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02563','2011-12-22 14:35:25','a1c3e20e-f181-11e0-8a53-00306701b527',1),('308ba9ac-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','New Brighton State Beach','','','','','','8 AM to Sunset','','http://www.parks.ca.gov/default.asp?page_id=542','','Capitola,?CA?95010','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3095545e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Isabella Stewart Gardner Museum Garden','The museum building was designed as a fifteenth century Italian palazzo, to house a collection of European art. Within the palace is a courtyard garden. It has the charcter of a small Italian garden, not of the typical internal court in a Florentine palazzo. There is a mosaic design in the middle of the courtyard. Nasturtiums are hung from the balconies in remembrance of Mrs. Gardner\'s birthday (April 14, 1840). There is a rotating seaonal display and other highlights include a display of hydrangeas, Martha Washington geraniums, cape primrose and tree ferns in May; and a holiday-inspired installation of poinsettias, azaleas, cyclamen, winter berries and heather trees in December and January. Outside the palace is the Monks Garden (named after Olga Monks, Mrs Gardner\'s favourite niece), the South Garden and a formal rose garden. ','','','','','','','','','280 The Fenway','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02115','2011-12-22 14:35:25','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30a14994-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','John Whipple House and Garden','The house was built in the 1650s and moved to its present site in the 1920s. Arthur Shurcliff was then asked to design a suitable garden, only part of which was implemented. Ann Leighton (author of books on The American Garden in the Eighteenth Century and in the Nineteenth Century) was asked to research and implement a historically-based planting design.','','','','','','','','','Heard House, 54 South Main Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01938','2011-12-22 14:35:25','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30ada0ce-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Long Hill Garden','Mabel Sedgwick was the author of a book on The Garden Month by Month and the wife of the editor of the Atlantic Monthly - who married another gardener when Mabel died. The result of the two ladies work lies somewhere between the Mixed Style and the Arts and Crafts style of garden design. There is a Chinese pagoda, a Venetian pavilion, a Little Garden and a flight of Fan Steps','','','','','','','','','572 Essex Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01915','2011-12-22 14:35:25','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30b93f01-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Longfellow House and Garden','Henry Wadsworth Longfellow lived here from 1837 to 1775. The house is clapperboard colonial. Charles Eliot was asked to redesign the park in the late nineteenth century and Ellen Biddle Shipman did a planting scheme. The National Park Service restored the garden to its colonial style, emphasising the formality of the original layout. ','','','','','','','','','Longfellow National Historic Site, 105 Brattle Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02138','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30c5300f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lyman Estate - The Vale Garden','The Vale garden was originally designed by an English gardener (William Bell) and inspired by English naturalistic design. It evolved into a Mixed Style Victorian gardens with rhododendrons, azaleas and specimen trees. It looks as though the owners possessed a copy of J C Loudon\'s Encyclopedia of Gardening. There is a notable range of greenhouses including the Grape House (1804) and the Camellia House (1820). ','','','','','','','','','The Lyman Estate, 185 Lyman Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02452','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30d0ca68-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Brandywine Zoo','','','','','','','','http://www.destateparks.com/attractions/brandywine-zoo/','','1001 North Park Drive, Wilmington, DE 19802','7f7a92b8-ea4c-11e0-8606-00306701b527','ec70a389-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30d1f920-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mission House and Garden','Mabel Choate of Naumkeag moved the old mission house to this site in 1926 and employed her landscape architect, Fletcher Steele, to design a suitable garden. His approach, more imaginative than historical, has produced a charming small \'cottage garden\' ','','','','','','','','','Mission House, 19 Main Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01262','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30d855c1-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Ames Nowell State Park','','','','','','','','http://www.mass.gov/dcr/parks/southeast/ames.htm','','Linwood St, MA 02321','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30df678f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mount Auburn Cemetery Garden','Inspired by Pere Le Chaise Cemetery in Paris, Mount Auburn is a cemetery with the character of an early nineteenth century English landscape garden - with gardenesque planting to suit. Many famous Bostonians lie here, including the man (Charles Eliot) who established, at the Harvard Graduate School of Design, the first landscape architecture education program in the world. His son, Chaarles W Eliot, who worked for Frederick Law Olmsted and planned the Boston Metropolitan Parks System. Mount Auburn is thus a memorial to the origins of America\'s landscape architecture profession. ','','','','','','','','','Mount Auburn, 580 Mount Auburn Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02138','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30e05ed9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Cape May Point State Park','','','','','','Open daily dawn to dusk.','','http://www.state.nj.us/dep/parksandforests/parks/capemay.html','','P O Box 107, Cape May Point, NJ 08212','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30e8b3e0-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Havasu State Park','','','','','','','','http://azstateparks.com/Parks/LAHA/index.html','','699 London Bridge Road, Lake Havasu, AZ 86403','7f7a92b8-ea4c-11e0-8606-00306701b527','ec55e77f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30ecda61-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Naumkeag Garden','The house was designed in 1885, by Stanford White. The garden, by Nathan Barrett included an allee and two terraces. Mabel Choate inherited the house and from 1926 onwards developed the gardens with Fletcher Steele as her landscape architect. Their work included the Afternoon Garden, the Chinese Garden with a Moon Gate and the Blue Steps. The latter is the garden\'s most famous feature. A flight of steps with arched blue recesses and a white Art Nouveau handrail ascends through paper-white birch trees. ','','','','','','','','','5 Prospect Hill Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01262','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30f11a68-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Ellmaker State Wayside','','','','','','','','http://www.oregonstateparks.org/park_218.php','','Eddyville, OR 97343','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('30fb78b9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Newbury Perennial Gardens','The gardens were designed to display gardens from a horticultural nursery - and to attract visitors. The style, of the well-managed, planting design is \'English Arts and Crafts\' with a white garden inspired by Sissinghurst. ','','','','','','','','','65 Orchard Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01922','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3100d7ed-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Rockport State Park','','','','','','6 a.m. to 11 p.m. (17-hour access year round - gates are closed overnight)','','http://stateparks.utah.gov/parks/rockport','','9040 North Highway 302, Peoa, UT 84061','7f7a92b8-ea4c-11e0-8606-00306701b527','ed934339-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3108490d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Old Sturbridge Village Gardens','David Wight had a farm here in the nineteenth century with a sawmill, gristmill and millpond. In 1936 George Washington Wells, founder of the American Optical Company of Southbridge, decided to use the village as a museum for his historical collection. Arthur Shurcliff was employed to design American heritage gardens, including plots for vegetables and flowers and other ornamental features. The village has a collection of historic buildings.','','','','','','','','','Old Sturbridge Village, 1 Old Sturbridge Village Road, Old Sturbridge Village','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01566','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('310c5065-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Crater of Diamonds State Park','','','','','','','','http://www.craterofdiamondsstatepark.com/','','209 State Park Road, Murfreesboro, AR  71958','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5990db-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3115fcd5-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Constitution Convention Museum State Park','','','','','','visitor center is open from 9:00 a.m. to noon and 1:00 p.m. to 5:00 p.m. Thursday through Monday. Closed Thanksgiving, Christmas and New Year\'s Day','','http://www.floridastateparks.org/constitutionconvention/default.cfm','','200 Allen Memorial Way Port St., Joe, Florida 32456','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('311694eb-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Tenshin-En Japanese Garden','A Japanese rock garden named in honor of Okakura Tenshin, the former Asiatic curator of the Museum of Fine Arts, Boston. Tenshin-En means \'Garden of the Heart of Heaven\'. Created in the kare sansui style, the garden was inspired by the Zen temple gardens of 15th-century Japan. Combining elements from Japan, New England and the Museum of Fine Arts, the garden creates a new interpretation of an ancient art form. Over 150 boulders from Boston\'s North Shore are placed within the garden according to ancient Japanese traditions. The roofed gate was built in Kyoto and was reconstructed by carpenters from Japan onsite. The raked gravel symbolises a large body of water. The garden is planted with a mixture of Japanese and American plants.','','','','','','','','','Museum of Fine Arts, Boston, 465 Huntington Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','02120','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('311de847-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Joseph Whidbey State Park','','','','','','Summer: 8 a.m. to dusk. Winter: Closed Oct. 1, reopens April 1.','','http://www.parks.wa.gov/parks/?selectedpark=Joseph%20Whidbey','','395 North Fort Ebey Road, Coupeville, WA 98239','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31259382-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Milford State Park','','','','','','','','http://www.recreationparks.net/KS/geary/milford-state-park-milford-dam','','8798 State Park Rd, Milford, KS 66514','7f7a92b8-ea4c-11e0-8606-00306701b527','ecbd0598-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3126bec5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Mount Garden','The gardens were designed, by Edith Wharton, to form transition between the house and the natural landscape beyond. There is a flower garden connected to a walled garden by a lime walk. The gardens restored for their centenary, in 2002. The white manse, house which Wharton built in 1902 for $84,000 was the place where she wrote her best-selling novel, ?The House of Mirth? Wharton had travelled in Italy and written a book on Italian gardens. Henry James saw the garden, in 1904 as \'a delicate French chateau mirrored in a Massachusetts pond.\' ','','','','','','','','','2 Plunkett Street, Box 974','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01240','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('312d32aa-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Corson\'s Inlet State Park','','','','','','','','http://www.state.nj.us/dep/parksandforests/parks/corsons.html','','Ocean City, NJ 08226','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3132ea4c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Tower Hill Botanic Garden','A botanic garden operated by the Worcester County Horticultural Society. It has a Lawn Garden, a Secret Garden, a Cottage Garden a Wildlife Garden, a Preservation Apple Orchard, a Systematic Garden and an Orangerie. ','','','','','','','','','11 French Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','01505','2011-12-22 14:35:26','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31374e55-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Crystal Lake State Park','','','','','Memorial Day Weekend to Labor Day Weekend','10:00 AM - 9:00 PM or Official Sunset','','http://www.vtstateparks.com/htm/crystal.htm','','96 Bellwater Ave., Barton, VT 05822','7f7a92b8-ea4c-11e0-8606-00306701b527','