Mt. Zion, IL 62549','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3180f3ae-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hidden Lake Gardens','Harry Fee\'s former nursery garden was bequeathed to the Michigan State University. It is run as a botanic garden and has a significant collection of hostas.','','','','','','','','','6280 Munger Road (M50)','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','49287','2011-12-22 14:35:27','a1c3e20e-f181-11e0-8a53-00306701b527',1),('318839b9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Buffalo River State Park','','','','','','','','http://www.dnr.state.mn.us/state_parks/buffalo_river/index.html','','565 155th Street South, Glyndon, MN 56547','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf0dc60-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('318f22f3-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Horticultural Demonstration Gardens','A horticultural demonstration garden, with nineteenth century origins, run by Michigan State University. ','','','','','','','','','Michigan State University, Wilson and Bogue Streets','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','48824','2011-12-22 14:35:27','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3190b889-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Rothschild House State Park','','','','','','','','http://www.ptguide.com/recreation-activities/state-a-national-parks/119-historical-sites-rothschild-house','','Port Townsend, WA 98368','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('319bef8e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Matthaei Gardens','The Matthaei Botanical Gardens was a gift from Fred and Mildred Matthaei. The design by O.C. Simonds (Ossian Cole Simonds, author of Landscape-Gardening, 1920) and makes imaginative use of the topography. It has long walks beside Fleming Creek and through woodland. There are perennials, roses, native plants and a knot garden','','','','','','','','','Matthaei Botanical Gardens & Nichols Arboretum, Univerity of Michigan, 1800 North Dixboro Rd','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','48105','2011-12-22 14:35:27','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31a8736b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Moross Garden','The oldest house and in Detroit, in semi-Greek Revival style, was restored in 1971. The garden was also re-created using Victorian plants and features, including a pergola with a wisteria. It is the headquarters for the Detroit Garden Center (a non-profit educational institution). ','','','','','','','','','Moross House, 1460 E. Jefferson','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','48207','2011-12-22 14:35:27','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31bb5f83-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Whitcomb Conservatory Garden','The Anna Scripps Whitcomb Conservatory on Belle Isle was designed by Albert Kahn. In 1952 the wooden beams were replaced with aluminum. Nearby is a perennial garden, a rose garden and a lily pond garden. The Conservatory contains a large orchid collection. The original park on Belle Isle was designed by Frederick Law Olmsted in 1881. ','','','','','','','','','Anna Scripps Whitcomb Conservatory, Belle Isle','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','48207','2011-12-22 14:35:27','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31cc5a2d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Como Park Zoo and Conservatory','The Marjorie McNeely Conservatory opened in 1915 and contains over half an acre of indoor gardens including a Sunken Garden and 64 ft Palm Dome.  There is also an outdoor Japanese Garden which symbolises the bond between Saint Paul and its sister city Nagasaki in Japan.','','','','','','','','','1225 Estabrook Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf0dc60-f48c-11e0-b192-00306701b527','','55103','2011-12-22 14:35:27','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31d76975-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Minnesota Landscape Arboretum','The original design was by the old landscape architecture firm of Hare and Hare. They proposed formal gardens in the central area and treating most of the site as a landscape. There is an Azalea Garden, a Hosta Glade and a number of gardens designed by well-known landscape architects. Koichi Kawana designed a Japanese Garden and there is work by John Simonds, Michael Van Valkenburgh and Jim Hagstrom. It is an enlightened policy for getting both quality and variety in the designed landscape. ','','','','','','','','','Minnesota Landscape Arboretum, 3675 Arboretum Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf0dc60-f48c-11e0-b192-00306701b527','','55318','2011-12-22 14:35:27','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31e45857-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Noerenberg Memorial Gardens','The garden of a late nineteenth century summer house on the shore of Lake Minnetonka that was formerly the home of Frederick Noerenberg who founded Grain Belt Brewery. The estate was bequeathed to Three Rivers Park District in 1972 by his daughter. The house was demolished under the terms of her will but the garden is well-cared for.','','','','','','','','','2840 North Shore Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf0dc60-f48c-11e0-b192-00306701b527','','55391','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31ee97b5-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','George J. Hatfield State Recreation Area','','','','','','','','http://www.parks.ca.gov/?page_id=556','','4394 North Kelly Road Hilmar, Hilmar-Irwin,?CA?95324','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31f016ed-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Crosby Arboretum Garden','The Crosby Arboretum began as a memorial to L.O. Crosby. (1907-1978) a local forester and philanthropist. It aims to protect the biological diversity of the Pearl River Drainage Basin. It has a Native Plant Center (designed by Fay Jones ) and an Interpretive center. The landscape architect was Edward Blake and the design received an award from the American Society of Landscape Architects (ASLA) ','','','','','','','','','370 Ridge Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf6a75d-f48c-11e0-b192-00306701b527','','39466','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('31fc7e9f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Linden Plantation Gardens','The Linden Plantation was established by John Wesley Vick, son of the founder of Vicksbury. His wife was Anne Marie Brabston. The plantation has passed down the generations to the current owners - Bryan and Joy Brabston. Joy was formerly president of Vicksburg Council of Garden Clubs and has restored the garden. There is a parterre, herb garden, butterfly garden, cottage garden and ruins garden. The house is run as a B & B.','','','','','','','','','Duncan Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf6a75d-f48c-11e0-b192-00306701b527','','39180','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3209918e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mynelle Gardens','Mynelle Westbrook Hayward\'s garden and was acquired by the City of Jackson in 1973. It has a pond, elegant bridges and gardenesque planting. ','','','','','','','','','4736 Clinton Boulevard','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf6a75d-f48c-11e0-b192-00306701b527','','39209','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3216bde5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Jewel Box, Forest Park','The Jewel Box is a large Art Deco greenhouse that opened in 1936 and is situated in Forest Park.','','','','','','','','','McKinley Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','63112','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32225ca9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kauffman Memorial Garden','Ewing Kauffman was a pharmaceutical magnate and founder of the Kansas City Royals.  This 2 acre garden was his gift to the city. The Parterre Garden has a long pool (visible in the satellite image on the location map below) with bronze sculptures by local artist Tom Corbin. There is also a Green Garden and Secret Garden.','','','','','','','','','4800 Rockhill Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','64110','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3232c02c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Missouri Botanical Garden','One of the first public gardens in America and managed with a design sense often lacking in botanic gardens. The Climatron geodesic glass dome conservatory forms a centerpiece and encloses a tropical rain forest. Outdoor display areas include a 14-acre Japanese Garden, new Children\'s Garden, two rose gardens, a picturesque English woodland, Victorian area, a Japanese Garden and a new Turkish-style Ottoman garden. ','','','','','','','','','4344 Shaw Boulevard','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','63110','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('323e4313-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Powell Gardens','The land was purchased by George E. Powell, Sr in 1948.  There is a rock garden, perennial garden, island garden, wildflower meadow and conservatory.','','','','','','','','','1609 N.W. U.S. Highway 50','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','64601','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('324ebcd7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Memorial Rose Garden, Missoula','Members of the American Rose Society suggested that a Missoula park be commemorated as a site which would perpetuate the memory of members of the armed forces, from Missoula County, killed in WW II. It later became an American Rose Society test ground. ','','','','','','','','','State Veteran\'s Memorial Rose Garden Missoula, MT, 700 Brook Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed049c7e-f48c-11e0-b192-00306701b527','','59801','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32597cfe-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lauritzen Gardens','Lauritzen Gardens has been developed since 1995. There is a rose garden, peony garden, herb garden and children\'s garden.','','','','','','','','','100 Bancroft Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed0bdbcc-f48c-11e0-b192-00306701b527','','68108','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32664c1d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Sunken Gardens, Lincoln','The Sunken Gardens was built in 1930 on an old 1.5 acre neighborhood landfill site in the heart of Lincoln. The sunken gardens were made in a depression (hence their name) and were originally known as Lincoln\'s \'Rock Garden\', which described their design. The project was developped as an opportunity for unemployed men to earn money to support their families through the difficult economic circumstances. The original design aimed to evoke mountain scenery, as in England, with rocks on the terraced walls creating the garden’s edge.  But the planting was undertaken by the city\'s horticultural department and concentrates more on bright floral display than on the use of Rocky Mountain, Alpine or Himalayan plants. In the centre, there was a cascading waterfall surrounding “Rebecca at the Well,” a sculpture of a woman holding a water jug, by Ellis Burman.  There were two reflecting pools on the north and east sides of the garden.  In the north pool was an interesting historic feature - a geyser fountain that would shoot water in the air and create a thin sheet which could be used as a screen for the projection of movies or slides at night. The technology of the time was not equal to the task. Let us hope another attempt will be made using a digital projector. It would be a great way of evoking mountain scenery.  After nearly 73 years without a major renovation, the Sunken Gardens was overhauled in 2004.  While maintaining many design elements of the original garden, several new features were added making the garden easier to maintain and access.  A new parking lot, public restrooms, underground sprinklers, renovated ponds, retaining walls and new walkways were built during the 11 month project. Over 100 trees and 1,000 shrubs were added as well as 18,000 square feet of space for annual flowers, a design that changes year to year. Three new art pieces have also been added to the gardens.  Burman’s aged sculpture was replaced with artist David Young’s “Rebekah at the We','','','','','','','','','Lincoln Parks & Recreation, 2740 A Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed0bdbcc-f48c-11e0-b192-00306701b527','','68502','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3271e43c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ethel M Chocolate Factory Botanical Garden','The garden was planned along with Ethel M\'s new chocolate factory. It is a cactus garden \'based on the English landscape model of naturalistic design\'. ','','','','','','','','','Cactus Garden, 2 Cactus Garden Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ed121df0-f48c-11e0-b192-00306701b527','','89014','2011-12-22 14:35:28','a1c3e20e-f181-11e0-8a53-00306701b527',1),('327efb0b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Fuller Gardens','Fuller Gardens is one of the last turn-of-the-century estate gardens left in the Northeast. Once an ornament to Alvan T. Fuller\'s summer home, the grounds were designed in the \'Colonial Revival\' style by noted landscape architect Arthur Shurcliff, with additions in the 1930s by the Olmstead Brothers. This seaside garden is enclosed by sculpted hedges and has a strong rose garden, interesting annual displays, English style perennial plantings, a hosta display garden, a tropical/desert conservatory and a Japanese garden with Koi pond. ','','','','','','','','','10 Willow Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','03862','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('328a96d6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Governor John Langdon House Garden','Governor Langdon was a signatory to the American Constitution and George Washington visited his house. The garden design is characteristic of the nineteenth century Mixed Style. It has herbaceous perennials, a pergola, a pavilion, a geometrical axis. The house was extended my McKim, Mead and White in 1905 and has a dining room opening onto the back garden. ','','','','','','','','','143 Pleasant Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','03801','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3296d539-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fort Kearny State Recreation Area','','','','','','','','http://outdoornebraska.ne.gov/parks/guides/parksearch/showpark.asp?Area_No=98','','1020 V Road, Kearney, NE 68847','7f7a92b8-ea4c-11e0-8606-00306701b527','ed0bdbcc-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32981225-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Moffatt-Ladd House and Garden','The Moffatt-Ladd House and Garden are managed by the National Society of The Colonial Dames of America who explain that \'The present form of the Moffatt-Ladd garden was designed by Alexander Hamilton Ladd in the mid-19th Century. His daily records reveal that some of his plants were from the gardens of his mother and grandmother. The English damask rose was planted in 1768 by Mrs. Samuel Moffatt. The enormous horse chestnut tree, which is about 80 feet tall and 20 feet in circumference, was planted in 1776 by William Whipple upon his return from Philadelphia where he had just signed the Declaration of Independence. Known as the Tree of Independence, it was selected in the Year 2000 as The Millennium Landmark Tree for the State of New Hampshire.\' In fact the style of the planting design is a blend of nineteenth century and twentieth century ideas, undoubtedly with an English flavour. ','','','','','','','','','154 Market Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','03801','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32a49cbc-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Rundlet-May House and Garden','The house of an eighteenth century textile merchant. The gardens were restored with the help of a late nineteenth century photograph and have a late-Victorian character: rectangular beds on informal terraces - and a dogs cemetery. ','','','','','','','','','Rundlet-May House, 364 Middle Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','03801','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32b0b2f2-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Saint-Gaudens National Historic Garden','The garden was owned and designed by the sculptor Agustus Saint-Gaudens, in an Italian version of the Arts and Crafts style. In addition to many of his own sculptures, it has hedges, fountains, pools and pergolas. In the 1940s Ellen Biddle Shipman was commissioned to restore the sculptor\'s garden. She made extensive use of herbaceous borders and several copies of sculptures were placed in the garden. ','','','','','','','','','130 Saint Gaudens Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','03745','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32bcfb3d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Strawbery Banke Museum and Gardens','Strawberry Banke is a seventeenth century plantation settlement beside Puddle Dock. The Museum has a set of re-created colonial period gardens including the Sherburne Garden, the Victory Garden, the Aldrich Garden, the Goodwin Garden and a herb garden. They were domestic gardens with flowers and vegetables, not fashionable gardens, owing much to the town gardens of late-renaissance Europe. The Sherburne Garden is a seventeenth century kitchen garden with raised beds, recreated on it original site. The Victory Garden is a recreation of the garden of the family who lived on the site during the Second World War.','','','','','','','','','Strawbery Banke Museum, 14 Hancock Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','03801','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32c873a1-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Fells - Historic Estate and Gardens','The Fells served as a summer retreat for three generations of the Hay family. From 1891 until his death in 1905, John Hay, diplomat and distinguished man of letters, summered in a cottage he built on the eastern shore of Lake Sunapee, facing Mt. Sunapee. He called his estate “The Fells” after the Scottish word for rocky upland pastures. His son Clarence Hay designed and built a walled Colonial Revival style garden featuring arbors and trellises, flowering trees and shrubs, and classic statuary. Construction of the rock garden began in 1929. A stream runs through the rock garden and there is a lily pond in the centre. There is also a rose terrace and 100-foot perennial border.','','','','','','','','','The Fells, 456 Route 103A','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','03255','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32d34ef0-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Boston Harbor Islands State Park','','','','','','','','http://www.mass.gov/dcr/parks/metroboston/harbor.htm','','Long Island Quincy, MA 02171','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32d59109-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Colonial Park Gardens','Colonial Park has a rose garden, a perennial garden, a fragrance and sensory garden and an arboretum. The Rudolf W. van der Goot Rose Garden was named after the first horticulturist of the Somerset County Park Commission. The site was formerly the Mettler Estate and the rose garden retains some original features.','','','','','','','','','Mettlers Road, Franklin Township','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','08873','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32e3c6c3-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Deep Cut Gardens','Deep Cut Gardens are named after the deep valley in which they were made. They were made by an Italian family and are now managed with the intention of providing a living display of cultivated and native plant materials for home gardeners. ','','','','','','','','','152 Red Hill Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','07748','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32e8ca19-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Stony Brook Reservation','','','','','','','','http://www.mass.gov/dcr/parks/metroboston/stony.htm','','Boston, MA 02136','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32effb1c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Duke Gardens','Doris Duke spent 50 years making the gardens. There are 11 garden rooms, each devoted to a different style, including a Chinese Garden, a Mughal Garden, an Italian Garden, an English Garden and a Japanese Garden. Clearly it is a prime example of the Mixed Style advanced by Humprhry Repton and inadvertently promoted by JC Loudon\'s Encyclopedia of Gardening. There were originally 35 fountains, of which 7 remain. There are also 9 lakes at Dukes Farms. The gardens have been open to the public since 1964. Duke Gardens begins a 2 year program of renovation from May 2008. ','','','','','','','','','80 Route 206 South','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','08844','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32f36db5-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Delaware Canal State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/delawarecanal.aspx','','11 Lodi Hill Road, Upper Black Eddy, PA 18972','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32fbb886-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Frelinghuysen Arboretum','George G. Frelinghuysen married Sara Ballantine in 1881 and they commissioned Rotch and Tilden to design a summer home (named Whippany Farm) in a Colonial Revival style.Their daughter was a keen gardener and in 1964 set about turning the estate into an arboretum. The old garden and the arboretum are now maintained by the Township and volunteers. ','','','','','','','','','53 East Hanover Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','07962','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('32fcac94-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lapham-Patterson House Historic Site','','','','','','','','http://gastateparks.org/LaphamPatterson','','626 N Dawson St, Thomasville, GA 31792','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3308410e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Leaming\'s Run Gardens','The gardens were named after a stream known in colonial times the stream as \'Uncle Aaron Leaming\'s Run\'. They were designed by Jack and Emily Aprill after 1957. In the area around Thomas Leaming House they made an eccentric wetland and woodland garden with dramatic color themes and effects. ','','','','','','','','','1845 Route 9','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','08210','2011-12-22 14:35:29','a1c3e20e-f181-11e0-8a53-00306701b527',1),('330ad588-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Brush Lake State Park','','','','','May 1 - December 1','Daylight','','http://www.visitmt.com/categories/moreinfo.asp?SiteID=1&IDRRecordID=16008','','54078 US Highway 2 West, Glasgow, MT 59230\r\n\r\n','7f7a92b8-ea4c-11e0-8606-00306701b527','ed049c7e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('331407ef-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Leonard Buck Garden','The garden was madeby a geologist in a glacial valley. Leonard J. Buck, a trustee of the New York Botanical Gardens in the 1930s, worked with the Swiss landscape architect Zenon Schreiber. They worked by eye, without drawing plans. There is a Fern Garden, a Big Rock, a Primrose Path, a Horseshoe Rock and New Rock. It is a fine example of working with the Genius of the Place. ','','','','','','','','','Leonard J. Buck Garden, 11 Layton Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','07931','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('331a72aa-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Brendan T. Byrne State Forest','','','','','','Open daily sunrise to sunset.','','http://www.state.nj.us/dep/parksandforests/parks/byrne.html','','P.O. Box 215, New Lisbon, NJ 08064','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('332190a8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Presby Iris Gardens','The Presby Iris Gardens were established in 1927 in memorial of Frank Presby and are now one of the largest collections of iris in the world. Presby was a founding member of the American Iris Society and its first treasurer. The Iris Gardens are open only in spring and autumn, for obvious reasons, and are then spectacular. ','','','','','','','','','The Presby Memorial Iris Gardens, 474 Upper Mountain Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','07043','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('332d2445-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Skylands Botanical Garden','Francis Lynde Stetson (1846-1920) assembled \'Skylands Farms\' in the Ramapo Mountainsand employed Samuel Parsons, Jr., a protégé of Frederick Law Olmsted, to lay out the estate. Parsons, a founder member of the American Society of Landscape Architects and New York City parks commissioner, used photographs Skylands in his book, The Art of Landscape Architecture, Its Development and Its Application to Modern Landscape Gardening (1915). Skylands was then bought by Clarence McKenzie Lewis (1877-1959), a trustee of the New York Botanical Garden who built a new Tudor mansion in a material never used by the Tudors: granite. John Russell Pope designed the new house and Vitale and Geiffert to design the gardens. (Geiffert also designed the Rockefeller Center and the grounds of Princeton University). New Jersey purchased Skylands in 1966 and New Jersey Governor Thomas Kean designated the area surrounding the manor house as New Jersey\'s official botanical garden. The result is midway between a Victorian garden and a botanical garden. ','','','','','','','','','PO Box 302','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','07456','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('332ed8bc-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Alderwood State Wayside','','','','','','','','http://www.oregonstateparks.org/park_80.php','','Cheshire, OR 97419','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3337475c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Point Mugu State Park','','','','','','Gate is locked from 10pm to 8am No entry after 10pm.','','http://www.parks.ca.gov/default.asp?page_id=630','','Camarillo,?CA?93012','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('334036a7-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Androscoggin Wayside Park','','','','','','','','http://www.nhstateparks.org/explore/state-parks/androscoggin-wayside-park.aspx','','Route 16，Errol, NH 03579','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3342d815-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Van Vleck Gardens','A 6 acre suburban estate with an Italianate Villa. The gardens were developed by 3 generations of the Van Vleck family. The property has been owned by the Montclair Foundation since 1993. There are some interesting rhododendrons and azaleas.','','','','','','','','','21 Van Vleck Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','07042','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33481cd9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Taconic State Park - Copake Falls Area','','','','','','Park is open year round, sunrise to sunset, weather and conditions permitting.','','http://nysparks.state.ny.us/parks/83/details.aspx','','Route 344, P.O. Box 100, Copake Falls, NY 12517','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33519d56-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Tolmie State Park','','','','','','Summer: 8 a.m. to dusk.  Winter: Open 8 a.m. to dusk Wednesdays through Sundays Sept. 7 through April 30. ','','http://www.parks.wa.gov/parks/?selectedpark=Tolmie','','7730 61st Ave NE Olympia, WA 98506','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3355f829-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Boscobel Garden','Set on 45 acres of meticulously landscaped grounds, Boscobel, the Federal house museum in Garrison, is set upon a bluff overlooking the Hudson River and the Hudson Highlands. Built in the early 1800s by American Loyalists States and Elizabeth Dyckman, Boscobel was originally located in Montrose. When the house was threatened with demolition in 1955, a group of dedicated preservationists rescued the structure. It was fully restored and opened to the public in 1961. Lila Acheson Wallace, co-founder of The Reader\'s Digest and benefactor of Boscobel, commissioned the Long Island landscape architectural firm of Innocenti and Webel to provide an appropriate historic setting for the restored house. The formal Rose Garden is designed in a classic English wheel pattern. It has four raised beds surrounding a circular garden with a delightful fountain. Over six hundred rose bushes of 150 varieties are planted including hybrid teas, grandifloras, and old-fashioned English roses. The Herb Garden with its Adjacent Orangerie, is geometrically designed with separate beds for herbs and flowers. The Herb Garden has been maintained by the local garden club since Boscobel\'s opening. The East Terrace Garden opened in 2004 and is planted with annuals, tropicals, perennials and shrubs. The Woodland Trail was first opened in October 1997. The one-and-a-quarter-mile trail winds through 29 acres of wooded landscape and features spectacular views of the Hudson River. In June 2003, The Ravine Garden opened (designed by landscape architect, Stephan A. Yarabek, ASLA). The plantings used are predominantly native to the Hudson Valley and include dogwood, shadbush, mountain laurel, and sweetshrub. ','','','','','','','','','Boscobel Restoration Inc, 1601 Route 9D','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10524','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3359429f-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','San Juan Bautista State Historic Park','','','','','','Day Use Area 10:00am to 4:30pm','','http://www.parks.ca.gov/default.asp?page_id=563','','San Juan Bautista,?CA?95045','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33630de4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Brooklyn Botanic Garden','The former ash dump was designated as a botanic garden in 1897. The central feature of the garden is the Plant Family Collection, arranged in botanical sequence (as recommended in J C Loudon\'s Encyclopedia of Gardening). There is also a geometrical garden and a Japanese garden. ','','','','','','','','','1000 Washington Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11225','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3363f68c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Old Furnace State Park','','','','','','sunrise to sunset','','http://www.ct.gov/dep/cwp/view.asp?a=2716&q=435384&depNav_GID=1650','','Old Furnace State Park Ross Road, Killingly, CT 06239','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3370162b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Buffalo Botanical Gardens','Opened in 1900, Buffalo Botanical Gardens is the gateway into the Frederick Law Olmsted-designed South Park, which is on the Emerald Necklace. The fine Victorian conservatory was designed by Lord & Burnham and was part of Olmsted\'s final plan for South Park. It was designed to offer a collection of exotic plants from around the world. The tri-domed glass, wood and steel design was based on Crystal Palace and Kew Gardens Palm House in England. When built (1897-1899), it was the third largest public greenhouse in the United States and ninth largest in the world. Today, The Gardens is one of only three remaining Lord & Burnham conservatories in the United States and the only conservatory in the eastern United States incorporated into a park designed by Olmsted. Indoor gardens include: The Palm Dome, Dinosaur Gardens, Rainforest Garden, Koi fish pond, Desert Garden, Tropical Flower Garden, Bromeliad and Begonia Garden, Orchid Garden, Victorian Garden and The Herb Garden. Outdoors there is a Shrub Garden with hundreds of varieties of rare and unusual plants. ','','','','','','','','','Buffalo and Erie County Botanical Garden, 2655 South Park Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','14218','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3376c12c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Ahukini State Recreation Pier','','','','','','Daily During Daylight Hours','','http://www.hawaiistateparks.org/hawaiistateparks/parks/Kauai/Index.cfm?park_id=1','','End of Ahukini Road (Highway 570) off Kuhio Highway (Highway 56) Lihue, HI 96766','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('337e6503-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cedarmere Garden','A house was built here in 1787. It was bought by William Cullen Bryant (a promoter of Central Park, NY) and extended. He also developed the garden and it has been restored from old photographs. In essence it is a Mixed Style Victorian garden. ','','','','','','','','','225 Bryant Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11576','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33898618-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Central Park','Arguably the world\'s greatest urban park. This was the project which launched Frederick Law Olmsted\'s career and the profession of landscape architecture. It has a conservatory garden in the manner of a European formal garden, with parterres, fountains and herbaceous gardens. ','','','','','','','','','Fifth Avenue at 105th Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10021','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3392ee8b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Windsor State Forest','','','','','','The forest is open from sunrise to sunset year-round.','','http://www.mass.gov/dcr/parks/western/wnds.htm','','1838 River Rd., Windsor, MA 01256','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('339579e2-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Clermont Historic Garden','Seven generations of the Livingstone family lived here. A Georgian house was built 1730-1750, though it was burned during the War of Independence. It has views over the Hudson River to the Catskill Mountains Clermont derives from \'clear mountain\'. The present gardens were made in the 1920s and 1930s, after Alice Livingston\'s European tours. There is an Italian staircase, a walled garden and Arts and Crafts planting. ','','','','','','','','','Clermont State Historic Site, 1 Clermont Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','12526','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33a264a4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Conservatory Garden','There was a glass conservatory on this site from 1898 to 1934, when it was replaced with the present garden - in a blend of Italian, French and English styles. Entrance is through Vanderbilt Gate (from the Vanderbilt Mansion which once stood on Fifth Avenue). The French sector of the garden has statuary by a German sculptor Walter Schott\'s Three Dancing Maidens (1910). There is also a statue of the the characters Mary and Dickon from Frances Hodgson Burnett\'s The Secret Garden. ','','','','','','','','','Fifth Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10029','2011-12-22 14:35:30','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33ad45da-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Bluewater Lake State Park','','','','','','','','http://www.emnrd.state.nm.us/PRD/Bluewater.htm','','P.O. Box 3419， Prewitt, NM 87045','7f7a92b8-ea4c-11e0-8606-00306701b527','ed25625a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33aeceef-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cornell Plantations Garden','The gardens were established in and around the Cornell University campus in 1935. There is a botanical garden, wildflower garden, arboretum and lake. They are well planted and well maintained with a wide range of plant material. There are good illustrations on the website (see link below). ','','','','','','','','','Cornell Plantations, 1 Plantations Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','14850','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33b9fc3c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Donald M Kendall Sculpture Gardens at PepsiCo','A classic corporate headquarters (designed by Edward Durell Stone) with a garden by Russell Page (1981-1985) and a collection of modern sculpture. Kendall was the CEO of Pepsico between 1971 and 1986. He believed that art can stimulate creativity in business. There are 45 sculptures - including works by Henry Moore, Auguste Rodin and Alexander Calder. ','','','','','','','','','Anderson Hill Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10577','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33ba2918-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Malaekahana State Recreation Area','','','','','','April 1 to Labor Day: 7 am to 7:45 pm,After Labor Day to March 31: 7 am to 6:45 pm','','http://www.hawaiistateparks.org/hawaiistateparks/parks/oahu/index.cfm?park_id=26','','Off Kamehameha Highway (Highway 83), Malaekahana Beach Honolulu, HI 96825\r\n','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33c7a167-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Enid A Haupt Glass Garden','The Enid A. Haupt Glass Garden is a theraputic garden that is part of the Rusk Institute for rehabiltation. Originally, garden was simply a peaceful retreat from the hospital until a program of horticultural therapy was introduced in the 1970s. The idea was to combine horticultural therapy with medical therapy. Patients work with trained horticultural therapists. Part of the garden, with a beautiful pool, is in a 1,700 square foot greenhouse. The garden is also open to the public. ','','','','','','','','','Rusk Institute, 400 East 34th Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10016','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33ca941e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Bucktail State Park Natural Area','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/bucktail.aspx','','Westport, PA 17778','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33d515a6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Fort Tryon Park Garden','Fort Tryon Park was designed by Frederick Law Olmsted Jr. There is a large terraced Heather Garden with panoramic views over the Hudson River - Calluna vulgaris was selected as the predominant plant so as not to obstruct the view. ','','','','','','','','','524 Fort Washington Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10013','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33e04b90-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fort Delaware State Park','','','','','','open Saturdays and Sundays, June 4, 5, 11 and 12','','http://www.destateparks.com/park/fort-delaware/index.asp','','45 Clinton St, Delaware City, DE19706','7f7a92b8-ea4c-11e0-8606-00306701b527','ec70a389-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33e0a5d7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Genesee Country Village Gardens','Genesee Country Village & Museum has 13 \'heirloom gardens\' that show what village life in New York State was like in the 19th-century. The garden at Jones Farm (c. 1820, Orleans, NY) is complete with a 19th-century kitchen garden full of original varieties. Hyde House has a ?Picturesque? garden (c. 1870, Friendship, NY) derived from plans for ?romantic landscapes? appearing in A.J. Downing\'s 1842 Cottage Residences. MacArthur House (c. 1831, York, NY) has a vegetable and herb specimen garden and a children\'s garden that allows visitors to discover how children in the early 1800s used gardens as outdoor, hands-on classrooms. Shaker\'s Trustees\' Building (c. 1839, Sonyea, NY) has a medicinal herb garden. Livingston-Backus House (c. 1827, Rochester, NY) has a formal city garden with rectangular beds. The Federal-style garden house is from Cortland, NY (c. 1828). A 19th-century vineyard is under development. ','','','','','','','','','Genesee Country Village and Museum, 1410 Flint Hill Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','14511','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33ed62bd-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','George Eastman House and Gardens','Kodak\'s founder, George Eastman was the son of a nurseryman. His photographs have been used to restore his garden. It has a broadly Arts and Crafts layout but specialises in the bright flowers which Eastman loved.','','','','','','','','','900 East Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','14607','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33f5f7cc-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Levi Jackson Wilderness Road State Park','','','','','','Open year round','','http://parks.ky.gov/findparks/recparks/lj/','','998 Levi Jackson Mill Road, London, KY 40744','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc35954-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33f983b4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Humes Japanese Stroll Garden','The 4 acre garden was made for Ambassador John Humes in 1960 when he returned from Japan. The site is sloping and deeply wooded. It has been managed by The Garden Conservancy since 1993.','','','','','','','','','Dogwood Lane, Mill Neck','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11560','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('33ff69b5-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Jay Cooke State Park','','','','','','','','http://www.dnr.state.mn.us/state_parks/jay_cooke/index.html','','780 Highway 210, Carlton, MN 55718','7f7a92b8-ea4c-11e0-8606-00306701b527','ecf0dc60-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3405a934-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Innisfree Garden, New York','Innisfree garden was made by Walter and Marion Beck and conceived as a Chinese garden. It was taken over, in 1960, by the Chair of the Landscape Architecture programme at Harvard, Lester Collins, and opened to the public. Walter Beck described his work as a \'cup garden\', with the \'cup\' drawing attention to something rare or beautiful. A 40 acre glacial lake occupies the center of the cup - and the Innisfree garden estate. ','','','','','','','','','362 Tyrrel Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','12545','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3408d35c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Indian Cave State Park','','','','','','','','http://outdoornebraska.ne.gov/parks/guides/parksearch/showpark.asp?Area_No=91','','65296 720 Rd, Shubert, NE 68473','7f7a92b8-ea4c-11e0-8606-00306701b527','ed0bdbcc-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34126320-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kykuit Garden','The Kykuit garden was begun by the oil billionnaire John D. Rockefeller and served as a Rockefeller family summer retreat from 1913 to 1991. Kykuit (pronounced \'cake-8\') means \'lookout\' in Dutch and it has fine views over the magnificent scenery of the Hudson Valley. Rockefeller commissioned Olmsted Brothers for the design but was not happy with their work and began laying out walks and doing his own planting. He then asked the landscape architect William Welles Bosworth designed formal gardens near the house. Today, the garden is a fine American example of the Mixed Style. There are terraces, a semicircular rose garden, fountains, the Temple of Aphrodite and a notable collection of modern sculpture (including works by Henry Moore and Pable Picasso). There is a Morning Garden, a Grand Staircase, a Japanese Garden, an Italian Garden, a Temple of Aphrodite, an Italian loggia, and a semicircular rose garden. ','','','','','','','','','Kykuit, The Rockefeller Estate, Pocantico Hills','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10591','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3412ca0a-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Walter Umphrey State Park ','','','','','','','','http://www.tpwd.state.tx.us/spdest/findadest/parks/walter_umphrey/','','Port Arthur, TX 77640','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34214106-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','LaGuardia Corner Gardens','LaGuardia Corner Gardens is a community garden created by volunteers in 1981. It is situated between LaGuardia Gardens and Time Landscape, forming a \'ribbon of green\' along LaGuardia Place. The garden features flowers, shrubs, and fruit trees. ','','','','','','','','','511 LaGuardia Place, Greenwich Village','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10012','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34239716-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Richard B. Russell State Park','','','','','','7 am- 10 pm','','http://gastateparks.org/RichardBRussell','','2650 Russell State Park Rd, Elberton, GA 30635','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('342edd0f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Liz Christy Garden','New York City\'s First Community Garden was founded in 1973. It is located on the northeast corner of Bowery and Houston Streets in Manhattan. Liz Christy and a group of friends were planting vacant lots with \'seed bombs\' and gained permission for planting on this land. It became a forerunner of the urban community garden movement, much admired by landscape architects and urban designers. ','','','','','','','','','110 East Houston','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10001','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('343230de-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Ninilchik State Recreation Area','','','','','','','','http://dnr.alaska.gov/parks/aspunits/kenai/ninilsragen.htm','','135 Sterling Highway, Homer, AK 99603','7f7a92b8-ea4c-11e0-8606-00306701b527','ec4dd047-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('343b7727-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Locust Grove Garden','Locust Grove belonged to Samuel F.B. Morse, the 19th century artist and inventor of the Morse Code. Morse was Professor of the Literature of the Arts and Design at New York University and founder of the university\'s Graduate School of Art History and a Trustee of the Metropolitan Museum of Art. Locust Grove was designed by Morse with help from Andrew Jackson\'s friend, Alexander Jackson Davies. It is a romantic and picturesque landscape design with flower gardens, a small lake, coves, and wooded areas. ','','','','','','','','','Samuel F.B. Morse Historic Site, 2683 South Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','12601','2011-12-22 14:35:31','a1c3e20e-f181-11e0-8a53-00306701b527',1),('343dbec3-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Guadalupe River State Park','','','','','','Open: 7 days/week year-round, except for Public Hunts. Busy Season: March through November. ','','http://www.tpwd.state.tx.us/spdest/findadest/parks/guadalupe_river/','','3350 Park Rd 31, Spring Branch, TX 78070','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3445fb60-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','LongHouse Reserve and Sculpture Garden','LongHouse Reserve, founded by the textile artist Jack Lenor Larsen, aims \'to exemplify living with art in all forms\'. It has a gallery, an arboretum, and garden. Craft work and sculpture are spread through the landscape to show how \'art and nature\' can be re-united. There is a Red Garden, Amphitheater, Conservatory, Hornbeam Allée and Reflecting Pool. ','','','','','','','','',' LongHouse Reserve, 133 Hands Creek Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11937','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('344d57aa-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Tabb Monument','','','','','','','','http://www.dcr.virginia.gov/state_parks/tab.shtml','','Yorktown, VA 23693','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3450d1c1-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lyndhurst Garden','A grand Hudson River Estate with a Gothic Revival mansion, designed by Alexander Jackson Davis in 1838. It is the type of place Jackson\'s friend, and America\'s pioneer landscape architect, Andrew Jackson Downing, wrote about in his chapter on \'Landscape or rural architecture\' (in his Treatise on the theory and practice of landscape gardening, adapted to North America,1841). Behind Davis and Downing looms the presence of John Claudius Loudon, author of Encyclopedias on Gardening and Architecture. Lyndhurst was bought by a railway magnate Jay Gould in 1880. The garden has sweeping lawns, shrubs, specimen trees, a curving entrance drive, steel-framed conservatory, fernery and a circular rose garden with central gazebo. ','','','','','','','','','Lyndhurst, 635 South Broadway','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10591','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('345d437b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Madoo Conservancy Garden','The garden (2 acres) was designed by artist, Robert Dash. He began developping the garden in 1967 and it has been open to the public since 1993. It has sculpture, free planting and dramatic use of coloured paints including primrose woodwork and a purple gazebo. It is a successful and unusual design. \'Madoo\' derives from an old Scottish word meaning \'my dove\'.','','','','','','','','','The Madoo Conservancy, Box 362','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11962','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34697add-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mohonk Mountain House Gardens','A gigantic mountain resort hotel, integrated with cliffs and forests and overlooking a lake. Mohonk was conceived by Alfred H. Smiley in 1869 when he came to the Shawangunk Mountains for a picnic. He and his brother planned a peaceful retreat where people could enjoy the beauty of nature in a spectacular setting. Garden design was close to Smiley\'s heart and the gardens at Mohonk have won many awards. One can see French and Italian influences, but primary conception is picturesque and the romantic combination of towers and scenery is essentially German. There is an annual Garden Holiday held at Mohonk at the end of the summer when the gardens are at their best. The program includes guided walks, talks and workshops. ','','','','','','','','','Mohonk Mountain House, 1000 Mountain Rest Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','12561','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('346b8b95-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Starved Rock State Park','','','','','','','','http://dnr.state.il.us/lands/Landmgt/PARKS/i&m/east/starve/park.htm','','P.O. Box 509, Utica, IL 61373','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34744f6c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Montgomery Place Garden','Montgomery Place was designed by Alexander Jackson Davis (under the influence of his friend Andrew Jackson Downing). It has views of the Hudson River and the Catskill Mountains. The estate belonged to Janet Livingston Montgomery, widow of General Richard Montgomery and she commissioned a Federal-style house in 1804. The estate includes gardens, woodland, orchards an arboretum and waterfalls. Historic Hudson Valley restored the house and grounds and opened the estate to the public in 1988. ','','','','','','','','','Montgomery Place, PO Box 32','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','12507','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3480420e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Nassau County Sculpture Garden','The 145 acre site, once owned by William Cullen Bryant, with a cottage designed by Calvert Vaux, became the site of a Georgian manor house. It was bought by Childs Frick (son of the steel magnate) and his wife Frances asked Marian Cruger Coffin to design a garden with hedges, roses and a central pool. This became a county Art Museum with an outdoor sculpture collection. There are over 50 sculptures including works by Lichtenstein, Otterness, Calder, Botero, Rodin and Nagare. ','','','','','','','','','Nassau County Museum of Art, 1 Museum Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11567','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3480e385-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Traverse City State Park','','','','','','','','http://www.michigandnr.com/parksandtrails/Details.aspx?id=501&type=SPRK','','1132 US-31 N., Traverse City, MI 49686','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34898e9a-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Confederate Memorial State Historic Site','','','','','','Sunrise to sunset, daily ','','http://mostateparks.com/park/confederate-memorial-state-historic-site','','211 West First Street, Higginsville, MO 64037','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('348b1b7d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','New York Botanical Garden','Inspired by Kew Gardens in London, the NYBG is both a public pleasure garden and a research institution. The large Victorian conservatory, by Lord and Burnaham, has been restored. A herb garden designed by Penelope Hobhouse was a modern addition. The central area is woodland and there are varied plant collections in peripheral zones. ','','','','','','','','','200th Street and Kazimiroff Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10458','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34932462-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Pershing State Park','','','','','','','','http://mostateparks.com/park/pershing-state-park','','29277 Hwy. 130, Laclede, MO 64651','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34985305-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Old Westbury Gardens','A 1904 house, in the the style of Charles II, with a garden made at the same time.The owner\'s wife, and his architect, were English. The garden is well proportioned and well detailed, inspired by an eclectic range of features from English gardens together with some from France and Holland. Grounds include sweeping lawns, wooded trails, grand allées and wooded trails with over 100 varieties of trees, meadows, lakes, fountains and statuary, and a charming thatched cottage. Gardens include a primrose path, rose garden, lilac path, boxwood garden, demonstration gardens, cottage garden, and a 2 ? acre walled garden set into the woods. ','','','','','','','','','71 Old Westbury Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11568','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('349a7a9d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Brimley State Park','','','','','','','','http://www.michigandnr.com/parksandtrails/Details.aspx?id=414&type=SPRK','','9200 W. 6 Mile Road, Brimley, MI 49715','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34a48281-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Eufaula State Park','','','','','','','','http://www.travelok.com/listings/view.profile/id.4336','','Hwy 69 & Hwy 150, Checotah, OK 74426','7f7a92b8-ea4c-11e0-8606-00306701b527','ed4ca61c-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34a529e7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Paley Park','One of the most admired urban \'pocket parks\' in the world. An outdoor room of 15.2m by 30.4m, it has a waterfall-wall, trees, chairs and paving. \'Few human-made places provoke such unequivocal praise. It has become one of Manhattan\'s treasures, a masterpiece of urbanity and grace.. memorable because it makes no effort to be so\' (Alan Tate) ','','','','','','','','','Paley Park, 5 East 53rd Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10022','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34ae0873-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Hartwell State Recreation Area','','','','','','During Standard Time: Su-Th 7am-6pm; F-Sa 7am-8pm. During Daylight Saving Time: Su-Th 6am-8pm; F-Sa 6am-9pm. ','','http://www.southcarolinaparks.com/park-finder/state-park/927.aspx','','19138-A HWY 11 S, Fair Play, SC 29643','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34b43ffe-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Planting Fields Arboretum','Coe Hall was built 1918-1921 with Walker & Gillette as the architects and Olmsted Brothers as the landscape architects. It has woods, lawns, an arboretum, a large camellia house and an Italian Garden. The house is in a \'Tudor Revival\' style and the garden in an \'Italian Revival\' style with Arts and Crafts Planting. The Italian Garden was made in 1916 and re-opened after a restoration project in 2010. The blue tiles are not characteristic of gardens in Italy but would be appropriate for swimming. The name \'Planting Fields\' comes from the Matinecock Indians who formerly cultivated the fertile soil above Long Island Sound.','','','','','','','','','1395 Planting Fields Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11771','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34b6d6c4-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lowell Lake State Park','','','','','Year Round','10:00 AM - 9:00 PM or Official Sunset','','http://www.vtstateparks.com/htm/lowell.htm','','260 Ice House Road, Londonerry, VT 05148','7f7a92b8-ea4c-11e0-8606-00306701b527','ed9984a2-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34bf4ec1-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Kenneth Hahn State Recreation Area','','','','','','Open Daily 6:00am to Sunset ','','http://www.parks.ca.gov/?page_id=612','','Los Angeles,?CA?90056','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34c20491-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Queens Botanical Garden','The botanic garden was established on the former World Fair site in Flushing. Since 2001, there has been a massive focus on sustainability. The new visitor centre was opened in 2007, which received platinum certification from the U.S. Green Building Council. The most recent project is to develop the parking lot into a parking garden. The Victorian Wedding Garden is an interesting and popular feature. ','','','','','','','','','43-50 Main Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','11355','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34c81db8-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Manuka State Wayside','','','','','','Daily During Daylight Hours','','http://www.hawaiistateparks.org/hawaiistateparks/parks/hawaii/index.cfm?park_id=53','','On Mamalahoa Highway (Highway 11), Ocean View, HI 96737','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34cee421-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Sonnenberg Gardens','A nineteenth century house (1887) with a Mixed Style Victorian garden. There is a fine display of carpet bedding, a large conservatory, a Japanese garden, a Rose Garden, an Italian Garden, a Colonial Garden, a Rock Garden and a Moonlight Garden. ','','','','','','','','','Sonnenberg Mansion and Gardens, 151 Charlotte Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','14424','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34d316c9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Iron Horse State Park','','','','','','Summer: 6:30 a.m. to 9 p.m. Winter: 8 a.m. to 5 p.m. The park is open year round for day use.','','http://www.parks.wa.gov/parks/?selectedpark=Iron%20Horse','','North Bend, WA 98045','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34dadf5f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Springside Landscape Garden','Springside Garden is the best surviving example of the work of Andrew Jackson Downing, and typifies the projects he wrote about in his chapter on \'Landscape or rural architecture\' (in the Treatise on the theory and practice of landscape gardening, adapted to North America,1841). Downing was a great admirer of the Scots author John Claudius Loudon and it was through Downing that the ideas in J C Loudon\'s Encyclopedia of Gardening and Encyclopedia of Architecture were transmitted to North America. Springside Gardens were commissioned by Matthew Vassar, a brewer and founder of Vassar College, and Andrew Jackson Downing, was the architect and landscape architect for the project.Springside is much changed but remains the best example of Downing\'s work and is being restored.Springside was conceived as a ferme ornee (\'ornamental farm\') in the Hudson River Valley. ','','','','','','','','','Springside National Historic Site, 185 Academy Street, Poughkeepsie','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','12601','2011-12-22 14:35:32','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34db5010-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Caspar Headlands State Beach','','','','','','Sunrise to Sunset','','http://www.parks.ca.gov/default.asp?page_id=445','','Caspar,?CA?95420','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34e7b84c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Staten Island Botanical Garden','A comparatively modern botanical garden, with a Chinese Scholar\'s Garden added in 1999. It was designed by the landscape architect Gong wu Zou and made by Chinese craftsmen. ','','','','','','','','','1000 Richmond Terrace','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10301','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('34f3181a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Stonecrop Gardens','Stonecrop Gardens has a windswept location in the Hudson Highlands surrounded by woodland with 12 acres of gardens. It was originally the home of Anne and Frank Cabot. Frank Cabot is also the founder of The Garden Conservancy. There are woodland and water gardens, a grass garden, alpine beds, a cliff garden, perennial beds, a conservatory and an enclosed flower garden. Stonecrop has been open to the public since 1992. ','','','','','','','','','81 Stonecrop Lane','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10516','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3501444c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Cloisters Gardens','The Cloisters Museum and Gardens, a branch of The Metropolitan Museum of Art, is devoted to the art and architecture of medieval Europe. It incorporates architectural elements from both domestic and religious structures dating from the 12th to 15th century and includes four cloisters, three of which contain gardens. The cloister garth has been planted with medieval plants, which would not have been the case in a medieval monastry (they would have been grown within the monastery grounds but not in the cloister). Cuxa Cloister, the main ornamental garden, is divided into quadrants by crossed paths. Designed as a monastic garth garden, with a fountain at its center, it includes modern cultivars as well as medieval species. The Bonnefont Cloister garden is home to many species of herbs known in the Middle Ages. They are grown in raised beds according to use in medicine, magic, cooking, and arts and crafts. The Trie Cloister, in which the Museum\'s café is situated, also contains a garden with a central fountain and a display of plants native to the fields, woodlands, and streambanks of medieval Europe. The fourth, St. Guilhem Cloister, is the setting for a display of acanthus and other medieval species in pots. In the winter, potted plants, many of them fragrant, remain on display in several cloisters. The Museum is decorated with evergreens, herbs, and fruits from early December until mid-January. ','','','','','','','','','99 Margaret Corbin Drive, The Metropolitan Museum of Art, Fort Tryon Park','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10040','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('350dc8ba-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Frick Collections Gardens','The Frick Collection is a house museum that includes an indoor Garden Court and two outdoor gardens. The Fifth Avenue garden has existed since the building was built in 1913-14. John Russell Pope made additions to the original mansion, including enclosing the courtyard, when the house transitioned into a museum. In 1977 when the museum expanded, Russell Page designed the Seventieth Street Garden. There is no public access to the two outdoor gardens but they can be seen and enjoyed from the sidewalk or inside the building. ','','','','','','','','','1 East 70th Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10021','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('351c38a5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Vanderbilt Mansion National Historic Garden','The Vanderbilt Estate in Hyde Park is an early nineteenth century Picturesque estate redesigned in an Italian manner when it was bought by the Vanderbilts and a good example of a rich man\'s estate. The original garden was designed in the early 1800s by the Belgian garden architect Andre Parmentier, when the estate belonged to Dr. David Hosack. Frederick Vanderbilt bought the estate in 1895 and added the rose garden, pools and statuary and greenhouses. The Italian Gardens are in three parts: the annual garden, the perennial garden, and the rose garden. The cherry tree walk and the pool garden were restored in 1986. The mansion was designed by McKim, Mead and White. It has views of the Hudson River and Catskill Mountains.','','','','','','','','','4097 Albany Post Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','12538','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35207368-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Mandalay State Beach','','','','','','','','http://portal.countyofventura.org/portal/page/portal/GSA/parks_department_-_Directory/Beach_Front_Parks/Mandalay_Beach','','Harbor Blvd, Oxnard, CA','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3528d91d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Wave Hill Garden','A Hudson River estate which, after being given to the public in 1965, has developed a fine garden. There are views of the river, a large conservatory and a well-planted flower garden established on Arts and Crafts lines. ','','','','','','','','','Independence Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','10471','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35291bbe-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Prairie State Park','','','','','','Sunrise to sunset, year-round.','','http://mostateparks.com/park/prairie-state-park','','128 NW 150th Lane, Mindenmines, MO 64769','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35354af3-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Wethersfield Garden','A mid-twentieth century garden design in the neoclassical style, designed by landscape architect Evelyn Poehler, to house the owner\'s sculpture collection. ','','','','','','','','','PO Box 440','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','12501','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35409cf6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Arlie Gardens','Airlie House was the home of the Pembroke Jones family. The gardens were started in the 1890s and from 1906-1937 the German gardener Rudolph A Topel (who had some connection with Kaiser Wilhelm) worked on the estate. With Sarah Jones he made a naturalistic landscape camellias and azaleas. ','','','','','','','','','300 Airlie Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','28403','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('354e995e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Asheville Gardens','The gardens are in the Southern Appalachian Mountains, a diverse temperate ecosystems, and aims to conserve the native plant species and habitats. ','','','','','','','','','The Botanical Gardens at Asheville, 151 W.T. Weaver Boulevard','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','28804','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('355bb1bd-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Biltmore Gardens','The garden was designed by Frederick Law Olmsted. He worked with an architect, Hunt, who had studied at the Ecole des Beaux Arts and worked in a French idiom. Their client was George Washington Vanderbilt. The Esplanade in front of the house is a rectangular court with double rows of trees. North of the Esplanade is a rectangular Italian garden and further to the north is a Walled Garden, a Rose Garden and a 200 acre Azalea Garden. The formal elements are set in a picturesque park, making Biltmore a classic example of the Repton-influenced Mixed Style. Olmsted was also interested in the layout of the vast wooded estate (125,000 acres) in which the garden is set. Biltmore is the grandest estate ever built in America. You can see much of the layout of the garden if you zoom in on the map below (the marker is positioned in the Italian Garden).','','','','','','','','','1 Approach Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','28803','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35669029-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Daniel Stowe Garden','The garden was funded by textile magnate Daniel Stowe. It has an Allee Garden, a Scroll Garden, A Ribbon Garden, a Cottage Garden and a Canal Garden. As these names suggest, its style is traditional - not contemporary with the design ideas of the period in which it was made. The layout of the garden is visible on the satellite image if you zoom in on the location map below. The Orchid Conservatory opened in 2008.','','','','','','','','','Daniel Stowe Botanical Garden, 6500 South New Hope Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','28012','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('356c99cb-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Roaring River State Park','','','','','','Sunrise to 10 p.m., year-round','','http://mostateparks.com/park/roaring-river-state-park','','12716 Farm Road 2239, Cassville, MO 65625','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('357234a7-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Elizabethan Gardens','A mid-twentieth century re-creation of an Elizabethan garden in the Renaissance Style. The Gardens were designed to evoke the Elizabethan heritage of Roanoke Island and North Carolina - a memorial to Sir Walter Raleigh\'s lost colony of 1587 was on this site.The Elizabethan gardens were promoted by the Garden Club of North Carolina in the 1950s. The dedication plaque explains that \'Down the centuries English women have built gardens to the glory of God, the beauty of countryside and the comfort of their souls\'. The main garden features are a 16th-century orangery, a courtyard with an Italian fountain and parterres, a terrace, a mount, a Shakespearean Herb Garden, the Queen\'s Rose Garden, a Wildlife Garden and a Sunken Garden. Later, the garden received a gift of Italian statues, balustrades and fountains. They are authentic Renaissance artefacts but their character is not English. ','','','','','','','','','1411 National Park Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','27954','2011-12-22 14:35:33','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3579745d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Sequoyah/Western Hills State Park','','','','','','Curfew hours are from 11pm to 6am.','','http://www.travelok.com/listings/view.profile/id.13299','','17131 Park 10, Hulbert, OK 74441','7f7a92b8-ea4c-11e0-8606-00306701b527','ed4ca61c-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('357d5a42-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','JC Raulston Arboretum at NC State University','The JC Raulston Arboretum was established by the professor of horticulture after whom it is named. It has a collection of woody plants and a display garden inspired by Sissinghurst Castle Garden in England. There is also a Persian Paradise Garden and a Japanese Garden. The garden focuses on plants especially adapted to Piedmont North Carolina conditions. ','','','','','','','','','North Carolina State University, 4415 Beryl Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','27606','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35835e5b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Cumberland Mountain State Park','','','','','','Park is open from 7a.m. - 10p.m. year round','','http://tn.gov/environment/parks/CumberlandMtn/index.shtml','','24 Office Dr., Crossville, TN 38555','7f7a92b8-ea4c-11e0-8606-00306701b527','ed86a3e9-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3588a92d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','North Carolina Botanical Garden','The University of North Carolina established the Coker Arboretum in 1903 and the Botanical Garden in 1961. It is a Center for Plant Conservation holding part of the National Collection of Endangered Species. There are collections of native plants, carnivorous plants and ferns. ','','','','','','','','','The University of North Carolina at Chapel Hill, CB 3375 Totten Center','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','27599','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('359715d8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Sarah P Duke Gardens','A university garden with a series of terraces linked by a flight of steps as its central feature. The terraces lead into display gardens with noted collections of iris, azalea and bulbs. An Asiatic Arboretum was begun in 1989. There is also a garden of plants native to the Southeast - the H. L. Blomquist Garden of Native Plants. ','','','','','','','','','426 Anderson Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','27708','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('359e7ade-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Elkhorn State Park','','','','','','','','http://www.visitmt.com/categories/moreinfo.asp?SiteID=1&IDRRecordID=3954','','PO Box 200701，Helena, MT 59601','7f7a92b8-ea4c-11e0-8606-00306701b527','ed049c7e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35a4e722-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The North Carolina Arboretum','The Arboretum fosters research, conservation, and garden demonstration with respect to landscape, architecture, and plant sciences. It has a beautiful natural settings admist mountain peaks and with the Bent Creek stream running through the Arboretum. Within its 434 acres the Arboretum offers more than 65 acres of cultivated gardens, and 10 miles of forested hiking and biking trails. Facilities include a state-of-the-art production greenhouse, an operations center with \'green roof,\' an Education Center and the new Baker Exhibition Center. The Blue Ridge Quilt Garden is a popular feature - a Victorian bedding pattern inspired by the Appalachian tradition of quilt making. The Plants of Promise Garden demonstrates landscape plants suitable for the region. The Heritage Garden of plants used in the traditional medicinal herb and craft industries of the region has architectural elements reminiscent of old homestead sties. Other gardens at the Arboretum include the Bonsai Exhibition Garden, Holly Garden, Stream Garden, Plant Professionals Landscape Garden; Sustainable Landscape Demonstration Areas, container gardens and perennial beds, and the National Native Azalea Repository. Opening in 2008, the Canopy Walk, will showcase the Arboretum\'s tree collection with special emphasis on autumn foliage. ','','','','','','','','','100 Frederick Law Olmsted Way','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','28806','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35a714a9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Pillsbury State Park','','','','','','Pillsbury State Park opens full-time for the season on May 27, 2011 and closes October 23, 2011. Operating hours are Monday through Friday from 9:00 am to sunset, Saturday and Sunday from 8:30 am to sunset. ','','http://www.nhstateparks.org/explore/state-parks/pillsbury-state-park.aspx','','Off Route 31 Washington, NH 03280','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35af0f74-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fort Abraham Lincoln State Park','','','','','','','','http://www.ndparks.com/north-dakota-state-parks/fort-abraham-lincoln-state-park.php','','4480 Fort Lincoln Road, Mandan, ND 58554','7f7a92b8-ea4c-11e0-8606-00306701b527','ed396b66-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35b1bfeb-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Tryon Palace Gardens','A georgian house, the former residence of the state\'s Royal Governor. The garden has been restored to the Colonial English taste of the 1770s. The design makes use of serpentine lines, as in the Serpentine Style. But the way they are used, in a parterre, is not found in England. ','','','','','','','','','610 Pollock Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','28563','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35b78a65-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Dexter State Recreation Site','','','','','','','','http://www.oregonstateparks.org/park_244.php','','Dexter, OR 97431','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35bdf70d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Wing Haven Gardens','Elizabeth Barnhill had advanced plans for a house garden before her marriage to Eddie Clarkson and they were implemented at Wing Haven. The garden style is Arts and Crafts with hedges, pergolas, roses and woodland. ','','','','','','','','','Wing Haven Gardens and Bird Sanctuary, 248 Ridgewood Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','28209','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35bff2ea-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Willow Creek State Recreation Area','','','','','','','','http://dnr.alaska.gov/parks/aspunits/matsu/willowcksra.htm','','Willow, AK 99688','7f7a92b8-ea4c-11e0-8606-00306701b527','ec4dd047-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35c93c4a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','International Peace Garden','Standing on the US/Canadian border, the Peace Garden was established in 1932 (by Dr Henry Moore) and dedicated to good relations between the two countries. Visitors must pass through international customs (with identification) to leave the garden. It concentrates on displays, particularly of native plants, and has bright displays of bedding plants (including a floral clock made up of 2,500-3,000 flowers, run by GPS and monitored 4 times per day). The only two floral designs which remain the same each year are the Canadian and American Flag Displays. ','','','','','','','','','1 Dunseith','7f7a92b8-ea4c-11e0-8606-00306701b527','ed396b66-f48c-11e0-b192-00306701b527','','58329','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35d4a052-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cleveland Botanical Garden','The Garden began with the gift of a collection of garden books from Mrs. Andrew Squire in 1930. The library moved to the University Circle and, from 1966 onwards a series of gardens was made around the building. They include a Japanese Garden, a Rose Garden and a Wildflower Garden. ','','','','','','','','','Cleveland Botanical Garden in University Circle, 11030 East Boulevard','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','44106','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35e47521-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Dawes Arboretum Garden','Beman and Bertie Gates Dawes bought the land in 1917 and began to transform their farm into what is now Dawes Arboretum. It has various collections, including a Japanese Garden designed by Makoto Nakamura in 1963, and a beautiful Cypress Swamp with a boardwalk. ','','','','','','','','','7770 Jacksontown Rd SE','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','43056','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35f119dd-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Fellows Riverside Gardens','The garden, made in 1958, forms part of Mill Creek Metropolitan Park, which dates from 1891. It has a terrace, a pavilion and collections of rose, iris, day-lilys and heaths. ','','','','','','','','','Mill Creek Park, 123 McKinley Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','44509','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('35fde657-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Franklin Park Conservatory','The first county fair was held in Franklin Park in 1852. The Franklin Park Victorian Conservatory was modeled after the Glass Palace at the Columbian Exposition in Chicago (1893). It contains 73,000 square feet of greenhouses and classrooms situated in a 90-acre urban park. The conservatory is now ringed with display gardens, including a Japanese Garden and a Victory Garden, celebrating the end of World War II and the defeat of Japan. The Conservatory is the only botanical garden in the world to own a signature collection from the internationally acclaimed artist, Dale Chihuly. ','','','','','','','','','1777 East Broad Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','43203','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('360aa729-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Holden Arboretum Garden','The benefactor was Albert Fairchild Holden, a mining engineer, and the first tree was planted in 1931. There is now a Display Garden, a Crabapple Collection, a Hedge Garden, a Butterfly Garden, a Rhododendron Garden, Conifer and Magnolia Collections. ','','','','','','','','','The Holden Arboretum, 9500 Sperry Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','44094','2011-12-22 14:35:34','a1c3e20e-f181-11e0-8a53-00306701b527',1),('361862a9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kingwood Center Gardens','A French Provincial house with a garden which is now run as a centre for horticultural education. The plan is influenced by the Arts and Crafts style but the planting and construction detailing create an American character. ','','','','','','','','','900 Park Avenue West','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','44906','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36238fc6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Stan Hywet Hall and Gardens','A Tudor Revival house and garden, started in 1915. There is an English walled garden, a rose garden, a Japanese garden, and an elegant 550\' birch walk. The first owner, a co-founder of Goodyear Tyres, used the old English words for a quarry (stan hywet) because that is what the garden was made from. ','','','','','','','','','714 North Portage Path','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','44303','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36290045-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Huntington State Beach','','','','','','6am to 10pm Monday thru Sunday. Gates close at 9pm','','http://parks.ca.gov/default.asp?page_id=643','','Huntington Beach,?CA?92645','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('363048cc-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Perennial Plant Peddler','A nursery garden with a focus on hostas and daylilies.','','','','','','','','',' 8755 Township Road 251','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','48540','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('363a8eef-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Wegerzyn Gardens','The Wegerzyn Gardens comprise Rose, Federal, English and Victorian gardens. They are bordered by the Stillwater River and a forest of sycamore, oak, red and silver maple, hickory and ash. ','','','','','','','','','Wegerzyn Gardens and Horticultural Center, 1301 E. Siebenthaler Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','45414','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('364702b1-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cowboy Gardens','The Cowboy Museum has several garden areas: the Norma Sutherland Garden, the Children\'s Cowboy Corral, the Atherton Garden and the Western States Plaza, and the Hambrick Garden. Outdoor sculptures (eg Welcome Sundown and Coming through the Rye) are spread through the site. ','','','','','','','','','Cowboy Hall of Fame, National Cowboy & Western Heritage Museum, 1700 NE 63rd Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed4ca61c-f48c-11e0-b192-00306701b527','','73111','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3653a82a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Myriad Botanical Gardens','In 1964, I.M. Pei was commissioned by city leaders to create a revitalization plan for downtown Oklahoma City. The area that is now the Myriad Botanical Gardens was originally designed by I.M. Pei to model Tivoli Gardens in Copenhagen. Myriad Gardens feature a 224 foot conservatory (The Crystal Bridge Tropical Conservatory) and built with translucent acrylic panels. It bridges a natural lake and has a 35 foot waterfall, a Rain Forest, a Dry Tropics zone, a Californian Zone, a birdhouse, a reptile house, a fishpond and a sandy beach. A path leads to the top of a mountain, past the source of the waterfall and to a tropical skywalk. The rock formations were made by taking latex molds from real rocks. The internal atmosphere is sometimes hot-dry and sometimes misty-wet. The Crystal Bridge also has a collection of 2000 orchirds, including Dendrobium, Phalaenopsis, Cattleya, Oncidium, Vanda and Paphiopedilum. The outside garden is square in plan but has rolling hills. ','','','','','','','','','Myriad Gardens Foundation, 100 Myriad Gardens','7f7a92b8-ea4c-11e0-8606-00306701b527','ed4ca61c-f48c-11e0-b192-00306701b527','','73102','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('365f1246-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Oklahoma Botanical Gardens','An arboretum of native trees and habitats with some theme gardens: a Studio Garden (used for a TV show) and Junk Garden, Centennial Grove, Water Garden, Rock Garden, Minature Railroad Garden, Wildscape Garden and Japanese Tea Garden. ','','','','','','','','','Oklahoma State University Botanical Gardens & Arboretum, 3425 W. Virginia','7f7a92b8-ea4c-11e0-8606-00306701b527','ed4ca61c-f48c-11e0-b192-00306701b527','','74078','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('366a5a97-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Philbrook Gardens','Once known as the Villa Philbrook, the garden was designed in admiration of the Villa Lante in Italy. It was built by Waite Phillips, an oil magnate who came to Tulsa in 1918 and made a fortune. Landscape architect S. Herbert Hare was the designer. He made a terraced garden inspired by the Villa Lante, with box parterres and a central rill, aspiring to the Mannerist Style of garden layout. The walled garden leads on to a naturalistic area with a waterfall, rock garden and rustic garden pool. An avenue of conifers leads to a small loggia. There are two reflecting pools, one of them a swimming pool, with a small temple used as a dressing rooms for the bathers. The estate was given to the city in 1939 and now has the Westby Sculpture Walk, used as an outdoor sculpture garden. ','','','','','','','','','Philbrook Museum of Art, 2727 S Rockford Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed4ca61c-f48c-11e0-b192-00306701b527','','74114','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('367fc8a5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Berry Botanic Garden','Berry Botanic Garden was established by Rae Selling Berry in 1938 and the original design was by Seattle landscape architect John Grant. Rae Berry was known for her work with primroses and her interests in rhododendrons, alpines and native plants. Plants from the Pacific Northwest and around the world are on display. ','','','','','','','','','11505 SW Summerville Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97219','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3690beb1-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Bush\'s Pasture Park, Rose Garden','A fairly dull park (the former estate of Ashahel Bush) with a well managed rose garden specializing in old roses. ','','','','','','','','','Salem Art Association, Bush Barn, 600 Mission Street, SE','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97302','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36a30c8b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Crystal Springs Rhododendron Garden','The oldest part of the garden (The Island) was designed by Ruth Hansen, a landscape architect and a member of the Portland Chapter of the American Rhododendron Society. A later section of the garden (The Peninsula) was designed by Wallace K. Huntington (a Portland landscape architect) in 1977. The garden now has over 2,500 rhododendrons and azaleas. They are at their best in spring and early summer. ','','','','','','','','','SE 28th Ave & Woodstock Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97204','2011-12-22 14:35:35','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36b2fe19-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Elk Rock Garden','Peter Kerr gave his estate to the Diocese of Oregon in 1959 and it became The Elk Rock Gardens of the Bishop\'s Close. Ker was born in Scotland in 1862 and \'close\' is a old word for a an enclosed place (eg a street or yard). The original garden design was by the Olmsted Brothers. The local climate enables the planting to be not unlike that on the west coast of Scotland. ','','','','','','','','','Elk Rock Gardens of the Bishop\'s Close, 11800 SW Military Lane','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97219','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36bdd407-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Historic Deepwood Estate Garden','English style gardens designed in 1929 by Elizabeth Lord & Edith Schryver (the Northwest\'s first female landscape architecture firm), the Deepwood Gardens remain their only residential garden open to the public. The 1929 founding of the firm is considered one of the milestones in the history of Northwest Garden Design. The team is known for planning for the succession of bloom, organizing outdoor rooms as charming extensions of the house. ','','','','','','','','','Historic Deepwood Estate, City of Salem Park & Living Museum, 1116 Mission Street SE','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97302','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36c90438-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hoyt Arboretum Garden','Hoyt Arboretum has more than 1,100 species from around the world and 12 miles of trails from which to view them. Planting at Hoyt Arboretum began in 1931 according to a design by Scottish born horticulturalist John W. Duncan. Trees are arranged in family groups. There is a Vietnam Veterans Memorial on the south slope of the arboretum (visible on the satellite image if you zoom in on the map below).','','','','','','','','','Hoyt Arboretum, 4000 SW Fairview Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97221','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36d41d73-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ira Keller Fountain','A fountain garden in a Portland plaza, designed as an \'experiential equivalent\' of the cataracts in the Cascades Mountains, also in Oregon. The designers provided vertical falls and the \'white noise\' of falling water to seclude the garden from the city and its traffic. Angela Danadjieva created the design by carving a block of clay. In art-historical terms it is an abstract representation of a waterfall, ideologically close to a cubist painting. The fountain was named after a philanthropist, Ira Keller, who aided the project. ','','','','','','','','','SW Market Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97204','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36df134e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Japanese Garden in Washington Park','The Japanese Garden was designed in 1963 by Professor Takuma Tono (head of Landscape Architecture at Tokyo Agricultural University) and opened in 1967. Use is made of \'borrowed scenery\' the view across Portland to the Cascade Mountains and Mount Hood. There is a Strolling Pond Garden, a Natural Garden, a Sand and Stone Garden, a Flat Garden and a Tea Garden. ','','','','','','','','','Japanese Garden Society of Oregon, 611 Southwest Kingston Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97205','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36ebdf08-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Jenkins Estate Garden','The garden was made by the daughter of a shipping magnate (Belle Ainsworth Jenkins) and her husband. Once, it was tended by 23 gardeners. It was bought by the Tualatin Hills Park and Recreation District in 1976 and is now maintained with the help of volunteers. The planting design is gardenesque (in the sense of exotic plants in naturalistic groupings). ','','','','','','','','','Jenkins Estate, 8005 SW Grabhorn Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97007','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('36f934c6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Leach Botanical Garden','Leach Botanical Garden is in the wooded valley of Johnson Creek and preserves the Leach plant collection (the garden was given by the Leaches to the City of Portland). It is lush, green and floriferous. The emphasis on native Northwest plants in this garden is fitting: one of the garden\'s creators discovered 2 genera and 11 species in Northwest wildernesses. Well-known amateur botanist Lilla Leach and her husband, John, began their 5-acre garden along Johnson Creek in the early 1930s; today, its more than 15 acres are home to 2,000 species and cultivars of both native and non-native plants of special interest, as well as a variety of different habitats, including a sunny rock garden; a cool, shady riparian area; and a xeric plant display. The Leaches\' 1930s manor can be rented for weddings, receptions, and meetings. The garden has an extensive horticultural library and an historic Manor House. ','','','','','','','','','Leach Botanical Garden, 6704 SE 122 Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97236','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3702155e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Vogel State Park','','','','','','7 am- 10 pm','','http://gastateparks.org/Vogel','','405 Vogel State Park Road ,Blairsville, GA 30512','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3715e39a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Owen Rose Garden','A rose garden by the Willamette River. The Eugene Rose Society donated the first 750 plants - the collection now comprises over 4,500. The garden also features the nationally recognized Oregon Heritage Cherry Tree (planted in the late nineteenth century) and a gazebo.','','','','','','','','','City of Eugene, Parks and Open Space Division, 300 N Jefferson','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97402','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3734e773-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Portland Classical Chinese Garden','The site was previously the parking lot of Northwest Natural, who donated the land to create the scholar\'s garden. The garden opened in September 2000 and is based on style of garden built in Suzhou during the Ming Dynasty. Portland is twinned with Suzhou in China and the limestone rocks were mined from a Lake Tai near Suzhou. The garden is known as Lan Su Yuan - \'Lan\' meaning \'Orchid\', \'Su\' meaning \'awakening\' and Yuan meaning garden. \'Lan\' also echoes the \'lan\' in Portland and \'Su\' echoes the \'Su\' in Suzhou.','','','','','','','','',' 239 Northwest Everett Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97209','2011-12-22 14:35:36','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3749d810-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Shore Acres Gardens','Shore Acres is a former private garden, once very grand, within the State Park. It is on a cliff above the Pacific Ocean. The mansion fell into decay but the formal gardens have been restored. There are woods, rhododendrons, box hedging, bedding plants and roses. ','','','','','','','','','Shore Acres State Park','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97420','2011-12-22 14:35:37','a1c3e20e-f181-11e0-8a53-00306701b527',1),('375c2148-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Oregon Garden','The garden doubles as display garden for the Oregon Association of Nurserymen and a natural water treatment facility for the City of Silverton. It makes nitrogen-rich greywater usable for irrigation. In 2001 the Gordon House, designed by Frank Lloyd Wright, was moved to the garden. A Pet Friendly Garden was added in 2003 and a Sensory Garden, Lewis & Clark Garden and Honor Garden in 2004. ','','','','','','','','','879 W Main Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','97381','2011-12-22 14:35:37','a1c3e20e-f181-11e0-8a53-00306701b527',1),('377e29e8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Awbury Arboretum Garden','The garden was started by a Quaker millionarire, Henry Cope, and named after the village in England from which his family came. The landscape was designed by William Saunders (also landscape architect for the Capitol in Washington DC) in the Gardenesque Style with rolling lawns and a varied plant collection, ','','','','','','','','','Awbury Arboretum Association, The Francis Cope House, 1 Awbury Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19138','2011-12-22 14:35:37','a1c3e20e-f181-11e0-8a53-00306701b527',1),('379f9266-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Bowman\'s Hill Wildflower Preserve','The wildflower garden has over 1000 species of native plants displayed in a naturalistic setting. There are woodlands, meadows, a pond and a stream (Pidcock Creek). ','','','','','','','','','1635 River Road (PA Route 32)','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','18938','2011-12-22 14:35:37','a1c3e20e-f181-11e0-8a53-00306701b527',1),('37baf2cf-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Brandywine Conservancy Wildflower and Native Plant Gardens','The Brandywine Conservancy\'s Wildflower and Native Plant Gardens were designed by F M Mooberry to show indigenous and naturalized plants of the Brandywine region in a naturalistic setting. It is appropriate that the Museum features the paintings of Andrew Wyeth, painter of the American landscape. ','','','','','','','','','Brandywine River Museum, U.S. Route 1, P.O. Box 141','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19317','2011-12-22 14:35:37','a1c3e20e-f181-11e0-8a53-00306701b527',1),('37c847b9-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake James State Park','','','','','','November - February, 8 a.m. - 6 p.m. March, April, September, October 8 a.m. - 8 p.m. May - August, 8 a.m. - 9 p.m. Closed Christmas Day.','','http://www.ncparks.gov/Visit/parks/laja/main.php','','P.O. Box 340, 6883 NC Hwy 126, Nebo, NC 28761','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('37d1d2d3-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Chanticleer Garden','Adolph Rosengarten, Sr., head of the chemical company Rosengarten and Sons bought the land on which the garden was made in 1912. His son established the property as a charitable trust in 1993. There are lawns, woods, flower gardens, courtyards and a Ruin Garden. The character is predominantly English - with an Arts and Crafts American accent. ','','','','','','','','','Chanticleer, 786 Church Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19085','2011-12-22 14:35:37','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38049986-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Crozer Arboretum Garden','The estate was formerly a seminary before it was used by the Crozer Medical Center. The gardens have a gardenesque character. ','','','','','','','','','Crozer Arboretum, 1 Medical Center Boulevard','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19015','2011-12-22 14:35:38','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3818afa5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hershey Gardens','Hershey is the company town of the chocolate magnate Milton S. Hershey. He was asked if he would sponsor a national rosarium in Washington, D.C. , but decided instead to make a garden in Hershey, in his words to \'create a nice garden of roses.\' The town was designed by landscape architect Ogelsby Paul. The garden was by the horticulturalist Harry Erdman with rather a dull layout but a very large collection of roses. ','','','','','','','','','Hershey Gardens, 170 Hotel Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','17033','2011-12-22 14:35:38','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3823d153-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Highlands Mansion and Gardens','The mansion is set in a 44 acre estate with a 2 acre garden created in the 1840s by George Sheaff. There is an ice house, fishpond and ha ha. ','','','','','','','','','7001 Sheaff Lane','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19034','2011-12-22 14:35:38','a1c3e20e-f181-11e0-8a53-00306701b527',1),('382ea103-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Jenkins Arboretum','H. Lawrence Jenkins established the arboretum as a memorial to his wife, Elisabeth Phillippe Jenkins. In his will, he directed that the arboretum be developed as a \'public park, arboretum, and wildlife sanctuary for use by the public and responsible organizations engaged in the study of arboriculture, horticulture, and wildlife for educational and scientific purposes...\'. It opened to the public in 1976. ','','','','','','','','','631 Berwyn Baptist Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19333','2011-12-22 14:35:38','a1c3e20e-f181-11e0-8a53-00306701b527',1),('384cf2e3-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','John Bartram Gardens','The Bartrams were a Quaker family of pioneering of naturalists, botanists and explorers. The plants they collected were brought to this garden. It has collections, flower gardens and an old world charm. ','','','','','','','','','Historic Bartram\'s Garden, 54th St. and Lindbergh Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19143','2011-12-22 14:35:38','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3862b210-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Longwood Gardens','The garden was designed by a co-owner of the DuPont chemical company. A meticulous engineer, he drew inspiration from contemporary books and visits to European gardens. It grew by the addition of major features, without a controlling plan. There is a Flower Garden, a Sundial Garden, a Rose Garden, an Italian Water Garden (modelled on the Villa Gamberaia and pinpointed on the satellite image if you zoom in on the map below) and a Fountain Garden. DuPont had a special interest in fountains and used them as part of musical entertainments, in the manner of Versailles. The conservatory houses 4 acres of indoor garden.','','','','','','','','','1001 Longwood Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19348','2011-12-22 14:35:38','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38847c17-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Meadowbrook Farm','Meadowbrook Farm was designed by a florist, J. Liddon Pennock, Jr. (1913-2003). The house was designed in the English Cotswolds style by Robert McGoodwin. The garden design is a pastische of a 1930s English garden, still with echos of the nineteenth century heritage (eg the use of bedding). ','','','','','','','','','1633 Washington Lane','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19046','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3896dd07-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Morris Arboretum of the University of Pennsylvania','The garden was started by John and Lydia Morris, wealthy Quaker eccentrics with the time and money to travel in Europe. They built a summer home on Chestnut Hill and laid out the garden in the Mixed Style. It is now managed as a garden and arboretum by the University of Pennsylvania and retains its European flavor. There is a Mercury Temple and a Fernery. The Rose Garden was created in 1888. ','','','','','','','','','Morris Arboretum, University of Pennsylvania, 100 E. Northwestern Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19118','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38a4aa64-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Dale Hollow Lake State Park','','','','','','','','http://parks.ky.gov/findparks/resortparks/dh/','','5970?State Park Road, Burkesville, KY 42717','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc35954-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38a55435-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Phipps Conservatory and Botanical Gardens','Phipps Conservatory and Botanical Gardens is a Victorian glasshouse, gardens and tropical forest conservatory in the Schenley Park area of Pittsburgh. Henry Phipps, a partner of Andrew Carnegie, made his fortune in steel and employed the prestigius New York greenhouse firm, Lord and Burnham design a large conservatory with 9 display houses. A gift to the city of Pittsburgh from Henry Phipps in 1893, Phipps\' mission is to promote awareness, enjoyment, and understanding of plants and their diverse interactions with mankind. Phipps fosters learning about plants through educational and recreational programs and promotes research. Throughout the year, Phipps features changeable exhibits, flower shows, classes and programs for the public. ','','','','','','','','','One Schenley Park','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','15213','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38b009f6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Renziehausen Park Rose Garden','The 3 acre garden has over 1,800 roses, perennials beds, a herb garden, butterfly garden and water pond. The rose garden is maintained by the Garden Club of McKeesport.','','','','','','','','','1400 Pinoak Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','15131','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38bbcc6f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Rodef Shalom Biblical Garden','The Temple of Rodef Shalom has put together a full collection of biblical plants. The garden is a replica of ancient Israel in a stream valley intended to symbolise the River Jordan. ','','','','','','','','','Rodef Shalom Biblical Botanical Garden, 4905 Fifth Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','15213','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38cf9cba-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Scott Arboretum Garden','The Scott Arboretum is located in and around the Swarthmore College (\'Swat\') campus. It was established in as a memorial to Arthur Hoyt Scott and gives the college a gardenesque character. This includes a large rose garden which suplies graduates with a rose to wear. ','','','','','','','','','Scott Arboretum of Swarthmore College, 500 College Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19081','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38e89b30-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Shofu-So Japanese Garden','The Japanese House (Shoin-zukuri - desk centered) and Garden (Shofuso) built in 16th century style as used an educated aristocrat and government official. The house was designed by Junzo Yoshimura and the garden by Sano Tansai. ','','','','','','','','','Shofu-So Japanese House and Japanese Garden, Fairmont Park','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19131','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('38f9ec55-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Tyler Arboretum','The arboretum was established by brothers Jacob and Minshall Painter in 1825, making it one of the oldest arboreta in the United States. Tyler Arboretum encompasses 650 acres of renowned plant collections, champion trees, historic buildings, and 20 miles of hiking trails through woodlands, wetlands, and meadows. ','','','','','','','','','515 Painter Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19063','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39051341-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Wyck Garden','Reuben Haines III and Jane Bowne (1790-1843) made the rose garden, which survives in good condition. She also kept a notebook in which she recorded details of the garden lists of rose plantings, starting in 1818 at the latest. Reuben made a a Catalogue of Plants at Wyck in 1825. It is likely that they had a copy of J C Loudon\'s Encyclopedia of Gardening and possibly a copy of Humphry Repton\'s books on landscape gardening, with illustrations of rose gardens. ','','','','','','','','',' Wyck, 6026 Germantown Ave.','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','19144','2011-12-22 14:35:39','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3908bc8d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Upton State Forest','','','','','','','','http://www.mass.gov/dcr/parks/northeast/uptn.htm','','Westboro Rd., Upton, MA 01568','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39106154-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Blithewold Gardens','Blithewold Gardens overlook Bristol Harbor and Narragansett Bay. They were designed for a coal magnate (Autustus van Wickle) by landscape architect John DeWolf between 1896 and 1913. The garden has herbaceous borders, shrubs and trees. DeWolf, one of Olmsted\'s assistants on Prospect Park, designed the Bosquet, a nut grove and a Moon Gate. ','','','','','','','','','Blithewold Mansion, Gardens & Arboretum, 101 Ferry Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed6bf46c-f48c-11e0-b192-00306701b527','','02809','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('391c6c7a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Green Animals Topiary Garden','The estate dates from 1860 and the large topiary garden was made by the gardener Joseph Carreiro (1905-1945) and his son-in-law George Mendonca. There are 80 green sculptures cut from California privet, yew, and box. It is a popular attraction, loved by children. ','','','','','','','','','380 Cory\'s Lane','7f7a92b8-ea4c-11e0-8606-00306701b527','ed6bf46c-f48c-11e0-b192-00306701b527','','02871','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3927abbc-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Rosecliff','Rosecliff, home of Teresa Fair Oelrichs, only retains one section of its once-magnificent rose gardens. ','','','','','','','','','548 Bellevue Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ed6bf46c-f48c-11e0-b192-00306701b527','','02840','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3933cf3a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Shakespeare\'s Head Garden','A carefully detailed and well-planted cottage garden behind the building of the Providence Preservation Society. It takes its name from a bust of William Shakespeare hung near the door of the former house and shop.','','','','','','','','','Providence Preservation Society, 21 Meeting Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed6bf46c-f48c-11e0-b192-00306701b527','','02903','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39409606-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Breakers Garden','The Breakers is the Vanderbilt\'s Newport \'summer cottage\' - and the grandest example of its type with a palatial villa was designed by Richard Morris Hunt in 1893. It is maintained by The Newport Mansions Preservation Society, who also own 10 other properties in the area. ','','','','','','','','','44 Ochre Point Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ed6bf46c-f48c-11e0-b192-00306701b527','','02840','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('394dc84c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','The Elms Garden','The Elms is French neoclassical with a garden estate by Ernest Bowditch (an Olmsted assistant) with a formal drive, a vast lawn, a terrace and a sunken Italian garden. ','','','','','','','','','367 Bellevue Ave','7f7a92b8-ea4c-11e0-8606-00306701b527','ed6bf46c-f48c-11e0-b192-00306701b527','','02840','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3958ba70-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Brookgreen Gardens','Brookgreen Garden holds America\'s first public sculpture garden, the Huntington Sculpture Garden, named after its founders, Archer and Anna Hyatt Huntington (herself a sculptress). The sculptures are set amongst streams, ponds, ornamental planting and live oaks wieth Spanis Moss. ','','','','','','','','','Huntington Sculpture Garden, 1931 Brookgreen Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29576','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39658044-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Caldwell-Boylston Garden, SC Governor\'s Mansion','Located on one of the highest hills in Columbia, the mansion was built in 1855 and was added to the U.S. National Register of Historic Places in 1970. The Caldwell-Bolyston House is located on the north side of the mansion grounds. The gardens were started by the builder of the Caldwell-Boylston House (John Caldwell) in the 1830s. The pea gravel paths are in their original 1830s location. Basically a green garden, the garden is planned on four tiers and features elegant fountains, rectangular boxwood enclosed beds and some large Magnolia and Crape Myrtle trees. ','','','','','','','','','800 Richland Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29201','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3972ad82-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cypress Gardens (SC)','This antebellum estate, formerly known as Dean Hall, had a swamp which was used to flood the rice plantations. It had a formal garden which fell into disrepair during the Civil War. The estate was purchased by B R Kittredge in 1909 and made into a picturesque swamp garden featuring exotic azaleas, magnolias, camellias and bulbs. The brilliant colours of the flowers are seen against the gray cypress tress and reflected in the brown swamp water. The scene can be viewed from footpaths or flat-bottomed boats. The plan is Picturesque and the planting Gardenesque. ','','','','','','','','','3030 Cypress Gardens Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29461','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('397d2af9-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Gateway Walk, Charleston','The Gateway Walk opened in 1930 to celebrate the 250th anniversary of the founding of Charleston. The walk connects the area between Archdale Street and Philadelphia Alley. It was designed by landscape architect Loutrel Brigg and was recently restored by T Hunter MacEaddy Associates.','','','','','','','','','Archdale Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29401','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3987fecd-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Heyward Washington Garden','The Heyward-Washington House was the home of Thomas Heyward, a signatory of the Declaration of Independence, and George Washington\'s temporary home in 1791. The re-created formal garden, dating from the 1930s, is planted with material available to Charlestonians in the eighteenth century but looks like a nineteeth century garden. ','','','','','','','','','The Charleston Museum, 87 Church Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29403','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3991e46b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Joseph Manigault House Garden','The Joseph Manigault House is a historic house built in 1803 by a rice growing family, descendents of the French Huguenots who fled to the US to escape persecution. It is now owned by the Charleston Museum. The garden is entered via a Gate Temple. ','','','','','','','','','350 Meeting Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29403','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3999bc25-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Greenwood Furnace State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/greenwoodfurnace.aspx','','15795 Greenwood Road, Huntingdon, PA 16652','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('399ee070-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kalmia Gardens','May Coker made the gardens in the 1930s, for a nineteenth century plantation house which is the oldest building in Hartsville. As the name suggests, the main focus is on Kalmia species. ','','','','','','','','','Kalmia Gardens of Coker College, 1624 West Carolina Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29550','2011-12-22 14:35:40','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39a7550d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','LaFramboise Island Nature Area','','','','','','LaFramboise Island is closed until further notice due to flooding.','','http://gfp.sd.gov/state-parks/directory/laframboise/','','Pierre, SD','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39a9ee0c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Magnolia Plantation Garden','An Enclosed Style garden with a parterre dating from the 1680s with a nineteenth century Picturesque garden. This is one of the finest gardens in the South, dating from the days of rice plantations. It has the classic combination of live oaks, cypress, azaleas and Spanish moss. The garden has been open to the public since 1870. ','','','','','','','','','Magnolia Plantation and Its Gardens, 3550 Ashley River Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29414','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39b279b0-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Red Rock State Park','','','','','','8 am – 5 pm','','http://azstateparks.com/Parks/RERO/index.html','','4050 Red Rock Loop Rd, Sedona, AZ 86336','7f7a92b8-ea4c-11e0-8606-00306701b527','ec55e77f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39b4aa72-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Middleton Place Garden','One of the oldest surviving gardens in America, Middleton Place was made in the 1740s, when the Forest and Augustan styles were favoured in England. The design has both formal axes and an empirical response to the existing topography. Its near contemporaries, and closest English relatives, are Chiswick, Claremont, Rousham and Studley Royal. With so few examples of this style in existence, Middleton Place is an important, beautiful and interesting example. A Camellia garden was begun in the late-eighteenth century and has been extended. ','','','','','','','','','4300 Ashley River Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29414','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39bf46c0-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Pearl Fryar\'s Topiary Garden','A 3 acre garden developed by Pearl Fryar since 1984. He began work on the garden to win a \'Yard of the Month\' award. ','','','','','','','','','145 Broad Acres Rd','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29010','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39bf9214-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','A.H. Stephens Historic Park','','','','','','7 am- 10 pm','','http://www.gastateparks.org/info/ahsteph/','','456 Alexander Street, NW Crawfordville, GA 30631','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39c8baef-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c682cbd1-203b-11e1-8a87-000c29a5c50c','Great Basin National Park','','','','','','','','http://www.nps.gov/grba/index.htm','','100 Great Basin National Park, Baker, Nevada 89311','7f7a92b8-ea4c-11e0-8606-00306701b527','ed121df0-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39ca8dc3-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Riverbanks Garden','The botanical garden was designed, by the Pittsburgh landscape architects Environmental Planning and Design, to enhance the zoo. In a similar manner, eighteenth and nineteenth century zoos were often set in gardens. Themed gardens include a Dry Garden, Shade Garden, Bog Garden, Walled Garden, Old Rose Garden and Garden Amphitheater. With a central canal and fountains at each end, the Walled Garden was the first section of the Botanical Garden to open to the public. There is an area with plants that glow in the moonlight. The Garden is host to free weekly demonstrations presented by the Clemson Extension Urban Horticulture Center. ','','','','','','','','','Riverbanks Zoo and Garden, 1300 Botanical Parkway','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','29169','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39d0fa89-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Springfield Recreation Area','','','','','','','','http://gfp.sd.gov/state-parks/directory/springfield/','','41548 Boat Basin Drive, Springfield, SD 57062','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39d65e1d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','McCrory Gardens','The gardens are maintained and operated by the South Dakota State University Horticulture, Forestry, Landscape and Parks Department. McCrory Gardens were named in honour of Professor S.A. McCrory, who was head of the department from 1947 until his death in 1964. Research in the gardens focuses on ornamental plants for South Dakota\'s climate. The garden features a Rock Garden, Herb Garden, White Garden and Woodland Garden. Recent developments in the garden include the Lilac Collection, Prairie Medicinal Garden and Rosenfeld Contemplative Garden. All-America Display judging takes place here. ','','','','','','','','','South Dakota State University, 6th Street and 22nd Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','57007','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39d9cdea-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Benbow Lake State Recreation Area','','','','','','','','http://www.parks.ca.gov/?page_id=426','','1600 Highway 101 Garberville ,?CA?95542','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39e28623-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Candlestick Point State Recreation Area','','','','','','8am to 5pm daily, closing later in summer months.  ','','http://www.parks.ca.gov/?page_id=519','','1150 Carroll Avenue, San Francisco,?CA?94124','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39e301c6-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cheekwood Garden','The former home of the Cheek family with a garden designed by Bryant Fleming. It has pools, fountains and statuary and views of the Tennessee hills.There is also a Japanese garden, a herb garden, two perennial gardens, a Color Garden, a Dogwood Garden, a water garden, and a wildflower garden. The Boxwood Garden was restored by Michael van Valkenburgh. ','','','','','','','','','Cheekwood Botanical Garden & Museum of Art, 1200 Forrest Park Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ed86a3e9-f48c-11e0-b192-00306701b527','','37205','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39ea4173-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Burt Lake State Park','','','','','','','','http://www.michigandnr.com/parksandtrails/Details.aspx?id=439&type=SPRK','','6635 State Park Dr., Indian River, MI 49749','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39ef8c45-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Dixon Gardens','Margaret and Hugo Dixon had their house designed by John Staub, in 1940, in a Georgian Revival style. The gardens were set in native Tennessee woodlands and designed like an English park with open vistas oak and hickory. The garden designers were Hugo Dixon and his sister, Hope Crutchfield, an English garden designer living in Vermont. They have a cross-axis with sculpture at strategic points \'Europa and the Bull\', \'The Four Seasons\', \'The Venus of Memphis\'. There is also a Cutting Garden designed in 1998. ','','','','','','','','','The Dixon Gallery and Gardens, 4339 Park Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed86a3e9-f48c-11e0-b192-00306701b527','','38117','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('39f33cba-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Little Beaver','','','','','','','','http://www.littlebeaverstatepark.com/','','1402 Grandview Rd., Beaver, WV 25813','7f7a92b8-ea4c-11e0-8606-00306701b527','edb324d8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53