of lakes, woodlands, and display gardens. The modernist Visitor Centre and courtyard water garden lead to more traditional theme gardens: the Japanese Garden of Tranquility, the Sensory Garden, the Rose Garden and the Tennessee Bicentennial Iris Garden (the botanic garden\'s first garden). The W.C. Paul Arboretum was planned by landscape architect George Madlinger in 1957. ','','','','','','','','','750 Cherry Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed86a3e9-f48c-11e0-b192-00306701b527','','38117','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a0b069b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Spring Meadow Lake State Park','','','','','All Year','','','http://www.visitmt.com/categories/moreinfo.asp?SiteID=1&IDRRecordID=3092','','2715 Country Club Avenue，Helena, MT 59601','7f7a92b8-ea4c-11e0-8606-00306701b527','ed049c7e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a14a374-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Chicot State Park','','','','','','','','http://www.crt.state.la.us/parks/ichicot.aspx','','3469 Chicot Park Road, Ville Platte, LA 70586','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc9e8b5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a1bfc70-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Reflection Riding Garden','A \'riding\' can be either a green track for riders of a part of a country. John and Margaret Chambliss used it to mean a place of natural beauty where people could reflect on and enjoy harmony with nature. They were impressed by the life and work of Charles Eliot and began work here in the 1920s. Thomas Kane, a landscape architect, drew up a plan for its conservation in 1982. Reflection Riding is now dedicated to the study and conservation of native plant life and natural scenery. There are ferns, flowering shrubs and wildflowers. ','','','','','','','','','Reflection Riding Arboretum & Botanical Garden, 400 Garden Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed86a3e9-f48c-11e0-b192-00306701b527','','37419','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a1e4083-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','De Veaux Woods State Park ','','','','','','Open year round, Dawn to Dusk.','','http://nysparks.state.ny.us/parks/11/details.aspx','','3180 De Veaux Woods Drive, Niagara Falls, NY 14303','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a27f15f-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Clay Myers State Natural Area','','','','','','','','http://www.oregonstateparks.org/park_248.php','','Cloverdale, OR 97112','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a2d4100-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Tennessee River Sculpture Garden','The garden, designed by landscape architect Joe Baasch, holds collections of contemporary American sculpture. ','','','','','','','','','River Gallery Sculpture Garden, Bluff View Art District, 400 East Second Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed86a3e9-f48c-11e0-b192-00306701b527','','37403','2011-12-22 14:35:41','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a31431b-2691-11e1