,'','76107','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a5c9a62-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lady Bird Johnson Wildflower Center','The Center features a display of Texas wildflowers and native plants emphasizing the Central Texas Hill Country. There are three Homeowner Inspiration Gardens, the Hill Country Stream and Woodland Garden, several pond gardens, a Trans-Pecos Mountains garden, the Café meadow garden and others. In addition, there are 23 display gardens with such themes as Texas grasses, hummingbird plants, pond plants, botanists\' discoveries, cactus and succulents and many others. The Center includes four miles of nature trails through meadows, woodland and research plots. The Center was founded in 1982 as the Texas Wildflower Research Center. In 1995, the new Center opened and in 1998 was renamed the Lady Bird Johnson Wildflower Center. It became an organized research unit of the University of Texas at Austin in 2006.','','','','','','','','','4801 La Crosse Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','78739','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a5e3aa8-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Piute State Park','','','','','','24-hour access, year-round','','http://stateparks.utah.gov/parks/piute','','PO Box 43, Antimony, UT 84712','7f7a92b8-ea4c-11e0-8606-00306701b527','ed934339-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a672bdd-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Liberty Falls State Recreation Site','','','','','','','','http://dnr.alaska.gov/parks/aspunits/mat