bb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Locust Grove State Historic Site','','','','','','','','http://www.crt.state.la.us/parks/ilocust.aspx','','P.O. Box 546 (Bains-Ristroph Road), St. Francisville, LA 70775','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc9e8b5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a7d9ec2-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Moody Gardens','A garden specialising in tropical and subtropical plants, with a 10-story Rain Forest Pyramid. The Trustees asked Sir Geoffrey Jellicoe to prepare a design for the garden. It was the culminating work of his design career but has not, as yet, been implemented. We live in hope. ','','','','','','','','','1 Hope Boulevard','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','77554','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a869b5f-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','La Pine State Park','','','','','','','','http://www.oregonstateparks.org/park_41.php','','Pleasant Hill, OR 97455','7f7a92b8-ea4c-11e0-8606-00306701b527','ed530e25-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a8a1337-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','San Antonio Botanical Garden','A late nineteenth century house with a 1960s botanical garden. The Formal Gardens is comprised of four large rectangular display areas which are changed seasonally to display a variety of colors and textures. There is also a Japanese garden, rose garden, old fashioned garden and a sensory garden for the blind. Surrounding a sunken courtyard and a tropical lagoon filled with aquatic plants, the conservatory was designed by Emilio Ambaszis and opened to the public in 1988. There are collections ranging from desert to rainforest plants in individual glasshouses that have pyramidal glazed roofs and are partly earth-sheltered. The Texas Native Trail features plants from South Texas, East Texas Piney Woods and Hill Country and several reconstructed early Texas houses. ','','','','','','','','','555 Funston Place','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','78209','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a8fda46-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lake Vermillion Recreation Area','','','','','','','','http://gfp.sd.gov/state-parks/directory/lake-vermillion/','','26140 451st Ave., Canistota, SD 57012','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a9718a1-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Pocomoke River State Park','','','','','','','','http://dnr.maryland.gov/publiclands/eastern/pocomokeriver.asp','','3461 Worcester Highway, Snow Hill, MD 21863 & 3036 Nassawanggo Road, Pocomoke City, MD 21851','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a97338d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','San Antonio River Walk (Paseo del Río)','The San Antonio River Walk (aka Paseo del Río) is a most  brilliant scheme which should inspire city planners and landscape architects the world over. Today, it is a linear greenway park on the banks of the San Antonio River. The greenway is below street level and lined by by bars, shops and restaurants. The Riverwalk has become a significant tourist attraction - and a car-free pedestrian zone in the city center: it is one of the best examples of what landscape architecture has contributed to urban design and city planning.        The original idea came from Robert Hugman in the 1920s. He was an architect who had enjoyed fishing by the San Antonio River as a boy. Hugman\'s proposal was for a flood protection scheme, a park scheme and an urban design. It took him years to persuade the city fathers to adopt his ideas but it was then done (in 1938) with public works money. By the 1950s the scheme was falling into decay. Robert L. (Bob) Frazer (who received a landscape architecture degree in 1948) was appointed Director of Parks and Recreation in San Antonio in 1955. He reorganized and redesigned what had become an unsafe place. Attracting people and business made the River Walk Greenway safe, popular and beautiful.','','','','','','','','','200 South Alamo Street','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','78205','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3a9f12b2-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fort Columbia State Park','','','','','','Summer: 6:30 a.m. to 9:30 p.m. Winter: 8 a.m. to 5 p.m.','','http://www.parks.wa.gov/parks/?selectedpark=Fort%20Columbia','','Naselle, WA 98638','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3aa56f69-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','South Texas Botanical Gardens & Nature Center','The South Texas Botanical Gardens are beside Oso Creek and were opened to the public in 1996. The garden specializes in subtropical plants, mesquite forest, hibiscus. The rose garden has 12 raised beds and was designed by the landscape architect Robert Gignac. The Plumeria Garden (Hawaiian lei flower) has over 100 plumerias. The Orchid House has over 2,000 orchids. There is also an Arid Garden, Water Garden and Sensory Garden. ','','','','','','','','','8545 South Staples','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','78413','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3aa7fa0b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Lovers Leap State Park','','','','','','8 am to sunset','','http://www.ct.gov/dep/cwp/view.asp?A=2716&Q=433316','','Field Road, New Milford, CT 06776','7f7a92b8-ea4c-11e0-8606-00306701b527','ec693a86-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ab018a5-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Tyler Municipal Rose Garden','Tyler is a rose-growing town and the municipality was prompted to established America\'s largest public collection of roses.There are also Heritage Rose, Camellia, and Meditation gardens. The Rose Museum has a collection of historical items from the \'Texas Rose Festival\'. The I.D.E.A. demonstration gardens were created by the Smith County Master Gardeners to supply gardening ideas for visitors.','','','','','','','','','Tyler Municipal Rose Garden & Center, 420 Rose Park Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','ed8c9fbe-f48c-11e0-b192-00306701b527','','75702','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ab70925-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-