0-8606-00306701b527','ed934339-f48c-11e0-b192-00306701b527','','84104','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ac9866b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Folsom Powerhouse State Historic Park','','','','','','Wed. through Sun.  Noon to 4:00pm ','','http://parks.ca.gov/default.asp?page_id=501','','9980 Greenback Lane, Folsom,?CA?95630','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ad20056-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Temple Square Gardens','Temple Square is the heart of Salt Lake City and the HQ of the Church of Jesus Christ of Latter-day Saints. The Square is managed to show a naturalistic approach to planting design. There are no straight lines but substantial use is made of bedding plants. There is extensive garden lighting and Christmas has become a popular visiting time. The Mormon Conference Center Roof Garden (4 acres) imitates native grassland, with wild flowers and water channels. ','','','','','','','','','Temple Square','7f7a92b8-ea4c-11e0-8606-00306701b527','ed934339-f48c-11e0-b192-00306701b527','','84150','2011-12-22 14:35:42','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ad38401-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fort Atkinson State Preserve','','','','','','','','http://www.iowadnr.gov/parks/state_park_list/fort_atkinson.html','','Fort Atkinson, IA 52144','7f7a92b8-ea4c-11e0-8606-00306701b527','ecb59693-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3add566a-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Chemin-A-Haut State Park','','','','','','','','http://www.crt.state.la.us/parks/icheminah.aspx','','14656 State Park Road, Bastrop, LA 71220','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc9e8b5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ade941f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Hildene Garden','Hildene\'s house and Hoyt Formal Garden, on a promontory overlooking the Battenkill Valley, were designed for Robert Todd Lincoln, the eldest son of President Abraham Lincoln, by a Boston architectural firm in a Georgian style. The garden was designed by Robert Todd Lincoln\'s daughter, Jessie Lincoln Beckwith, in a French Parterre style: the design resembles a stained glass window. Most of the hedges and many of the peonies are original plantings. The surrounding grounds were designed by Frederick Todd, a pupil of Frederick Law Olmsted. Recently renovated are the Cutting and Kitchen Gardens behind the Welcome Center and several projects are in progress including the new Apple Tree Allee and Robert\'s Rock.','','','','','','','','','1005 Hildene Rd','7f7a92b8-ea4c-11e0-8606-00306701b527','ed9984a2-f48c-11e0-b192-00306701b527','','05254','2011-12-22 14:35:43','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3aea8a01-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Shelburne House Gardens','Shelburne house and garden on the shore of Lake Champlain was the home of William Webb and his millionairess wife Lila Vanderbilt. Frederick Law Olmsted was commissioned to design the garden, though he resigned to work on the Biltmore estate. Gifford Pinchot, America\'s first professionally trained forester and a pioneer of forest conservation, planned the farm and estate. There is a flower garden near the house, designed by Lila and inspired by Gertrude Jekyll, and a large park still maintained on conservation principles. Shelburne estate has extensive planting of lilac trees which attract visitors in spring. ','','','','','','','','','Shelburne House, 102 Harbor Road','7f7a92b8-ea4c-11e0-8606-00306701b527','ed9984a2-f48c-11e0-b192-00306701b527','','05482','2011-12-22 14:35:43','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3aede654-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Muskallonge Lake State Park','','','','','','','','http://www.michigandnr.com/parksandtrails/Details.aspx?id=424&type=SPRK','','30042 County Road 407, Newberry, MI 49868','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3af648fb-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Catawba Island State Park','','','','','','','','http://www.dnr.state.oh.us/parks/parks/lakeerie/catawba/tabid/753/Default.aspx','','4049 E. Moores Dock Road, Port Clinton, OH 43452','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3af6c106-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Agecroft Hall Gardens','Agecroft manor house was built on the banks of Irwell River in Lancashire, England in the late 15th Century, sold at auction in 1925, and rebuilt on the banks of the James River by Thomas C. Williams, Jr. [See Additional Information]. The Tudor garden was designed by Richmond landscape architect Charles Gillette (1886 to 1969). There is an knot garden and a John Tradescant garden. Little was known about renaissance English gardens in the 1920s, and not much more is known now. Agecroft Hall is just down the road from Virginia House. ','','','','','','','','','Agecroft Hall, 4305 Sulgrave Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','23221','2011-12-22 14:35:43','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3afd82ab-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Castle Rock State Park','','','','','','','','http://dnr.state.il.us/lands/Landmgt/PARKS/R1/CASTLE.HTM','','1365 W. Castle Road, Oregon, IL 61061','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b02bcb8-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Arlington House, The Robert E. Lee Memorial','Arlington House is an early nineteenth century Greek Revival mansion, situated on a hill overlooking the Potomac River.  It was designed by English architect George Hadfield, who helped design the US Capitol.  For 30 years, Arlington House was home to Robert E. Lee (George Washington Parke Custis\' son in law) until Virginia\'s secession from the United States in 1861.','','','','','','','','','Arlington National Cemetery','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','22211','2011-12-22 14:35:43','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b04e260-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Bear Brook State Park','','','','','','','','http://www.nhstateparks.com/bearbrook.html','','157 Deerfield Road, Allenstown, NH 03275','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306