, OH 44843','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b4661b4-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Colonial Williamsburg Gardens','Williamsburg was settled in 1633 and became the capital of the Crown Colony. It declined after Virginia moved its capital to Richmond in 1780 but remains an independent city, with one of America\'s oldest universities. The city was named in honour of William III. Colonial Williamsburg is a restored and re-created area of the city, funded by John D Rockefeller after 1926. Most of the garden areas are historical re-creations (of Dutch renaissance styles), made without detailed information about the original layouts. The gardens of the Governor\'s Palace, restored by the landscape architect Arthur Shurfliff, draw more from Dutch gardens in Holland than from gardens influenced by Holland in England. They make extensive use of clipped hedges, rectangular parterres and garden species which were used in the early eighteenth century. Some 25 smaller gardens are also open to the public and another 75 can be seen by appointment. ','','','','','','','','','Colonial Parkway','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','23187','2011-12-22 14:35:43','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b4d9adf-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Dr. Thomas Walker State Historic Site','','','','','','','','http://parks.ky.gov/findparks/histparks/tw/','','4929 Ky 459, Barbourville, KY 40906','7f7a92b8-ea4c-11e0-8606-00306701b527','ecc35954-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b519507-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Green Spring Gardens Park','The house was built in 1760 and the garden was designed by Beatrix Farrand with boxwood hedging, roses, and perennial borders. Green Spring Gardens occupy 5 acres of a 27 acre park. The property was purchased by by editor and publisher Michael Straight in 1942 and given to Fairfax County in 1970. ','','','','','','','','','4063 Green Spring Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','22312','2011-12-22 14:35:43','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b54a965-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Deep Creek Lake State Park','','','','','','','','http://dnr.maryland.gov/publiclands/western/deepcreek.asp','','898 State Park Road, Swanton, MD 21561','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b5c3fb5-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Deer Creek State Park','','','','','','','','http://www.dnr.state.oh.us/parks/parks/deercrk/tabid/725/Default.aspx','','20635 State Park Road 20, Mt.Sterling, OH 43143','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b5f8dda-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Gunston Hall Garden','The house was built, c1755 for George Mason (1725-1792), who wrote the Virginia Declaration of Rights and influenced the 1791 US Bill of Rights. Gunston Hall is a Georgian house with a restored garden. Before the historic garden restoration there was a re-created garden on the site (designed by Alden Hopkins, who also worked on Colonial Williamsburg). The historically more accurate garden which can be seen today is less attractive than the Hopkins design, but on this important site the trustees were surely right in their decision to prefer accurate restoration to an imaginative pastische. ','','','','','','','','','Gunston Hall Plantation, 10709 Gunston Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','22079','2011-12-22 14:35:43','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b6377e6-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Torreya State Park','','','','','','8 a.m. until 6:00 p.m. 365 days a year','','http://www.floridastateparks.org/torreya/default.cfm','','2576 N.W. Torreya Park Road, Bristol, Florida 32321','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b6c0bcc-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Pickett\'s Mill Battlefield Historic Site','','','','','','Open Thursday - Saturday / 9AM-5PM Closed Thanksgiving, Christmas and New Year\'s Day.','','http://gastateparks.org/PickettsMillBattlefield','','4432 Mt. Tabor Church Rd, Dallas, GA 30157','7f7a92b8-ea4c-11e0-8606-00306701b527','ec8e76f8-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b6ce7be-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kenmore Plantation & Gardens','Kenmore was built by Betty Washington Lewis (sister of George Washington) and her husband Colonel Fielding Lewis in 1770s.','','','','','','','','','268 Kings Hwy','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','22405','2011-12-22 14:35:44','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b737c87-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Castle Rocks State Park','','','','','','','','http://parksandrecreation.idaho.gov/parks/castlerocks.aspx','','3035 S Elba-Almo Rd, Almo, ID 83312','7f7a92b8-ea4c-11e0-8606-00306701b527','eca177fb-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b78ede2-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lewis Ginter Botanical Garden','The garden includes an 11,000 sq foot domed conservatory with orchids and tropical plants, sunken garden, perennial garden, healing garden and rose garden. There is also a new Children\'s Garden with Tree House. ','','','','','','','','','1800 Lakeside Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','23228','2011-12-22 14:35:44','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b7c57c2-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Young State Park','','','','','','','','http://www.michigandnr.com/parksandtrails/Details.aspx?id=512&type=SPRK','','02280 Boyne City Road, Boyne City, MI 49712','7f7a92b8-ea4c-11e0-8606-00306701b527','ecea2b08-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b8440f0-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','MacCallum More Museum & Gardens','Lucy Morton Hudgins began to create the garden in 1929 and her son William Henry Hudgins continued her work. He was Personal Aide to both President Truman and Admiral Carney and as such travelled extensively. During his travels, he collected many items for the garden. There is a fountain copied from one of the fountains at the Alhambra, a cloister imported from Italy, a rose garden, herb garden, pink garden and white garden.','','','','','','','','','603 Hudgins Street','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','23924','2011-12-22 14:35:44','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b91089b-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Maymont Garden','Maymont was built by James and Sallie Dooley on a site above the James River and is a classic example of an American Gilded Age estate.The mansion was designed by Edgerton Stewart Rogers (1860-1901) and called \'May Mont\' to remember Mrs. Dooley\'s maiden name (May) and the Italian word for hill (monte). She supervised the garden design by the Richmond architects Noland and Baskerville. It has lawns, terraces, balustrades, gazeboes, statuary, walkways and ornaments. There is an Italian Garden, a Japanese Garden (by Muto) and an Arboretum. The Maymont estate was restored in the 1980s. ','','','','','','','','','Maymont Foundation, 1700 Hampton Street','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','23220','2011-12-22 14:35:44','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b91cc76-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Norwottuck Rail Trail','','','','','','','','http://www.mass.gov/dcr/parks/central/nwrt.htm','','446 Damon Rd., Northampton, MA 01060','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b9ae1db-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Beechwood State Park','','','','','','','','http://www.cnyhiking.com/NYSP-Beechwood.htm','','Hicksville, NY 11801','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3b9dfb38-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Monticello Garden','A late-eighteenth century Palladian house and garden designed and owned by America\'s third president. Thomas Jefferson read Palladio\'s books and had seen how his style had been interpreted in England. Monticello (\'little mountain\') owes something to Chiswick House. Jefferson used a copy of Whateley\'s Observations in which to write his personal views on Hampton Court, Stowe, the Leasowes and Blenheim. This was in 1786. Whateley had described the places which Brown designed and explained their underlying principles. Monticello has a garden-scale Brownian Park with a serpentine walk and clumps. Jefferson had been an keen horticulturalist since his teens and placed symmetrical \'clumps\' of flowers near the house. This parallels the developing enthusiasm for horticulture in England. Though a product of Jefferson\'s personal genius, Monticello can also be seen as a time capsule representation of a late-eighteenth century English garden. The records in Jefferson\'s Garden Book have enabled an accurate restoration and it may now be a better example of its type than any surviving English gardens. One sees something of the character which William Mason created at Nuneham Park. ','','','','','','','','','Thomas Jefferson Memorial Foundation, PO Va 53','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','22902','2011-12-22 14:35:44','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ba25612-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Hamilton Branch State Recreation Area','','','','','','M-Su 6am-dark, daily ','','http://www.southcarolinaparks.com/park-finder/state-park/1188.aspx','','111 Campground RD, Plum Branch, SC 29845','7f7a92b8-ea4c-11e0-8606-00306701b527','ed721720-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3baa8814-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Jackson Lake State Park','','','','','','Open 24 Hours A Day. Quiet Time is 10P to 6A ','','http://parks.state.co.us/Parks/jacksonlake/Pages/jackson%20lake%20main.aspx','','26363 County Road 3, Orchard, CO 80649','7f7a92b8-ea4c-11e0-8606-00306701b527','ec625433-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3baa9301-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Montpelier Garden','Montpelier was the estate of the fourth President of the United States, James Madison. The estate was purchased by the du Pont family in 1901 and Annie du Pont restored the terraces and added brick walls, iron gates and statuary. Annie\'s daughter Marion hired Charles Gillette to design additonal perennial beds. There is a classic temple, with an ice house underneath, overlooking a pond in the north yard. The National Trust for Historic Preservation bought Montpelier in 1984. ','','','','','','','','','11407 Constitution Highway','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','22957','2011-12-22 14:35:44','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3bb2137b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Grayton Beach State Park','','','','','','8:00 a.m. until sundown, 365 days a year, the center is open daily from 9:00 a.m. to 5:00 p.m','','http://www.floridastateparks.org/graytonbeach/default.cfm','','357 Main Park Road ,Santa Rosa Beach, Florida 32459','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3bb6320f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mount Vernon Estate and Gardens','George Washington, America\'s First President, took a great interest in the layout and management of his family estate. The house, built in 1743, is set on a rise overlooking the Potomac. The design makes use of axial lines, inspired by baroque ideas, but Washington owned a copy of Batty Langley\'s New Principles of Gardening and was influenced by the Augustan Style. He designed a serpentine bowling green in front of the house with geometrical gardens to the east and west. Throughout his public life Washington dreamed of rural retirement to his ferme ornee on the Potomac. His family came from Sulgrave Manor in England. The formal flower garden or \'upper garden\' has been restored to reflect George Washington\'s design and features varieties of heritage flowers mentioned by visitors and by Washington\'s gardeners in their weekly work reports. Flowers in the garden include larkspur, foxglove, crown imperial, cardinal flower, jasmine and guelder roses. The English boxwood, which borders the beds, is original and has far outgrown the low, \'neat\' border that Washington intended. Two boxwood parterres have been re-created with the French fleur-de-lis design that Washington admired. The Lower Garden or kitchen garden, likely managed by Martha Washington, yielded most of the fresh vegetables and herbs used by the Mount Vernon household. The plan for the restored lower garden was derived from the same books on gardening that were owned and studied by Washington. In Washington\'s own words, \'tell the gardener I shall expect everything that a Garden ought to produce, in the most ample manner.\' ','','','','','','','','','George Washington Memorial Parkway','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','22121','2011-12-22 14:35:44','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3bb90269-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Weldon Springs State Recreation Area','','','','','','','','http://www.dnr.state.il.us/lands/Landmgt/PARKS/R3/WELDONRA.HTM','','4734 Weldon Springs Rd, Clinton, IL 61727','7f7a92b8-ea4c-11e0-8606-00306701b527','eca8516a-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3bc076a8-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Macomb Reservation State Park ','','','','','','The park opens in mid May and closes after Labor Day.','','http://nysparks.state.ny.us/parks/77/details.aspx','','201 Campsite Road, Schuyler Falls, NY 12985','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3bc2e174-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Norfolk Botanical Garden','Norfolk Botanical Garden was proposed by Frederic Heutte, a horticulturalist, and Thomas P. Thompson, Norfolk City Manager 1935-1938. They secured seventy-five acres of high, wooded ground and seventy-five acres of the Little Creek Reservoir and work began in 1938 on making an Azalea Garden. As the work extended the name was changed to Norfolk Municipal Gardens and then to Norfolk Botanical Garden. It now has a variety of theme gardens: a Japanese Garden, a Desert Plants Garden, a Colonial Garden and a Rose Garden, the Bristow Butterfly Garden, the Sarah Lee Baker Perennial Garden, the Virginia Native Plant Garden and the Four Seasons Garden. The World of Wonders Children\'s Adventure Garden opened in September 2006. It is a 3 acre interactive garden with a focus on education as well as entertainment. ','','','','','','','','','NBG, 6700 Azalea Garden Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','23518','2011-12-22 14:35:44','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3bc8538e-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Ravensburg State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/ravensburg.aspx','','Rauchtown Rd, Jersey Shore, PA 17740','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3bcfedcf-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c682cbd1-203b-11e1-8a87-000c29a5c50c','Everglades National Park','','','','','','Everglades National Park is open 365 days a year.','','http://www.nps.gov/ever/index.htm','','40001 State Road 9336,Homestead, Florida 33034','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3bd87a77-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Mount Greylock State Reservation','','','','','','','','http://www.mass.gov/dcr/parks/western/mgry.htm','','30 Rockwell Road, P.O.Box 138, Lanesborough, MA 01237','7f7a92b8-ea4c-11e0-8606-00306701b527','ece3cdd6-f48c-11e0-b192-003067