-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c6ea372-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Westover Garden','Westover is a grand English-style house and garden on the north bank of the James River in Virginia. Colonel William Byrd bought the plantation of Westover in 1688 and his son built the mansion c1730. The garden stretches to the river. The house and garden survive in good condition. One of Colonel Byrd\'s visitors recorded that \'After breakfast the colonel and I left the ladies to their domestic affairs, and took a turn in the garden, which has nothing beautiful but three terrace walks that fall in slopes one below another.\' ','','','','','','','','','Westover House, 7000 Westover Road','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','23030','2011-12-22 14:35:45','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c74aad1-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Savannas Preserve State Park','','','','','','8 a.m. until 6:00 p.m. 365 days a year','','http://www.floridastateparks.org/savannas/default.cfm','','2541 Walton Road Port St., Lucie, Florida 34952','7f7a92b8-ea4c-11e0-8606-00306701b527','ec88be4d-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c7a8368-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Winkler Botanical Preserve','This small botanic garden was established in the 1980s on a former pig farm. The water features make use of stormwater runoff from the surrounding suburbs - a good precendent for urban stormwater management in parks and gardens. The focus is on species native to the region.','','','','','','','','','5400 Roanoke Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','22311','2011-12-22 14:35:45','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c7dc158-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Royal Mausoleum State Monument','','','','','','8 am to 4 pm , Monday-Friday','','http://www.hawaiistateparks.org/hawaiistateparks/parks/oahu/index.cfm?park_id=30','','2261 Nu\'uanu Avenue, Honolulu, HI 96817','7f7a92b8-ea4c-11e0-8606-00306701b527','ec9bac00-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c87a5fb-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Woodrow Wilson Presidential Library and Birthplace','The manse was built for Reverend Benjamin Mosby Smith in the mid nineteenth century and the Wilson family moved there in 1855. Thomas Woodrow Wilson was born in the manse in December 1856. The Garden Club of Virginia hired Charles Gillette in 1933 to design the boxwood garden and Ralph E Griswold added brick terraces in 1968. There is also a Woodrow Wilson Museum which opened in 1990. ','','','','','','','','','Woodrow Wilson Presidential Library and Museum, 18 North Coalter Street','7f7a92b8-ea4c-11e0-8606-00306701b527','eda693ed-f48c-11e0-b192-00306701b527','','24402','2011-12-22 14:35:45','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c87d37d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Eagle Island State Park','','','','','','','','http://parksandrecreation.idaho.gov/parks/eagleisland.aspx','','4000 W. Hatchery Rd., Eagle, ID 83616','7f7a92b8-ea4c-11e0-8606-00306701b527','eca177fb-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c911e3d-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Jonas Green State Park','','','','','','','','http://www.aacounty.org/RecParks/launch/jonasgreen.cfm','','1990 Governor Ritchie Highway, Annapolis, MD 21401','7f7a92b8-ea4c-11e0-8606-00306701b527','ecdd0565-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c93e419-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Bellevue Botanical Garden','The botanical gardens are in a public park. They have display gardens (including a Japanese garden), woodlands, meadows and wetlands. The Northwest Perennial Alliance maintains a large herbaceous border as part of the botanic garden. ','','','','','','','','','Bellevue Botanical Garden, 12001 Main Street','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98005','2011-12-22 14:35:45','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3c9a463c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Boone\'s Lick State Historic Site','','','','','','Sunrise to sunset, year-round. During periods of heavy snow or ice, the site grounds are periodically closed.','','http://mostateparks.com/park/boones-lick-state-historic-site','','Glasgow, MO 65254','7f7a92b8-ea4c-11e0-8606-00306701b527','ecfdf50e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ca58e3b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Gardner Memorial Wayside Park','','','','','','year-round ','','http://www.nhstateparks.org/explore/state-parks/gardner-memorial-wayside-park.aspx','','Route 4A，Springfield, NH 03284','7f7a92b8-ea4c-11e0-8606-00306701b527','ed189d6b-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ca8b363-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Bloedel Reserve','A 150-acre forest garden made, by the vice-chairman of a lumber company, under the influence of the conservation movement and oriental philosophy. Mr and Mrs Bloedel wished to \'capture the essence of the Japanese garden - the qualities of naturalness, subtlety, reverence, tranquility - and construct a Western expression of it\'. Their approach stands in welcome contrast to that of \'Japanese gardens\' which achieve their effects through the use of ornament. The Bloedel Reserve celebrates growth, decay, regeneration, beauty and the harmony of nature. It has lakes, immaculate lawns, woods, a moss garden, a rhododendron glade, an orchid walk designed by Thomas Church and a reflection garden, partly designed by Richard Haag. The number of visitors to the reserve is limited, to preserve its tranquility. ','','','','','','','','','7571 NE Dolphin Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98110','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3cb5fe32-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Carl S. English Jr. Botanical Garden','Carl S. English, Jr. made a garden by the Locks which join Puget Sound to Lakes Union and Washington. In 1931, he was hired by the Corps. His vision and expertise as a horticulturist and botanist transformed the grounds from a graveled extension of a construction site into a lovely English estate style garden. Carl retired in 1974 as one of the Northwest\'s leading horticulturists. He is credited with the discovery and naming of three rare plants -Talinum okanoganense (fameflower), Lewisia rupicola (bitter root), and Claytonia nivalis (spring beauty). Carl also helped to develop the waterside plantings along the Fremont and Montlake Cuts that are part of the Lake Washington Ship Canal. The style of the planting design is gardenesque. ','','','','','','','','','Hiram M. Chittenden Locks, 3015 NW 54th Street','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98107','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3cc0b5cb-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fort Fisher State Recreation Area','','','','','','November - February, 8 a.m. - 6 p.m. March 8 a.m. - 8 p.m. April, May, September, 8 a.m. - 8 p.m.\r\nOctober, 8 a.m. -8 p.m. June - August, 8 a.m. - 9 p.m. Closed Christmas Day.','','http://www.ncparks.gov/Visit/parks/fofi/main.php','','1000 Loggerhead Road, Kure Beach, NC 28449','7f7a92b8-ea4c-11e0-8606-00306701b527','ed336e0f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3cc2125d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Chase Garden','Chase garden is on a hill overlooking the Puyallup River Valley and Mt Rainier. It was designed by landscape architect, Rex Zumwalt, and has two pools set in naturalistic woodland with an understory of native shrubs. There are carpets of trillium, erythronium, vanilla leaf, and other wildflowers. ','','','','','','','','','16015 264th St. E.','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98360','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ccea315-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Dunn Gardens','Arthur Dunn asked the Olmsted Brothers to design a \'country place\' in 1915. The landscape design took advantage of the sloping ground, the woods and the views of of Puget Sound and the Olympic Mountains. Arthur\'s house does not survive but after his death in 1945 new homes were built for his 3 children and the Olmsted landscape is in good condition. One of the children, Edward Bernard Dunn, became president of the American Rhododendron Society. He converted the garage building into a house and made a 2.5-acre garden. ','','','','','','','','','The E.B. Dunn Historic Garden Trust, P.O. Box 77126','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98177','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3cd65dcb-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c682cbd1-203b-11e1-8a87-000c29a5c50c','Grand Canyon National Park','','','','','','The South Rim is open 24 hours a day, 365 days a year. Reservations are strongly recommended during the busy summer season. Some facilities are closed during the winter.','','http://www.nps.gov/grca/index.htm','','P.O. Box 129, Grand Canyon, AZ 86023','7f7a92b8-ea4c-11e0-8606-00306701b527','ec55e77f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3cdabbfe-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Evergreen Arboretum & Gardens','Evergreen Arboretum opened in 1964. There is a Japanese Maple Walk, woodland garden, rock garden and perennial gardens.','','','','','','','','','145 Alverson Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98201','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ce07e58-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Whirlpool State Park ','','','','','','Open year round','','http://nysparks.state.ny.us/parks/105/details.aspx','','3180 Deveaux Woods Dr, Niagara Falls, NY 14305','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ce6a553-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Kubota Garden','Fujitaro Kubota emigrated to the US from Japan in 1907 and began the garden in 1927. In 1987, the City of Seattle acquired the garden and it became a public park.  There is a series of ponds fed by Mapes Creek, waterfalls and bridges. Tom Kubota, son of Fujitaro, designed a stroll garden in 1999.','','','','','','','','','9817 55th Avenue S.','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98118','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3ce85c0c-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Van Buren State Park','','','','','','','','http://www.dnr.state.oh.us/parks/parks/vanburen/tabid/794/Default.aspx','','12259 Township Road 218, Van Buren, OH 45889','7f7a92b8-ea4c-11e0-8606-00306701b527','ed462932-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3cf2a6ec-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Lakewold Gardens','The renowned Landscape Architect, Thomas Church, took cues from the formal architecture of the Georgian-style Wagner House and composed scenic vistas and his oft-noted \'garden rooms\' as a study in contrasts - grand vs. intimate, formal vs. naturalistic, classical vs. modern. Lakewold Gardens reflects a landmark moment in the History of Garden Design when modern ideas came head-to-head with tradition. Corydon and Eulalie Wagner, the former owners of Lakewold Gardens, have left a legacy of over 250 species of Rhododendrons, more than 30 varieties of Japanese Maples, and many unique trees, such as our grand Metasequoia or Dawn Redwood (one of the largest in Washington), and other shrubs and groundcovers from around the world. There is a rose-covered teahouse, Quatrefoil pool, Medieval Knot Garden, Fern Garden and Woodland Garden. ','','','','','','','','','12317 Gravelly Lake Drive SW','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98499','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3cf71158-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Holbrook Island Sanctuary State Park','','','','','','Open All Year','','http://www.maine.gov/cgi-bin/online/doc/parksearch/search_name.pl?state_park=9&historic_site=&public_reserved_land=&shared_use_trails=&option=search','','PO Box 35, Brooksville, ME 04617','7f7a92b8-ea4c-11e0-8606-00306701b527','eccfb580-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d0013cf-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Manito Park and Gardens','The old \'Montrose Park\' was changed in 1903 to \'Manito Park\' meaning \'Spirit of Nature\' in the dialect of the Algonquin Native American Tribe. It is a collection of theme gardens including deometrical carpet beds in a sunk garden (designed by John W Duncan), a garden of herbaceous perennials a rose garden and the Nishinomiya Japanese Garden designed by Nagao Sakure. ','','','','','','','','','Manito Park, 1800 Grand Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','99202','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d063a28-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Craig House','','','','','','Open daily: 9 a.m. - 4:30 p.m.','','http://www.state.nj.us/dep/parksandforests/parks/monbat.html','','16 Business Route 33, Manalapan, NJ 07726','7f7a92b8-ea4c-11e0-8606-00306701b527','ed1ec7f1-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d0d34a2-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Medicinal Herb Garden','Medicinal herb gardens were characteristic of European universities from the renaissance onwards. This garden has something of their character but is also used in the education of landscape architects and therefore has a much wider range of plants. ','','','','','','','','','Botany Department, University of Washington, Box 355325','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98195','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d0df279-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Old Erie Canal State Historic Park ','','','','','','The park is open year-round.','','http://nysparks.state.ny.us/parks/17/details.aspx','','Dewitt/Rome, NY 13082','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d1b62ea-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Selkirk Shores State Park ','','','','','','Park is open year-round.','','http://nysparks.state.ny.us/parks/84/details.aspx','','7101 State Route #3, Pulaski, NY 13142','7f7a92b8-ea4c-11e0-8606-00306701b527','ed2c232f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d20be0a-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Ohme Gardens','A remarkable Alpine garden in the Cascade Mountains, overlooking the Columbia River. Unlike many British Alpine gardens it has appropriate topography for such a project. ','','','','','','','','','3327 Ohme Road, Wenatachee','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98801','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d23cbbf-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Fisher Grove State Park','','','','','','','','http://gfp.sd.gov/state-parks/directory/fisher-grove/','','17290 Fishers Lane, Frankfort, SD 57440','7f7a92b8-ea4c-11e0-8606-00306701b527','ed78a5d5-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d2be1d0-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Del Norte Coast Redwoods State Park','','','','','','Campgrounds are open from May 1 - September 30 ','','http://parks.ca.gov/?page_id=414','','1111 2nd Street, Crescent City,?CA?95531','7f7a92b8-ea4c-11e0-8606-00306701b527','ec5e0f3f-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d2f9048-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Point Defiance Park','A range of theme gardens including a Japanese Garden with a pagoda (1914), Rose Garden, Northwest Native Garden, Dahlia Trial Garden, Fuchsia Garden, Herb Garden, Iris Garden and Rhododendron Garden. The Rose Garden was established in 1895, when Superintendent Ebenezer Roberts solicited donations of rose cuttings from school children. There are now more than 1,500 rose bushes over more than an acre of land, including a garden of miniature roses, arbors with climbing roses, a picturesque wishing well and gazebos. The Northwest Native Garden was established in 1964 by the Tacoma Garden Club. The garden features a waterfall and pool that divide the garden into seven areas reflecting Pacific Northwest vegetation zones. ','','','','','','','','','5400 N Pearl St.','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98407','2011-12-22 14:35:46','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d33966b-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Madison Buffalo Jump State Park','','','','','All Year','Daylight Hours ','','http://www.visitmt.com/categories/moreinfo.asp?SiteID=1&IDRRecordID=3939','','1400 South 19th Avenue，Bozeman, MT 59718','7f7a92b8-ea4c-11e0-8606-00306701b527','ed049c7e-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d3a2eda-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Seymour Botanical Conservatory','A Victorian-style conservatory in Wright Park, named after the man who domated the money for its construction. William W. Seymour was president of the Board of Park Commissioners from 1909 to 1911. It contains tropical plants. ','','','','','','','','','W.W. Seymour Botanical Conservatory, 316 South G St','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98405','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d453e36-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Washington Park Arboretum and Japanese Garden','A large arboretum, run by the University of Washington, with a 3.5 acre Japanese Garden made by Japanese designers in the 1960s. It has a tea house, pagoda and lanterns. ','','','','','','','','','2300 Arboretum Drive East, University of Washington, Seattle','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98112','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d50d246-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Weyerhaeuser International Headquarters Garden','The building was designed by Skidmore, Owings & Merrill and the landscape architecture was by Sasaki, Walker Associates, both firms based in San Francisco. The building sits between two low hills and an artificial lake supplied by Hylebos Creek. Extensive use was made of native plants. ','','','','','','','','','Weyerhaeuser Company, P.O. Box 9777, Federal Way','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98063','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d5d4357-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Woodland Park Rose Garden','A former estate, and private zoo, belonging to Guy Phinney, was purchased by the City of Seattle in 1883. They comissisoned a design from the Olmsted Brothers. The Rose Garden, in a woodland setting, was a later design (not by the Olmsteds). It has a geometrical design with an axis. With hybrid teas, miniatures, climbers, tree roses, David Austens and All-America winners, there are over 290 varieties of rose and over 5,000 plants. Restoration of the Bas-relief and the historical water features was completed in 2006. The garden is one of only 24 All-America Rose Selections Test Gardens in the United States. ','','','','','','','','','Woodland Park Zoo, 601 N. 59th Street','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','98103','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d69899c-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Core Arboretum Garden','The Arboretum is named after its academic founder, the botanist Earl L. Core (1902-1985), and specializes in native vegetation. There are 3.5 miles of walking trails. ','','','','','','','','','Deptartment of Biology, West Virginia University, PO Box 6057','7f7a92b8-ea4c-11e0-8606-00306701b527','edb324d8-f48c-11e0-b192-00306701b527','','26506','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d758c97-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Sunshine Farm Gardens','Sunshine Farm is a mountain top garden developed by Barry Glick since 1972. The garden was redesigned by Matthew Bishop in 1993. There is a focus on Hellebores.','','','','','','','','','HC 67 Box 539 B','7f7a92b8-ea4c-11e0-8606-00306701b527','edb324d8-f48c-11e0-b192-00306701b527','','24966','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d85cea0-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Allen Centennial Gardens','The Garden was designed by an alumnus of the University of Wisconsin\'s Landscape Architecture Department: Dennis Buettner. They are around a Victorian house and elements of English design were an obvious choice. But there is also an emphasis Wisconsin\'s flora ','','','','','','','','','University of Wisconsin, 620 Babcock Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','edb9e269-f48c-11e0-b192-00306701b527','','53706','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3d96fcac-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Boerner Botanical Gardens','This is one of the few parks to be named after a landscape architect and is a tribute to Alfred L. Boerner promotion of public parks. Boerner believed a park should have both aesthetic and educational dimensions - that the aesthetics should be based on Beaux Art principles. The Botanical Gardens have axes centering on a fountain and they serve as malls for perennials and annuals. ','','','','','','','','','Boerner Botanical Gardens, Whitnall Park, 9400 Boerner Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','edb9e269-f48c-11e0-b192-00306701b527','','53130','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3da4b46f-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Green Bay Botanical Garden','The gardens were designed by a landscape architect with a special interest in botanical gardens (Dennis Buettner). The garden focuses on the region\'s flora. Theme gardens include Four Seasons Garden, Woodland Garden, Children\'s Garden, Contemporary Rose Garden, Cottage Garden, Color and Foliage Garden, Designated All-America Selections Display Garden, perennial, annual and herb displays. ','','','','','','','','','2600 Larsen Road','7f7a92b8-ea4c-11e0-8606-00306701b527','edb9e269-f48c-11e0-b192-00306701b527','','54303','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3db0282e-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Mitchell Park Conservatory (The Domes)','The Mitchell Park Conservatory consists of three conoidal (cone shaped) domes - The Floral Show Dome, The Tropical Dome and The Arid Dome.  They are affectionately referred to as \'The Domes\'.  The original conservatory in Mitchell Park was found to be unsafe in 1955 and was demolished.  Donald Grieb won the design competition for a new conservatory and the construction of the 140 by 85 foot domes began in 1959.','','','','','','','','','524 S. Layton Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','edb9e269-f48c-11e0-b192-00306701b527','','53215','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3dbcd067-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Olbrich Botanical Gardens','The garden is named after Michael B. Olbrich, who purchased the land next to Lake Monona for the development of a park.  There is a perennial garden, sunken garden, rose garden, rock garden, wildflower garden, conservatory and Thai pavilion and garden.  The Bolz Conservatory is a 50 ft glass pyramid containing a collection of tropical plants, a waterfall and birds.','','','','','','','','','3330 Atwood Avenue','7f7a92b8-ea4c-11e0-8606-00306701b527','edb9e269-f48c-11e0-b192-00306701b527','','53704','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3dc9b8b1-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Paine Gardens','The house, in a style known in Britain as Mock Tudor, was built by the local lumber baron Nathan Paine - and is now listed on the National Register of Historical Places. It provides as near as one can get to an English garden experience in Winconsin. The garden is also attractively Mock Tudor. It has a Primrose Path, a Sunken Garden and a hedge inspired by Hampton Court Palace (in south west London). ','','','','','','','','','Paine Art Center and Gardens, 1410 Algoma Blvd','7f7a92b8-ea4c-11e0-8606-00306701b527','edb9e269-f48c-11e0-b192-00306701b527','','54901','2011-12-22 14:35:47','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3dd62c0d-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Rotary Gardens Janesville','Rotary Botanical Gardens has 18 different themed gardens. Many have an international focus, such as the Japanese, Scottish, French Formal, Italian and English Cottage Gardens. Also included are less formally-structured gardens including one of very few Fern and Moss gardens in the United States, as well as Shade, Prairie and Woodland Gardens. The look of the Gardens changes seasonally as well as annually with impressive seasonal displays of annual, tropical and perennial plants. The Rotary Gardens host a number of events include Winged Wonders: Free-flying Butterflies and Moths, Wine and Roses, Home Garden Tours, Twilight Tours, Halloween Walk, and A Taste of Chocolate and Winter Wonderland Walk (featuring over 200,000 Christmas lights), and many educational bus trips, horticultural classes throughout the year. ','','','','','','','','','Parker Education Center Rotary Gardens, 1455 Palmer Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','edb9e269-f48c-11e0-b192-00306701b527','','53545','2011-12-22 14:35:48','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3de27396-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','University of Wisconsin-Madison Arboretum','The university decided to re-establish natural habitats on an area of farmland by Lake Wingra and so the arboretum was founded in 1934. This was pioneering work in the field of restoration ecology and the arboretum holds an important collection of restored ecosystems.  The arboretum comprises prairie, wetlands, conifer and deciduous forests.  The Longenecker Gardens is a 50 acre area notable for its lilacs and flower crabapples.','','','','','','','','','1207 Seminole Highway','7f7a92b8-ea4c-11e0-8606-00306701b527','edb9e269-f48c-11e0-b192-00306701b527','',' 53711','2011-12-22 14:35:48','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3de9c775-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Kinzua Bridge State Park','','','','','','','','http://www.dcnr.state.pa.us/stateparks/parks/kinzuabridge.aspx','','Smethport, PA 16749','7f7a92b8-ea4c-11e0-8606-00306701b527','ed5eeca6-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3deedeeb-2caa-11e1-8be5-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','9e2b6436-2355-11e1-b9c6-000c29a5c50c','Cheyenne Botanic Gardens','The Cheyenne Botanic Gardens is Wyoming\'s only public botanical garden. It is located on nine acres in Lions Park. It includes over 27 outside specialty gardens and a solar heated and powered conservatory. Specialty gardens include the Bedont Rose Garden, Xeriscape Garden, Perennial Border and Woodland Garden. Seniors, youth and disabled volunteers provide over 90% of the physical labour for the gardens.','','','','','','','','','Cheyenne Botanic Gardens, 710 S. Lions Park Drive','7f7a92b8-ea4c-11e0-8606-00306701b527','edc00c69-f48c-11e0-b192-00306701b527','','82001','2011-12-22 14:35:48','a1c3e20e-f181-11e0-8a53-00306701b527',1),('3e728240-2691-11e1-a974-000c29a5c50c','ff2b0b4d-203c-11e1-8a87-000c29a5c50c','','068cea88-28cb-11e1-abb7-000c29a5c50c','c689639b-203b-11e1-8a87-000c29a5c50c','Birch Bay State Park','','','','','','Summer: 6:30 a.m. to dusk. Winter: 8 a.m. to dusk.','','http://www.parks.wa.gov/parks/?selectedpark=Birch%20Bay','','5105 Helweg Road, Blaine, WA 98230','7f7a92b8-ea4c-11e0-8606-00306701b527','edad8259-f48c-11e0-b192-00306701b527','','','2011-12-22 13:22:58','a1c3e20e-f181-11e0-8a53-0